CREATE TABLE `dala_brands` (
  `dala_brands_ID` int NOT NULL AUTO_INCREMENT,
  `dala_brands_date_created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `dala_brands_name` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `dala_brands_featured_image` text CHARACTER SET utf32 COLLATE utf32_unicode_ci NOT NULL COMMENT 'Representative image of the brand',
  `dala_brands_information` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'About the brand, Information about the brand',
  `dala_brands_excerpt` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'A short introduction to the brand',
  `dala_brands_status_stores` int NOT NULL DEFAULT '1' COMMENT 'Store for display for admin approval. [0: In draft mode. admin DALA not seen, only displayed in the store] [1: pending version. send admin for approval ]',
  `dala_brands_status_admin` int NOT NULL DEFAULT '0' COMMENT 'Brand status. Admin DALA approved [0: Waiting for ADMIN approval] [1:Approved] [2: Edited content, waiting for admin to review] [3: Admin rejected the approval, see qoute to edit content send admin to review]',
  `dala_brands_status_update` int NOT NULL DEFAULT '0' COMMENT 'Update status. [0: The brand has not been approved by the admin yet] [1: The status has been approved by the admin once, later editing the content will be considered a pending repair status]',
  `dala_brands_stores_id` int NOT NULL COMMENT 'Brand Created Store [ID]',
  `dala_brands_qoute` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Messages, chat between the store and admin DALA',
  PRIMARY KEY (`dala_brands_ID`),
  KEY `brands_stores_id` (`dala_brands_stores_id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='List of brands, Stores can also create new brands, DALA admin approves';
