INSERT INTO `dala_brands` VALUES (1,'2021-07-22 16:32:02','Nông lâm food','','','',1,1,1,17,''),(2,'2021-07-22 16:32:16','BerryLand','','','',1,1,1,17,''),(3,'2021-07-22 16:32:41','Ladophar','','','',1,1,1,17,''),(4,'2021-07-22 16:32:56','Biofresh','','','',1,1,1,17,''),(5,'2021-07-22 16:33:12','Dalat Natural Food','','','',1,1,1,17,''),(6,'2021-07-22 16:33:36','Quốc Lộc Coffee','','','',1,1,1,17,''),(7,'2021-07-22 16:34:01','BaolocReal coffee','','','',1,1,1,17,''),(10,'2021-10-18 11:25:03','L\'angfarm','https://appdala.net/wp-content/uploads/tai-xuong-1.png','','',1,1,1,31,''),(12,'2022-01-10 09:25:34','Ladofoods','https://appdala.net/wp-content/uploads/logo-ladofoods.jpg','Được kế thừa trên nền tảng xưởng rượu Lafaro của người Pháp, xây dựng từ những năm đầu thế kỷ 20, Công ty Cổ phần thực phẩm Lâm Đồng – Ladofoods đã giữ gìn và tiếp tục phát triển lớn mạnh. Phát huy những ưu thế đã có Ladofoods luôn nỗ lực phấn đấu để khẳng định vị thế là nhà làm vang số 1 tại Việt Nam. Ladofoods cam kết mang đến cho khách hàng những chai vang chất lượng theo chuẩn mực quốc tế về vang…','',1,1,1,17,''),(13,'2022-01-13 10:12:46','Hoàng Thiên Long Farm','https://appdala.net/wp-content/uploads/logo-HTL-copy.jpg','Là một địa chỉ tin cậy cung cấp các mặt hàng nông sản , đặc sản uy tín tại thị trường Đà Lạt với kinh nghiệm hoạt động nhiều năm. Mỗi sản phẩm đều được lựa chọn kỹ lưỡng trước khi đưa đến tay khách hàng , đảm bảo giữ gìn được sự uy tín và chất lượng cho sản phẩm đặc sản Đà Lạt.','',1,1,1,34,''),(14,'2022-03-03 16:16:26','Đặc sản HANY Đà Lạt','https://appdala.net/wp-content/uploads/z3218691468677_321f81bd55013c3c1b73316d91dc7adb-1.jpg','Với những trăn trở làm sao để du khách khi đến Đà Lạt ngoài tham quan, nghỉ dưỡng khi về họ còn mua được những “ Món quà xứ lạnh” đảm bảo chất lượng và giá cả hợp lý...Từ tình hình đó công ty chúng tôi quyết định xây dựng một thương hiệu đặc sản Đà Lạt với phương châm \"Vì sức khỏe người tiêu dùng\", công ty chúng tôi là một trong những công ty đi tiên phong sản xuất các mặt hàng đặc sản Đà Lạt với định hướng “Đặc sản Đà Lạt  phải có xuất xứ từ Đà Lạt”.Sản phẩm của công ty chúng tôi là sự kết hợp giưa kinh nghiệm truyền thống và dây chuyền máy móc sản xuất hiện đại với nguồn nguyên liệu chính là nông sản của vùng đất Đà Lạt- Lâm Đồng để cho ra những sản phẩm đúng chất lượng, an toàn,đẹp mắt….mang đậm nét đặc trưng của đặc sản Đà LạtHiện tại Công ty Hany là nơi tiêu thụ một lượng nông sản đáng kể cho nông dân địa phương.Với định hướng”Đặc sản Đà Lạt cũng cần phải có thương hiệu” không những phục vụ cho du khách khi đến thăm thành phố ngàn hoa mang về làm quà mà chúng tôi còn mang ”MÓN QUÀ XỨ LẠNH”  vào các hệ thống siêu thị cũng như những hệ thống bán lẻ trên toàn quốc ,từ đó sẽ vươn tầm ra thị trường ngoài nước.Chúng tôi tự hào là một trong những nhà sản xuất đặc sản Đà Lạt với uy tín , chất lượng hàng đầu, với tôn chỉ “Vì sức khỏe người tiêu dùng” và “Đặc sản Đà Lạt phải được làm từ nông sản Đà Lạt”','',1,1,1,36,''),(15,'2022-03-18 17:44:00','Dala','','','',1,1,1,17,''),(16,'2022-03-18 17:46:58','Thanh Hùng','','','',1,1,1,17,''),(17,'2022-03-20 11:41:41','Ngọc Duy','https://appdala.net/wp-content/uploads/logongocduy-1.jpg','','',1,1,1,17,''),(18,'2022-03-20 11:43:22','Đan Ngọc','https://appdala.net/wp-content/uploads/z3274617354747_d42f2e25c9f637da0a5466ebe65d52b8-1.jpg','','',1,1,1,17,''),(20,'2022-03-20 17:05:03','Macca Hoài Anh','','','',1,1,1,17,''),(21,'2022-03-21 21:19:58','DaLaVi','https://appdala.net/wp-content/uploads/Logo-DaLaViDSDL.png','DaLaVi hoạt động chú trọng ở lĩnh vực: Trồng dâu, Chế biến và bảo quản rau quả, Chế biến và phân phối các đặc sản từ Đà Lạt. Với nỗ lực vươn lên, DaLaVi luôn cầu thị để ngày một hoàn thiện chất lượng sản phẩm, sự hài lòng tối đa nhất của khách hàng. Với tôn chỉ “Nối dài những cánh tay”, DaLaVi luôn sẵn sàng chào đón các nhà đầu tư quan tâm đến các dự án đang phát triển và nhiều dự án sẽ ra mắt thời gian tới:','',1,1,1,40,''),(22,'2022-11-28 09:05:33','Trà Oolong Hà Linh','https://appdala.net/wp-content/uploads/OOlongHaLinh-LOGO-1.jpg','','',1,1,1,43,''),(23,'2022-12-02 10:23:47','Hoàng Anh Macca','https://appdala.net/wp-content/uploads/logo.png','','',1,1,1,32,''),(24,'2022-12-27 15:23:19','Lafresh','','','',1,1,1,17,''),(25,'2023-01-11 13:27:55','SeedKfé','','','',1,1,0,17,'');
