/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trig_discount_program_before_update` BEFORE UPDATE ON `dala_discount_program` FOR EACH ROW BEGIN  


	
	
