INSERT INTO `dala_news` VALUES (4,'Chào mừng Festival hoa Đà Lạt, Freeship toàn DALA','2022-11-17 15:17:41','https://appdala.net/wp-content/uploads/FRESHIP.png','','Chào mừng Festival hoa Đà Lạt năm 2022, Từ ngày 15/12/2022 đến hết ngày 31/12/2022, Nhập mã \"FREESHIP50\".DALA sẽ Freeship cho đơn hàng từ 1 triệu đồng trở lên, tối đa 50k. 																														',1),(5,'Chương trình của Festival Hoa Đà Lạt 2022','2022-12-15 18:36:11','https://appdala.net/wp-content/uploads/festival-hoa-da-lat-2022-2112022.jpg','','																		1. Chương trình nghệ thuật \"Bảo Lộc - Hương trà, Sắc tơ\" chào mừng Festival Hoa Đà Lạt lần thứ IX – năm 2022, được tổ chức vào ngày 10.12 tại Quảng trường 28.3 – TP.Bảo Lộc.\n\n2. Trưng bày triển lãm hoa và cây có hoa quốc tế, được tổ chức từ ngày 15.12 đến ngày 2.1.2023, tại Vườn hoa TP.Đà Lạt.\n3. Không gian hoa, được tổ chức từ ngày 15.12 đến ngày 31.1.2023 gồm: Tiểu cảnh hoa trên mặt hồ và các tiểu cảnh hoa xung quanh hồ Xuân Hương; Đường hoa Lê Đại Hành, cầu Ông Đạo, đài phun nước cầu Ông Đạo, đường Nguyễn Văn Cừ, công viên Trần Hưng Đạo; Không gian sắc màu hoa Đà Lạt tại khu Công viên Trần Quốc Toản.\n4. Trình diễn thời trang Tơ lụa - Con đường di sản, được tổ chức vào ngày 17.12 và Không gian triển lãm \"Thiên đường Tây Nguyên\", được tổ chức từ ngày 11.11 đến ngày 1.1.2023 tại ven hồ Xuân Hương (khu vực đối diện chùa Quán Thế Âm) TP.Đà Lạt.\n5. Chương trình Lễ khai mạc Festival Hoa Đà Lạt lần thứ IX - năm 2022, được tổ chức vào tối ngày 18.12 tại Quảng trường Lâm Viên TP.Đà Lạt.\n6. Chương trình nghệ thuật \"Khát vọng Đà Lạt\", được tổ chức vào lúc 20 giờ 00 phút ngày 24.12 tại Quảng trường Lâm Viên TP.Đà Lạt.\n7. Chương trình nghệ thuật “Chào năm mới 2023”, được tổ chức vào lúc 20 giờ 00 phút ngày 31.12 tại Quảng trường Lâm Viên TP.Đà Lạt.\n8. Cùng với các chương trình văn nghệ, vui chơi, giải trí, trưng bày, giới thiệu các sản phẩm nông sản mang thương hiệu “Đà Lạt - Kết tinh kỳ diệu từ đất lành”, hoa là chủ thể chính trong dịp Festival Hoa này. Đây là sự kiện văn hóa hấp dẫn du khách.															',1),(8,'Dala Siêu giảm giá mừng năm mới 2023','2023-01-06 14:01:59','https://appdala.net/wp-content/uploads/sieu-sale-dala-1x3-2.jpg','','Chào mừng năm mới 2023 siêu giảm giá các mặt hàng đặc sản Đà Lạt trên toàn hệ thống của Dala.vn\n- Giảm giá tới 40% các mặt hàng Đặc sản Đà Lạt trên toàn hệ thống\n- Freeship trên toàn quốc đơn hàng trên 1 triệu đồng (tối đa 50k)\n- Mua càng nhiều càng rẻ (liên hệ Hotline: 0982900100)\n- Và nhiều chương trình ưu đãi hấp dẫn khác!\n-------------------------------------------\nWebsite đặt hàng: Dala.vn\nTìm kiếm\" Dala-Đặc sản Đà Lạt\" tại kho ứng dụng và tải app trên Apstore &IOS\nHotline: 0982900100',1),(9,'Seed Kfé - Cà phê sạch cho cuộc sống xanh','2023-03-01 05:05:27','https://appdala.net/wp-content/uploads/a-son.jpg','','Bắt đầu hành trình từ những năm 2000, Seed Kfé ra đời mang lại giá trị nguyên bản với khát vọng nâng tầm giá trị của hạt cà phê Việt vươn xa ra thế giới.Với sứ mệnh lưu giữ nét tinh túy từ hạt và vị cafe Arabica và Robusta hoàn hảo của Việt Nam, tạo ra giá trị cao bằng sự thấu hiểu và hài lòng, Seed Coffee mong muốn gìn giữ và nâng cao chất lượng cafe Việt với đúng tinh thần “cafe sạch cho cuộc sống xanh”, hướng đến sản phẩm cà phê nguyên chất có giá trị cao tại Việt Nam và cũng như từng bước vươn ra thị trường quốc tế. Công ty TNHH Seed Coffee là một trong những đơn vị tiêu biểu được cấp giấy chứng nhận quyền sử dụng nhãn hiệu \"Đà Lạt – Kết tinh kỳ diệu từ đất lành\".​Nông trường cà phê của Seed Coffee được trồng, chăm bón bằng chương trình vi sinh hữu cơ; sử dụng 100% phân bón hữu cơ sinh học AMI-AMIα do Công ty Ajinomoto Việt Nam sản xuất; thành phần chính là chất hữu cơ thu được trong quá trình lên men sản xuất bột ngọt bằng mật mía và tinh bột khoai mì giúp cho cây khỏe mạnh, kháng bệnh tốt và cho ra sản phẩm sạch.Với quy trình trồng, chăm sóc, thu hoạch, chế biến, đóng gói sản phẩm của Seed Coffee đều theo một quy trình khép kín, xuyên suốt “từ nông trại đến ly cafe” nhằm cho ra đời những sản phẩm đạt chất lượng tốt nhất, mang lại hương vị tự nhiên. Đặc biệt sản phẩm cafe của Seed Coffee nói không với chất phụ gia, chất bảo quản. Ngoài ra sản phẩm của Seed Coffee được các cơ quan có thẩm quyền cấp chứng nhận cơ sở sản xuất đạt vệ sinh an toàn thực phẩm và được cấp nhiều chứng nhận nhãn hiệu khác.Hiện nay Công ty TNHH Seed Coffee cung cấp ra thị trường các loại sản phẩm được chế biến từ cà phê Arabica và Robusta như:Cà phê hạt rang mộcĐược phối trộn 100% hạt cà phê Arabica Cầu Đất Đà Lạt và hạt cà phê Robusta trồng tại vùng đất Laba (Phú sơn - Lâm Hà) với tỷ lệ phối trộn hoàn hảo, giữ lại trọn vẹn hương vị chân thực trong từng hạt cà phê: đắng đậm, ngọt hậu mà sâu lắng, đó cũng là hương vị mang bản sắc riêng từ nông trại Seed Kfé.Cà phê phin giấy túi lọcDòng cà phê Laba Blend được phối trộn 100% hạt cà phê Arabica Cầu Đất Đà Lạt và hạt cà phê Robusta nguyên chất với phương pháp truyền thống nhằm giữ trọn hương vị đậm đà, hương thơm đặc trưng của cà phê Việt Nam truyền thống sẽ mang đến bạn sự tỉnh thức mạnh mẽ cho những ý tưởng sáng tạo đột phá.',1);
