.1, TP.Đà Lạt (Hoạt động từ 8h - 21h tất cả các ngày)',160000,140000,NULL,NULL,3,1,2,1,1,0,1,'','','',NULL,NULL,NULL,500),(356,'Nước cốt hoa Atiso đỏ ',0,'2022-02-17 16:55:26','356UW',0,35,0,'https://appdala.net/wp-content/uploads/cm1.jpg','https://appdala.net/wp-content/uploads/cm2.jpg;https://appdala.net/wp-content/uploads/cm3.jpg;https://appdala.net/wp-content/uploads/cm4.jpg','','NƯỚC CỐT HOA ATISO ĐỎ \nNước cốt atiso đỏ được chiết xuất từ tinh chất của đài hoa atiso đỏ hay còn gọi là bông bụt giấm.\n- Đài hoa Atiso đỏ có công dụng làm giãn cơ trơn tử cung, chống co thắt cơ trơn, giảm viêm họng, ho, giúp hạ huyết áp và có tính kháng sinh.\n- Nước cốt từ đài hoa có chứa Acid hữu cơ có công dụng lọc máu, lợi mật, lợi tiểu, kích thích nhu động ruột và giảm áp suất mạch, lại có tác dụng nhuận tràng và kháng khuẩn.\n- Nước cốt atiso đỏ còn chứa chất chống oxy hoá cao gấp nhiều lần nước cốt dâu tằm,và giúp làm đẹp da.\n- Hoa atiso đỏ ngâm cùng đường trắng làm thức uống mát gan, giải nhiệt, phòng ngừa rôm sảy ở trẻ.\n- Đối với những người mập đang muốn giảm cân, atiso đỏ có tác dụng ức chế men amylase, một enzym có thể phá hủy nhanh lượng tinh bột thừa trong cơ thể.\n- Hoa atiso đỏ có chứa nhiều vitamin C, do đó ngoài tác dụng tăng sức đề kháng cho cơ thể nó còn có tác dụng nhất định trong việc giúp làn da được trắng hồng mịn màng.\n*****Hướng dẫn một số cách pha chế nước cốt hoa Atiso đỏ\n-- Trà Atiso đỏ\nNgâm 1 túi trà không vị trong 100ml nước sôi, sau đó vớt túi trà ra, hòa thêm 200ml nước cốt atiso đỏ, thêm 2 quả tắc hoặc nửa quả chanh. Xé nhỏ 3 bông mứt atiso đỏ (nếu đó) trộn chung vào hỗn hợp.Thêm đá và thưởng thức!\n-- Nước Atiso đỏ\nPha nước cốt và nước lọc theo tỉ lệ 2:1 (2 phần nước cốt – 1 phần nước lọc), sau đó thêm 2 quả tắc hoặc nửa quả chanh. Xé nhỏ 3 bông mứt atiso đỏ (nếu đó) trộn chung vào hỗn hợp.Thêm đá và thưởng thức!\n– Sản phẩm có sử dụng đường, acid citrid và muối của acid sorbid nhằm duy trì màu sắc và hương vị sản phẩm.\n– Hạn sử dụng: 6 thán