ng dụng tốt đối với sức khỏe: Bảo vệ cơ thể với thành phần hoạt chất của hoa hồng có chứa chất oxy hóa mạnh.\n- Cánh hoa hồng có chứa nhiều vitamin A, E giúp giữ ẩm và làm săn chắc da, giảm các nếp nhăn và hạn chế sự xuất hiện của quầng thâm.\n- Vitamin C là chất chống oxy hóa có hàm lượng rất nhiều trong trà hoa hồng.\n- Uống trà hoa hồng thúc đẩy quá trình sản xuất collagen, đó là protein giúp da luôn khỏe đẹp.\n- Trà hoa hồng giúp cải thiện tình trạng tổn thương da, giúp làm đẹp da.\n\n*** HƯỚNG DẪN SỬ DỤNG\nCó thể dung để pha trà, trà sữa,…\nLưu ý: Không dùng cho phụ nữ có thai. Không uống trà khi đói\n\n\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 75 gram\n– Quy cách đóng gói: hộp nhựa\n\n\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc\nMua trực tiếp tại Tiệm Dâu Nhỏ:\n40B Trương Công Định, Phường 1, Đà Lạt, Lâm Đồng',83000,NULL,NULL,NULL,0,0,2,0,1,0,0,'','','',NULL,NULL,NULL,75),(371,'Trà Hoa Lài Berryland - Chai 35g ',0,'2022-02-19 20:50:26','371KV',0,35,0,'https://appdala.net/wp-content/uploads/thl.jpeg','https://appdala.net/wp-content/uploads/thl1.jpeg;https://appdala.net/wp-content/uploads/thl2.jpeg','',' TRÀ HOA LÀI SẤY KHÔ \n- Hoa lài có tác dụng giảm căng thẳng, thanh nhiệt, hạ sốt, giảm đau nhức xương khớp và đau bụng do ăn đồ lạnh.\n- Hoa lài có tác dụng điều hòa quá trình sản sinh insulin nhằm ổn định nồng độ đường huyết và ngăn ngừa tiểu đường.\n- Các polyphenol trong hoa lài – đặc biệt là epigallocatechin gallate (EGCG) có tác dụng chống oxy hóa, giảm cân...\n- ECGC trong hoa lài còn có tác dụng hạ lipid máu...\n- Hàm lượng caffeine trong hoa lài có tác dụng kích thích hệ thống thần kinh ức chế adenosine – chất tạo ra cảm giác thư giãn. Đồng thời, caffeine tăng giải phóng serotonin và dopamine nhằm cải thiện tâm trạng và tăng cường chức năng hoạt động của não bộ.\n*** HƯỚNG DẪN SỬ DỤNG\nCó thể dung hoa nhài để pha trà, nấu chè\nLưu ý: Không dùng cho phụ nữ có thai. Không uống trà khi đói\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 35 gram\n– Quy cách đóng gói: hộp nhựa\n☎️ Hotline: 0931 78 4477\n?Website: https://berryland.vn/ \nXưởng sản xuất: 58 Lý Nam Đế, P.8, TP.Đà Lạt  (Hiện tại chỉ hoạt động vào giờ hành chính)\nCửa hàng Đặc sản TIỆM DÂU NHỎ: 40B Trương Công Định, P.1, TP.Đà Lạt (Hoạt động từ 8h - 21h tất cả các ngày)',40000,30000,NULL,NULL,8,1,2,1,1,0,1,'','','',NULL,NULL,NULL,35),(372,'Trà Hoa Đậu Biếc - Chai 35g',0,'2022-02-19 20:57:17','3720T',0,35,0,'https://appdala.net/wp-content/uploads/thdb.jpeg','https://appdala.net/wp-content/uploads/thdb3.jpg;https://appdala.net/wp-content/uploads/thdb2.jpeg;https://appdala.net/wp-content/uploads/thdb1.jpeg','','Trà Hoa Đậu Biếc\n\n- Trà Hoa Đậu Biếc hay còn được gọi với cái tên thân thương Trà Lam Hồ Điệp với màu tim tím đặc trưng. Đây cũng là một trong những loài hoa bền bỉ sống được chung với những đợt nắng hạn gay gắt. Bên cạnh đó trà đậu biếc cũng mang lại những công dụng tuyệt vời đối với cơ thể chúng ta.\n\n***CÔNG DỤNG \n-  Rất phù hợp với các chị em bởi chúng giúp giảm nếp nhăn và các dấu hiệu lão hóa da sớm\n- Sử dụng Trà Hoa Đậu Biếc thường xuyên giúp tăng hàm lượng ollagen và độ đàn hồi của các tế bào da.\n-  Có màu xanh dương tự nhiên rất đẹp, giàu chất chống oxy hóa giúp làm chậm quá trình lão hóa, giữ da sáng khỏe, tăng cường hệ thống miễn dịch, kích thích sự lưu thông máu và giúp thải độc toàn cơ thể. Các chất chống oxy hóa proanthocyanidin giúp cải thiện dòng chảy của máu qua các mao mạch của mắt, điều này giúp mắt điều chỉnh nhanh hơn với những thay đổi trong ánh sáng và cải thiện độ sắc nét của thị lực. \n-  Thường xuyên sử dụng trà Hoa Đậu Bướm trong nhiều năm sẽ cải thiện cải thiện lưu thông máu đến đầu, tránh rụng và bạc tóc, ngăn chặn tóc hoa râm.\n\n*** HƯỚNG DẪN SỬ DỤNG\n-	Dùng để pha trà\n-	Dùng làm màu tự nhiên khi nấu ăn \n\n\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 35 gram\n– Quy cách đóng gói: hộp nhựa\n\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\n\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc\nMua trực tiếp tại Tiệm Dâu Nhỏ:\n40B Trương Công Định, Phường 1, Đà Lạt',50000,NULL,NULL,NULL,0,0,2,0,1,0,0,'','','',NULL,NULL,NULL,35),(374,'draf',0,'2022-02-20 10:53:06','374FN',0,35,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(375,'draf',0,'2022-02-20 10:54:19','375C',0,35,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(376,'Khô Heo Cháy Tỏi - Hũ 130g',0,'2022-02-20 13:25:41','376A',0,35,0,'https://appdala.net/wp-content/uploads/kh.jpeg','https://appdala.net/wp-content/uploads/kh1.jpeg;https://appdala.net/wp-content/uploads/kh2.jpeg;https://appdala.net/wp-content/uploads/kh3.jpeg','',' Heo khô cháy tỏi\n\n- Một sản phẩm ngon kích thích vị giác, nguyên liệu từ khâu chọn lọc đến chế biến  đều được đảm bảo vệ sinh sạch sẽ, k chất phụ gia,k chất bảo quản, thịt heo tươi sạch đc lấy hàng ngày.\n\n- Heo khô cháy tỏi thực sự là 1 món khoái khẩu của rất nhiều người bởi vị ngọt bùi pha vị cay tê tê đầu lưỡi mang lại cảm giác tuyệt vời khi thưởng thức. \n\n- Heo khô cháy tỏi rất giàu protein nhưng lại rất ít chất béo và carbohydrat rất tốt để cung cấp thêm năng lượng mà không sợ bị tăng cân.\n\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 130 gram\n– Quy cách đóng gói: hộp nhựa \n\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\n\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc\nMua trực tiếp tại Tiệm Dâu Nhỏ:\n40B Trương Công Định, Phường 1, Đà Lạt',55000,NULL,NULL,NULL,0,0,2,0,1,0,0,'','','',NULL,NULL,NULL,130),(377,'draf',0,'2022-02-20 14:25:31','3777N',0,35,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(378,'Cơm Cháy Khô Gà - Hũ 180g',0,'2022-02-20 15:10:30','378UC',0,35,0,'https://appdala.net/wp-content/uploads/cckg.jpeg','https://appdala.net/wp-content/uploads