ULL,NULL,0,0,2,0,1,0,0,'','','',NULL,NULL,NULL,80),(380,'Bánh Gấu Mix Đủ Vị  - Hũ 140g',0,'2022-02-20 16:08:44','3804',0,35,0,'https://appdala.net/wp-content/uploads/bg.jpeg','https://appdala.net/wp-content/uploads/bgn.jpeg;https://appdala.net/wp-content/uploads/bgv.jpeg;https://appdala.net/wp-content/uploads/bg1.jpeg;https://appdala.net/wp-content/uploads/bg2.jpg','','Bánh Gấu Mix Đủ Vị \n\n\n- Bánh gấu chùm ngây (xanh): có 2 nhân KEM SỮA VS DÂU Vẫn là nhân kem sữa,nhưng lớp vỏ được làm từ bột lá cây chùm ngây,cực tốt cho sức khỏe của Mẹ và Bé. Thành phần lá chùm ngây còn bổ sung thêm nhiều dinh dưỡng quan trọng và cần thiết cho cơ thể, góp phần phòng tránh một số bệnh đang phổ biến trong cộng đồng.\nĐặc biệt, lá chùm ngây còn chứa chất đạm (như trong các sản phẩm từ động vật như thịt, trứng.. ) rất cần cho cơ thể phát triển. Tổ chức WHO và nhiều quốc gia đã công nhận đây là nguồn thảo dược quan trọng trong việc ngăn ngừa và điều trị nhiều căn bệnh.\n\n- Bánh gấu vị sô cô la (nâu) :Nhân kem đậm đà Socola cà phê làm cho món bánh tuổi thơ thêm phấn kích thích vị giác.\n\n- Bánh gấu kem béo (vàng) : Vẫn là hương vị của tuổi thơ với thành phần từ bột mì,đường sữa. Lớp bánh giòn bùi thơm phức,nhân kem ngọt béo',33000,NULL,NULL,NULL,0,0,2,0,1,0,0,'','','',NULL,NULL,NULL,140),(381,'Me thái được ngào đường - Hũ 180g ',0,'2022-02-20 16:37:26','3817Q',0,35,0,'https://appdala.net/wp-content/uploads/m-1.jpeg','https://appdala.net/wp-content/uploads/m1-1.jpeg','','Me thái được ngào đường \n\n\n- Me thái được ngào đường  tạo nên món ăn vị chua chua, ngọt ngọt khó cưỡng!! Thật hấp dẫn phải ko nào !\n\n- Chỉ cần ăn miếng đầu tiên bạn sẽ khó cầm lòng vì quá ngon!\n \n- PHÙ HỢP MỌI LỨA TUỔI TỪ NGƯỜI LỚN TỚI TRẺ NHỎ , ĐẢM BẢO AI ĐÃ ĂN LÀ SẼ THÍCH \n\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 180 gram\n– Quy cách đóng gói: hộp nhựa\n\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\n\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc\nMua trực tiếp tại Tiệm Dâu Nhỏ:\n40B Trương Công Định, Phường 1, Đà Lạt',28000,NULL,NULL,NULL,0,0,2,0,1,0,0,'','','',NULL,NULL,NULL,180),(382,'Chuối sấy dẻo Berryland - Túi kín 250g',0,'2022-02-20 17:06:51','3828J',0,35,0,'https://appdala.net/wp-content/uploads/cd.jpeg','https://appdala.net/wp-content/uploads/cd1.jpeg;https://appdala.net/wp-content/uploads/cd2.jpeg','','Chuối sấy dẻo Berryland\n- Chuối Đà Lạt (chuối laba) được sự ưu trái của đất trời nên cho phát triển tốt, hương vị đặc biệt mà không phải nơi nào cũng có được.Theo dòng lịch sử, chuối laba đã được dùng để tiến vua. Thức quà dân dã, hồn hậu này đã theo chuyến xe ngựa ra Huế để làm món tráng miệng sau bữa cơm của vua, các vị quan chức triều đình và người Pháp.\n- Hiện nay, chuối laba đã được Cục sở hữu trí tuệ công nhận là đặc sản. Chuối laba không những trở thành thương hiệu riêng tại Đà Lạt, mà còn nức tiếng trên thế giới. Loại trái cây này được phân phối rộng rãi ở tp Hồ Chí Minh, các tình Nam Bộ. Xa hơn là các tỉnh miền Trung, miền Bắc.\n- Chuối dẻo thích hợp để bổ sung khẩu phần dinh dưỡng cho trẻ em và người già mỗi ngày. Chuối sấy cung cấp một hương vị ngọt dịu vừa thơm lại có độ dẻo dẻo dai dai ăn rất vui miệng, vẫn giữ nguyên được mùi vị và giá trị dinh dưỡng có quy trình sản xuất đảm bảo 100% an toàn vệ sinh thực phẩm.\nLưu ý: Việc đóng gói hút chân không ngăn sản phẩm không tiếp xúc với không khí nên sản phẩm không bị khô theo thời gian. Tuy nhiên, khi để lâu 1 thời gian, sản phẩm sẽ bị xuống màu (chuyển nâu) đây là một chu trình bình thường của sản phẩm do hệ màu bị phá hủy khi sản phẩm tiếp xúc với ánh sáng. Sản phẩm vẫn sử dụng được bình thường cho đến khi hết hạn sử dụng.\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 250 gram\n– Quy cách đóng gói: túi kín\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\nHotline: 0931 78 4477\nWebsite: https://berryland.vn/ \nXưởng sản xuất: 58 Lý Nam Đế, P.8, TP.Đà Lạt  (Hiện tại chỉ hoạt động vào giờ hành chính)\nCửa hàng Đặc sản TIỆM DÂU NHỎ: 40B Trương Công Định, P.1, TP.Đà Lạt (Hoạt động từ 8h - 21h tất cả các ngày)',45000,35000,NULL,NULL,26,1,2,1,1,0,1,'','','',NULL,NULL,NULL,250),(383,'Nước Cốt Dâu Tằm - Chai 500ml',0,'2022-02-20 17:17:03','383Z4',0,35,0,'https://appdala.net/wp-content/uploads/z3282877578837_76c73914d28ae398097f76dc0069dc8c.jpeg','https://appdala.net/wp-content/uploads/dt1.jpeg;https://appdala.net/wp-content/uploads/dt2.jpeg','','Nước Cốt Dâu Tằm\n- Quả dâu tằm khi vừa chín tới màu tím đen hoặc đỏ sậm nhiều nước giàu chất dinh dưỡng, chua chua, có thể ăn tươi, ngâm rượu, làm nước giải khát, làm mứt,… rất được ưa chuộng\n- Từ nước cốt dâu tằm ta có thể chế biến thành nhiều món ngon, như  bánh ngọt, soda, pudding, panna cota, rượu, mứt, kem,…mang màu tím sẫm của dâu tằm lại còn thơm ngon\nUống nước dâu một ngày có tác dụng thanh nhiệt, hàm lượng vitamin C trong nước dâu sẽ trị táo bón rất hiệu quả, bên cạnh đó  nước dâu sẽ khiến giấc ngủ đến sớm, ngủ say và sâu giấc hơn. Đặc biệt nếu bạn uống đều đặn mỗi ngày ba ly nước dâu vào buổi sáng, trưa và tối sẽ chữa được chứng nhức mỏi cơ, khớp và uống đều đặn trong 3 tháng sẽ thấy da dẻ hồng hào, máu huyết lưu thông, kinh nguyệt đều đặn…\n*** Cách pha nước cốt: Pha 1 phần nước cốt dâu tằm với 50ml nước lọc và 1 ít đá để được cốc nước dâu tằm thơm ngon\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 500ml\n– Quy cách đóng gói: chai nhựa\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\nHotline: 0931 78 4477\nWebsite: https://berryland.vn/ \nXưởng sản xuất: 58 Lý Nam Đế, P.8, TP.Đà Lạt  (Hiện tại chỉ hoạt động vào giờ hành chính)\nCửa hàng Đặc sản TIỆM DÂU NHỎ: 40B Trương Công Định, P.1, TP.Đà Lạt (Hoạt động từ 8h - 21h tất cả các ngày)',50000,40000,NULL,NULL,31,1,2,1,1,0,1,'','','',NULL,NULL,NULL,500),(384,'Kẹo Socola Đá - Chai 200g',0,'2022-02-20 17:29:03','3840C',0,35,0,'https://appdala.net/wp-content/uploads/sd.jpeg','https://appdala.net/wp-content/uploads/sd1.jpeg;https://appdala.net/wp-content/uploads/sd2.jpeg;https://appdala.net/wp-content/uploads/sd3.webp','','Kẹo Socola Đá \n\n- Kẹo sô cô la đá  có thành phần nguyên liệu được lựa chọn kỹ lưỡng, không chứa hóa chất độc hại, an toàn cho người dùng. \n\n- Sản phẩm với công thức độc đáo tạo nên hương vị đặc biệt thơm ngon, cuốn hút. \n\n- Kẹo cung cấp năng lượng và một số vitamin thích hợp làm món ăn vặt cho người bận rộn. \n\n- Sản phẩm được đóng hộp tiện lợi dễ bảo quản và mang theo. Sản phẩm được sản xuất trên quy trình công nghệ hiện đại, được kiểm duyệt chặt chẽ, đảm bảo chất lượng.\n\n– Hạn sử dụng: 12 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 200 gram\n– Quy cách đóng gói: hộp nhựa\n\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\n\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc\nMua trực tiếp tại Tiệm Dâu Nhỏ:\n40B Trương Công Định, Phường 1, Đà Lạt',55000,NULL,NULL,NULL,0,0,2,0,1,0,0,'','','',NULL,NULL,NULL,200),(385,'Berry Choco thơm ngon, trọng lượng 60g',0,'2022-02-20 17:48:44','3853A',0,35,0,'https://appdala.net/wp-content/uploads/ch.jpeg','https://appdala.net/wp-content/uploads/ch1.jpeg','','Berry Choco\n- Vị chua ngọt tự nhiên, cái giòn giòn sật sật của từng lát trái cây được cắt vừa khéo cùng những loại hạt béo bùi phủ đầy ấp bên trên thanh socola.\n- Thanh socola đen mix cùng với các loại trái cây khác nhau như chuối, dâu, hạt hạnh nhân, hạt bí,....\n– Hạn sử dụng: 9 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 60 gram\n– Quy cách đóng gói: hộp giấy\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc\nMua trực tiếp tại Tiệm Dâu Nhỏ:\n40B Trương Công Định, Phường 1, Đà Lạt.',55000,45000,NULL,NULL,0,1,2,1,1,0,1,'','','',NULL,NULL,NULL,60),(387,'Thơm sấy dẻo - 160g',0,'2022-02-20 17:57:24','387EJ',0,35,0,'https://appdala.net/wp-content/uploads/t.jpeg','https://appdala.net/wp-content/uploads/t1.jpg;https://appdala.net/wp-content/uploads/t2.jpeg;https://appdala.net/wp-content/uploads/t3.jpeg','','Thơm sấy dẻo \n\n- Thơm sấy dẻo (hay thơm sấy lạnh) là một trong những loại trái cây được ưa chuộng nhất, được tuyển lựa từ trái Thơm tươi ngon và  được sản xuất theo công nghê mới, nên sản phẩm sau khi chế biến vẫn giữ được nguyên hương vị, màu sắc tự nhiên, giá trị dinh dưỡng không bị biến đổi, có quy trình sản xuất đảm bảo 100% an toàn vệ sinh thực phẩm. \n- Thơm sấy dẻo chua chua, ngọt ngọt khiến ai ai cũng thích mê.\n\nCÔNG DỤNG CỦA THƠM SẤY DẺO\n\n- Thơm sấy dẻo không chỉ tiện lợi mà vị thơm ngon của trái thơm chín vẫn quyện hòa trong từng miếng thơm. \n\n- Giá trị dinh dưỡng trong quả thơm tươi vẫn được giữ nguyên vẹn.\nBổ dưỡng, cung cấp cho cơ thể những vitamin cần thiết\n\n- Thành phần dinh dưỡng có trong sản phẩm thơm sấy dẻo tương đương với trái thơm tươi. \n\n- Một số chất dinh dưỡng chủ yếu trong trái thơm đó là chất xơ, vitamin A,C,K,B1, B6, Canxi, sắt… đây đều là những chất dinh dưỡng vô cùng có lợi đến sức khỏe của bạn. Cho dù ở độ tuổi nào, bạn đều cần nạp những chất dinh dưỡng tự nhiên trong thơm sấy dẻo mỗi ngày.\n\n\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 160gram\n– Quy cách đóng gói: túi kín\n\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\n\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc\nMua trực tiếp tại Tiệm Dâu Nhỏ:\n40B Trương Công Định, Phường 1, Đà Lạt',43000,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,160),(390,'draf',0,'2022-02-25 16:03:08','390J',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(392,'draf',0,'2022-02-25 16:09:33','392U',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(394,'