-.jpg','https://appdala.net/wp-content/uploads/tc2.jpeg;https://appdala.net/wp-content/uploads/tc3.jpeg','','Rau củ và trái cây sấy giòn Berryland\n- Được sản xuất theo công nghệ sấy chân không, một công nghệ mới tiên tiến nhất nên sản phẩm sau khi sấy vẫn giữ được nguyên hương vị của nó, màu sắc của thiên nhiên, các Vitamin của sản phẩm không bị biến đổi như khi sấy ở nhiệt độ cao, chất béo thấp, tính khô giòn tạo cảm giác ngon miệng.\n- Thập cẩm sấy là món ăn vặt được nhiều người thích bởi thưởng thức được nhiều hương vị thơm ngon thú vị nhiều loại trái cây rau củ quả sấy có vị ngọt thanh tự nhiên đặc trưng của mỗi loại mít, chuối, khoai môn, khoai tây, khổ qua, cà rốt,.. không đường giòn xốp, sản phẩm hoàn toàn không sử dụng hóa chất và phụ gia thực phẩm.\n- Sản phẩm chứa ít chất béo bão hòa,cholesterol, giàu axit béo omega 3, omega 6. Ngoài ra còn có vitamin tốt cho cơ vitamin A, vitamin C, vitamin E và vitamin B6,và khoáng chất như sắt, magie, phốt pho, kali và mangan, và hàm lượng chất xơ rất cao.\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 500gram\n– Quy cách đóng gói: túi kín\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc\nMua trực tiếp tại Tiệm Dâu Nhỏ:\n40B Trương Công Định, Phường 1, Đà Lạt',100000,90000,NULL,NULL,8,1,2,1,1,0,1,'','','',NULL,NULL,NULL,500),(400,'Mứt Atiso Đỏ - túi zip 110g',0,'2022-03-01 17:11:53','4004',0,35,0,'https://appdala.net/wp-content/uploads/77d6f4f0324afe14a75b.jpg','https://appdala.net/wp-content/uploads/m2-1.jpeg;https://appdala.net/wp-content/uploads/m4.jpeg','','MỨT HOA ATISO ĐỎ \n\n- Hoa atiso đỏ hay còn gọi là hoa bụp giấm, là loại hoa được dùng làm thuốc với rất nhiều công dụng tốt cho sức khỏe.\n\n-Đài hoa bụp giấm là bộ phận dùng để làm thuốc. Đài hoa mọng nước, có màu đỏ đậm, có lông nhỏ, nhọn dần từ phía dưới lên, có vị chua như giấm. \n\n- Hoa atiso đỏ còn dùng làm thực phẩm như ngâm đường giải khát, làm mứt rất ngon.\n\n-Sản phẩm ngon hơn nếu bỏ vào tủ lạnh hoặc pha với nước cốt atiso đỏ cùng đá, cánh hoa giòn cùng vị chua ngọt của nước cốt tạo nên thức uống tương tự cocktail. \n\n– Sản phẩm có sử dụng đường, acid citrid và muối của acid sorbid nhằm duy trì màu sắc và hương vị sản phẩm.\n– Hạn sử dụng: 6 tháng kể từ ngày sản xuất\n– Khối lượng tịnh: 110g \n– Quy cách đóng gói: Túi kín\n\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\n\n☎️ Hotline: 0931 78 4477\n?Website: https://berryland.vn/ \nXưởng sản xuất: 58 Lý Nam Đế, P.8, TP.Đà Lạt  (Hiện tại chỉ hoạt động vào giờ hành chính)\nCửa hàng Đặc sản TIỆM DÂU NHỎ: 40B Trương Công Định, P.1, TP.Đà Lạt (Hoạt động từ 8h - 21h tất cả các ngày)',39000,NULL,NULL,NULL,9,1,2,1,1,0,0,'','','',NULL,NULL,NULL,110),(402,'Dâu tây sấy lạnh',0,'2022-03-03 10:46:40','402SQ',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-192206-1.jpg','https://appdala.net/wp-content/uploads/a07db677da4daa90180328aba5668a55_tn.jpg;https://appdala.net/wp-content/uploads/50601bed4bf6df171a3154ed29db10be_tn.jpg;https://appdala.net/wp-content/uploads/1f4d1dbf5498dc7474c150828d2db9ee_tn.jpg','','DÂU TÂY SẤY LẠNH tại Hoàng Thiên Long farm\nGiữ trọn vị thơm ngon đặc trưng của quả dâu tươi\nDâu mang đi sấy làm cho những quả dâu tươi ngon trở thành những quả dâu dẻo ngon, bảo quản được lâu hơn, dễ dàng mang đi.\nMiếng dâu tan chảy nơi đầu lưỡi, vị ngọt dịu nhẹ thanh tao.\nDâu sấy dẻo, dẻo ngon như kẹo dẻo nhưng chúng hoàn toàn từ tự nhiên, ăn ngay sau khi mở hộp, ngon hơn khi để ngăn mát tủ lạnh, hoặc thậm chí bạn còn có thể để vào hũ Yogurt ăn kèm. Miếng dâu tan chảy nơi đầu lưỡi, vị ngọt dịu nhẹ thanh tao, mùi thơm của trái dâu tươi xen lẫn chút vị chua đặc trưng đầy kích thích\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc\n',87000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,185),(403,'Thơm sấy dẻo muối ớt',0,'2022-03-03 11:00:23','403AQ',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-191922.jpg','https://appdala.net/wp-content/uploads/78fbf93cf1619df15bbdf8136d321ba3_tn.jpg;https://appdala.net/wp-content/uploads/7952455b89e4e09234737b66f6e9b4c2_tn.jpg','','Thơm sấy muối ớt KHÔNG ĐƯỜNG\n\nThơm sấy muối ớt có vị chua chua, ngọt ngọt lại mềm mại, dẻo dai nên ăn rất ngon miệng. Trong thơm chứa nhiều vitamin như B1, B2, A, C và các khoáng chất phốt pho, canxi,sắt tốt cho sức khỏe. Lựa chọn từ nguồn thơm tươi từ miền tây sông nước và sử dụng phương pháp sấy lạnh để giữ được các thành phần dinh dưỡng, màu sắc và hương vị tự nhiên của thơm.\n\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc\n\n\n',79000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,185),(404,'Cam lát sấy dẻo',0,'2022-03-03 11:06:21','404R',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-192313.jpg','https://appdala.net/wp-content/uploads/4f904b3c7ee17872be08f89b30a8561d_tn.jpg;https://appdala.net/wp-content/uploads/313805baa7138dc3c7305dfdc6f0d309_tn.jpg','','PHẢI GỌI LÀ SIÊU NGON\nMúi to, đầy, vị ngọt vừa phải, màu tự nhiên. Không ngon em trả lại tiền.\nKhông chỉ là món ăn vặt lạ miệng, giòn giòn, chua chua, ngọt ngọt.\nLà món quà tặng cho gia đình ý nghĩa và thiết thực.\nCam là loại trái cây quen thuộc và phổ biến nhất trên thế giới bởi những công dụng tuyệt vời như: Bổ sung vitamin C, chống oxy hoá, tăng cường thể lực, tăng sức đề kháng, hỗ trợ giảm ho cúm, tăng cường hệ miễn dịch... Trà cam sấy thái lát đem đến một hương vị ngọt ngào, thơm mát, thích hợp cho những lần gặp gỡ bạn bè hay thư giãn sau những giờ làm việc căng thẳng.\nCam sấy tại Hoàng Thiên Long Farm áp dụng công nghệ sấy lạnh tiên tiến nhất hiện nay, đảm bảo được màu sắc và hương vị, đặc biệt là hàm lượng dinh dưỡng không hề bị mất đi. Đây là sự lựa chọn tuyệt vời trong việc bảo quản các loại nông sản như trà, hoa, quả sấy.\nĐặc biệt, bạn là những người lúc nào đi xe hay tàu, thuyền cũng bị say xe, cảm giác khó chịu, ngột ngạt, buồn nôn khiến bạn rất sợ mỗi khi đi xa.\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc\n\n',75000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,185),(405,'Ổi xá lị sấy dẻo',0,'2022-03-03 11:08:04','4051R',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-192126.jpg','https://appdala.net/wp-content/uploads/f66fecb3d8be3157dab53f87aec51afa_tn.jpg;https://appdala.net/wp-content/uploads/1ba993248a5c630e05ccf001d6a03793_tn.jpg','','ỔI XÁ LỊ SẤY DẺO \n- ĐÃ NGON CÒN GIÀU VITAMIN \nTừ xưa nay mọi người đều quen ăn ổi tươi chấm muối, nước ép ổi, thì bây giờ thử tí “Ổi xá lị sấy dẻo” coi ghiền không nha.\nỔi xá lị sau khi sơ chế phơi rồi sấy lạnh lên không những chua chua, ngọt ngọt, ngon thiệt ngon mà vẫn giữ rất nhiều vitamin\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',58000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,185),(406,'Vỏ bưởi sấy dẻo',0,'2022-03-03 11:11:19','406D',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-192049.jpg','https://appdala.net/wp-content/uploads/3f73ba095ab1c9d460631ec497ca7aa3_tn.jpg;https://appdala.net/wp-content/uploads/5f38c143b94261fcbd8b4fc19cd27aa3_tn.jpg;https://appdala.net/wp-content/uploads/7e809dca2baf2468654f4b179f2cec22_tn.jpg','','Thấu hiểu được vỏ bưởi sấy dẻo có tác dụng gì, Hoàng Thiên Long Farm  chuyên cung cấp các mặt hàng được sản xuất từ vỏ bưởi giúp chăm sóc sức khỏe người tiêu dùng giá rẻ bất ngờ.\nRất hiếm có một loại quả nào mà đến vỏ của nó cũng có thể ăn được như bưởi. Vỏ bưởi sấy dẻo là sự kết hợp hoàn hảo vị chua ngọt hoà quyện của hương thơm, độ the dịu của bưởi.\nVỏ bưởi giúp cảm giác giòn trong miệng, the the cùng vị cay tự nhiên nơi đầu lưỡi là lý do khiến vỏ bưởi sấy dẻo là sản phẩm ăn vặt đang được mọi người săn lùng nhất trên thị trường thực phẩm hiện nay. \nNgoài ra, vỏ bưởi sấy dẻo còn có nhiều tác dụng hữu ích cho sức khỏe như: Chống hôi miệng, bổ sung Vitamin C, tăng cường sức đề kháng, chống đầy hơi, trị buồn nôn, ợ chua, tiêu đờm và  tốt cho mọi lứa tuổi.\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',65000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,185),(407,'Xoài sấy dẻo',0,'2022-03-03 11:12:43','407ZG',0,34,0,'https://appdala.net/wp-content/uploads/13911fe3a8a15a6f2ab345f0d6f4c2c7_tn.jpg','https://appdala.net/wp-content/uploads/d946c3eaa4744967476143591d9f130a_tn.jpg;https://appdala.net/wp-content/uploads/67b637f731e99b93c17a168a04a25b22_tn.jpg','','Xoài sấy dẻo: Ngon, Mềm và Không Đường\nHàm lượng dinh dưỡng và lợi ích sức khoẻ từ Xoài, giúp bổ sung Vitamin hổ trợ sản xuất collagen, giúp da săn chắc trẻ trung.\nCung cấp các Vitamin A, B, B1, B2,B5, B6, C, và vitamin E cho cơ thể, giúp bảo vệ mắt khỏi tia cực tím của Mặt Trời.\nBổ sung chất xơ, giúp giảm nguy cơ phát triển bệnh tim, hổ trợ tiêu hoá...\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',62000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,185),(408,'Mãng cầu sấy dẻo',0,'2022-03-03 11:15:14','40867',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-203311.jpg','https://appdala.net/wp-content/uploads/b0745f87aae82a4689329d307734aedf_tn.jpg;https://appdala.net/wp-content/uploads/0ecaa3d08739efab696ea4d470f13ea4_tn.jpg;https://appdala.net/wp-content/uploads/dd1f8d7719e2b1e4f8c201f80a39ecee_tn.jpg','','MÃNG CẦU SẤY DẺO ĐẶC BIỆT\nMãng cầu sấy dẻo có vị chua chua, ngọt thanh tự nhiên của quả tươi, ăn thích vô cùng.\nNếu so với mứt mãng cầu quá ngọt, thì mãng cầu sấy dẻo ngon mắt hơn với màu trắng ngà, có vẻ ngoài khô ráo, nhưng bên trong mềm, vẫn giữ được vị ngọt và chua tự nhiên của mãng cầu xiêm. Chỉ cần xé miệng bao, chọn đại 1 miếng rồi đưa lên miệng, miếng mãng cầu sấy dẻo dẻo không quá mềm, cũng chẳng quá xơ sẽ tự động tan ngay trong miệng bạn.\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',75000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,185),(409,'Hoa atisô đỏ sấy',0,'2022-03-03 11:18:06','409AM',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-192004.jpg','https://appdala.net/wp-content/uploads/54c8679eba2d58145c256f2c4598ee91_tn.jpg;https://appdala.net/wp-content/uploads/c0579755cc005cc10a8fb9b276b351fa_tn.jpg','','Mứt hoa atiso đỏ nổi tiếng là món mứt đặc sản tại Đà Lạt. Bởi vì hương vị của mứt hoa atiso đỏ rất thanh, chua chuẩn, lại giòn giòn rất dễ ăn. Và phù hợp với khẩu vị của rất nhiều thực khách\nLoài hoa này có rất nhiều công dụng tuyệt vời cho sức khỏe, tiêu biểu nhất là mát gan, bổ thận. Cũng chính vì thế mà các chuyên gia tại Hoàng Thiên Long Farm đã chắt lọc những gì tinh túy nhất để tạo ra sản phẩm hoa atiso đỏ sấy dẻo – một sản phẩm tiện dụng cho mọi người. \nHoa atiso đỏ sấy dẻo đảm bảo giữ được hầu hết các dưỡng chất, màu sắc tự nhiên. Không phẩm màu hay chất bảo quản.\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',55000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,200),(410,'Mứt dâu nguyên chất',0,'2022-03-03 11:22:02','410BL',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-191843.jpg','','','Mứt dâu tây Đà Lạt nguyên chất, được làm từ trái dây tây Đà Lạt với hương vị tự nhiên từ trái dâu tây đảm bảo thơm ngon, được sản xuất tại Hoàng Thiên Long Farm, đảm bảo an toàn vệ sinh thực phẩm\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc\n',49000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,400),(411,'Khoai lang mật sấy dẻo ',0,'2022-03-03 11:26:04','4114O',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220225-111739.jpg','https://appdala.net/wp-content/uploads/a15f0ee82136ffab167a6b3a4de47432.jpg','','Khoai để làm KHOAI LANG SẤY DẺO phải là loại khoai lang mật Đà Lạt, dây khoai tía, khi đào lên củ có màu đỏ sậm, ruột vàng. Khác với các loại khoai khác chỉ trồng 4 tháng, khoai mật phải trồng tới 6 tháng, củ mới đủ độ đường như ý.\nKHOAI LANG MẬT SẤY DẺO vừa ngon, vừa cực tốt cho sức khoẻ\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',49000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,100),(412,'Rau củ thập cẩm sấy giòn',0,'2022-03-03 11:32:17','4123',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-192654.jpg','https://appdala.net/wp-content/uploads/3fb4efb3b2a632db1eb4edd30a886e12.jpg','','Thập cẩm sấy gồm nhiều sản phẩm kết hợp lại là thức ăn bổ dưỡng giúp ngăn ngừa bệnh tim mạch, tốt cho mắt, ngăn ngừa ung thư, hỗ trợ giảm cân, chống lão hóa da, hỗ trợ hệ tiêu hóa và tốt cho xương khớp.\n- Vì chứa hàm lượng vitamin C cao nên giúp làm đẹp da, ngăn ngừa dấu hiệu lão hóa như nếp nhăn, đốm nâu, tránh tình trạng bị khô da, da thiếu nước. Còn là thực phẩm lý tưởng hỗ trợ việc giảm cân, thừa cân, béo phì.\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',69000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,450),(413,'Khoai lang sấy mật ong',0,'2022-03-03 11:36:00','413SQ',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-192619.jpg','https://appdala.net/wp-content/uploads/f6f1f1babf09a9ef286a1aeaad3f06ed_tn.jpg','','Đà Lạt được phú cho là nơi có khí hậu cùng với đất đai màu mỡ vô cùng thích hợp để trồng trọt. Rau củ ở vùng đất này vừa tươi ngon lại giàu chất chất dinh dưỡng. Một trong những món ăn vặt ở Đà Lạt, khi nhắc đến nó ai cũng phải mê và không thể cưỡng lại được sự ngon giòn của nó. Đó là “Khoai Lang Sấy Mật Ong Ngon Giòn”  được sấy bởi công nghệ hiện đại và tiên tiến nhất hiện nay. Khoai lang sấy mật ong đã trở thành món ăn ưa chuộng của người người nhà nhà hiện nay. \nKhoai lang thì giòn tan xen lẫn vị ngọt của mật phủ nhẹ bên ngoài mật ngọt bên ngoài ăn hoài không ngớt\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',49000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,300),(414,'Khoai lang tím sấy',0,'2022-03-03 11:37:52','414V',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220225-121554.png','https://appdala.net/wp-content/uploads/k3SgT4_simg_de2fe0_500x500_maxb.jpg','','KHOAI LANG TÍM SẤY MÈ\nĐược làm từ 100% khoai lang tươi Đà Lạt ko pha bột, khoai được bào mỏng thành từng lát với màu sắc tự nhiên của khoai đảm bảo ko phẩm màu, công nghệ sấy mới giòn tan thơm phức \nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc\n\n',49000,NULL,NULL,NULL,0,0,13,1,1,1,1,'','','',NULL,NULL,NULL,350),(415,'Chuối laba sấy mè gừng',0,'2022-03-03 11:43:50','415C9',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-192526-1.jpg','','','Chuối sấy mè gừng là món ăn rất được nhiều người ưa chuộng, là sự kết hợp của nhiều thứ nhưng hương vị vẫn được hòa quyện vào nhau như một. Điều không thể không nhắc tới đó là nguồn dinh dưỡng trong đó rất tốt cho sức khỏe của chúng ta bởi được làm được sấy hoàn toàn thủ công, không có hóa chất bảo quản độc hại.\nChuối xiêm vừa chuẩn bi chín tới để chuối sấy có độ dẻo, giòn, màu đẹp và ngọt tự nhiên. + Chuối rửa sạch bào vỏ, rồi bào tiếp phần thịt( phần thịt có độ dày vừa phải ) thả phần thịt đó vào thau nước pha chút chanh để ngâm.( cho chuối ra bớt mủ và không thâm đen)\nSau đó được vớt ra để ráo, rồi tiếp tục trộn với đường cát trắng, nước cốt gừng và ít gừng xay nhuyễn.\nSau đợi đường tan sẽ chiên với dầu thật nóng để chuối đạt độ giòn và lên màu vàng sẫm.\nMiếng chuối đạt độ chín sẽ được vớt ra, phủ thêm mè để tạo vị, để ráo dầu, chờ nguội dần rồi mới vào túi bảo quản để giữ độ giòn.\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',68000,49000,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,450),(416,'Mít sấy giòn ',0,'2022-03-03 11:46:47','416FE',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-192458.jpg','https://appdala.net/wp-content/uploads/cach-lam-mit-say-bang-noi-chien-khong-dau-1.jpg','','Mít sấy chính gốc Đà Lạt, hàng loại A đặt chuẩn xuất khẩu đẹp mắt,  đảm bảo 