16:19:05','429P37',0,36,0,'https://appdala.net/wp-content/uploads/Bong-atiso-11-3.jpg','https://appdala.net/wp-content/uploads/atiso-say-kho-1-600x610-3.jpg','','\"...Theo các tài liệu y dược, Atiso có tác dụng lợi mật, hỗ trợ phòng chống xơ vữa động mạch, giúp giảm cholesterol. Tốt cho người gan yếu, ăn uống khó tiêu, táo bón, máu nhiễm mỡ...\"\nThành phần: 100% bông Atiso cắt lát, sấy khô.\nChỉ tiêu chất lượng chính: \n- Độ ẩm <=13%\n- Hàm lượng chất khô hòa tan >=18%\nBảo quản: Bảo quản nơi khô ráo thoáng mát, tránh ánh nắng mặt trời trực tiếp.\nHướng dẫn sử dụng:\nRửa sạch, để ráo.\nCó thể chế biến theo 1 trong 2 cách:\n1. Nấu nước trà:\n- Nên dùng 15-20g/ngày cho 1 người. Nấu trong 1-1,5lit nước, đun sôi từ 25-30 phút. Dùng thay nước uống giải khát hàng ngày.\n- Có thể uống nóng hoặc lạnh\n- Có thể thêm chanh hoặc đường để làm tăng hương vị.\n2. Nấu canh:\n- Hầm với xương hoặc giò heo với liều lượng theo khẩu vị.\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 1 năm kể từ ngày sản xuất..',185000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,230),(430,'Trà Atiso hộp 50 túi lọc',0,'2022-03-03 16:32:22','43047',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1124.jpg','https://appdala.net/wp-content/uploads/IMG-0939.jpg','','Trà Atiso túi lọc HANY loại hộp 100 túi lọc được sản xuất với quy trình tiên tiến, nguyên liệu từ bông, thân, rễ, lá Atisô được chọn lựa kỹ càng, rửa sạch, sấy khô, xay, rang cho ra đời sản phẩm trà Atisô túi lọc HANY thượng hạng, tốt cho sức khỏe.\nThành Phần\nAtisô 95%, cỏ ngọt 5%\nHướng dẫn sử dụng\nHãm trà bằng nước sôi, một túi trà/150-200ml nước. Mỗi ngày dùng từ 3-5 túi trà. Dùng trà atisô thường xuyên rất tốt cho sức khỏe vì atisô có tác dụng mát gan, thông mật, lợi tiểu, hạ cholesterol, kích thích tiêu hóa, giúp ăn ngủ ngon, làm mịn da mặt\nBảo quản\nĐể nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm có hiện tượng nấm mốc, có mùi lạ.\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 2 năm kể từ ngày sản xuất..',55000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,100),(431,'Trà Diệp hạ châu gói 50 túi lọc',0,'2022-03-03 16:42:06','431DK',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1175.jpg','https://appdala.net/wp-content/uploads/IMG-1133.jpg;https://appdala.net/wp-content/uploads/diep-ha-chau-2.jpg','','Diệp Hạ Châu còn có tên \" Chó đẻ răng cưa\", đây là một loại thuốc quý, vị đắng, tính mát, có khả năng chữa được nhiều bệnh như: điều hòa chức năng gan, lợi mật, mụn nhọt..\nCÔNG TY TNHH HANY ĐÀ LẠT đã cung cấp TRÀ DIỆP HẠ CHÂU TÚI LỌC :\nTrà Diệp Hạ Châu túi lọc hỗ trợ trong việc ngăn ngừa và điều trị các bệnh về gan, thông mật, giải độc, thanh nhiệt, chống dị ứng, giảm mụn nhọt... \nThành Phần\nDiệp hạ châu 95%, cỏ ngọt 5%\nHướng dẫn sử dụng\nhãm trà bằng nước sôi, 1 túi trà/150-200ml nước (chờ 3 đến 5 phút). Mỗi ngày dùng từ 3-5 túi trà. Diệp hạ châu túi lọc hỗ trợ việc ngăn ngừa cà điều trị các bệnh về gan, thông mật, giải độc, thanh nhiệt, chống dị ứng, giảm mụn nhọt\nBảo quản\nNơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm có hiện tượng nấm mốc, có mùi vị lạ\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 2 năm kể từ ngày sản xuất..',60000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,100),(432,'Trà Cà gai leo gói 50 túi lọc',0,'2022-03-03 16:48:57','4327H',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1176.jpg','https://appdala.net/wp-content/uploads/IMG-1066.jpg;https://appdala.net/wp-content/uploads/ca-gai-leo-kho-2.jpg','','Trà Cà Gai Leo túi lọc hỗ trợ giải độc gan, bảo vệ và phục hồi chức năng gan, hạ men gan, tăng cường chức năng gan do viêm gan, xơ gan, gan nhiễm mỡ,..\nThành Phần\n100% lá và thân cây cà gai leo\nHướng dẫn sử dụng\nhãm trà bằng nước sôi, 1 túi trà/150-200ml nước (chờ 3 đến 5 phút). Mỗi ngày dùng từ 3-5 túi trà. Trà cà gai leo túi lọc hỗ trợ giải độc gan, bảo vệ, phục hồi chức năng gan, hạ men gan, tăng cường chức năng gan do viêm gan, xơ gan, gan nhiễm mỡ....\nBảo quản\nNơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm có hiện tượng nấm mốc, có mùi vị lạ\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 2 năm kể từ ngày sản xuất..',65000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,100),(433,'Trà gừng gói 50 túi lọc',0,'2022-03-03 16:55:34','433ZB',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1172.jpg','https://appdala.net/wp-content/uploads/IMG-1173.jpg','','Theo Y Học Cổ Truyền, gừng có vị cay, tính ấm, có tác dụng giảm đau đầu, chống viêm, giảm ho, thông mũi, giải độc, giúp hệ tiêu hóa khỏe mạnh.\nTừ những lợi ích của gừng, CÔNG TY TNHH HANY ĐÀ LẠT đã sản xuất TRÀ GỪNG TÚI LỌC HANY:\nTrà Gừng túi lọc có nhiều tác dụng tốt cho sức khỏe con người. Uống trà gừng mỗi ngày có tác dụng chống mệt mỏi, giảm stress. Đặc biệt, trà gừng giúp bạn bảo vệ sức khỏe tim mạch, giảm đau đầu, cảm cúm.\nThành Phần\n100% gừng củ\nHướng dẫn sử dụng\nHãm trà bằng nước sôi, 1 túi trà/150-200ml nước (chờ 3 đến 5 phút). Mỗi ngày dùng từ 3-5 túi trà. Trà gừng tui1l ọc giúp hỗ trợ tiêu hóa, tiêu đờm, giảm ho và phòng ngừa cảm mạo.\nBảo quản\nNơi khô ráo thoáng mát, tránh ánh nắng trực tiếp\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm có hiện tượng nấm mốc, có mùi vị lạ.\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 2 năm kể từ ngày sản xuất..',65000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,100),(434,'draf',0,'2022-03-03 17:06:01','434MQ',0,36,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(435,'Trà Đinh lăng hộp 20 túi lọc',0,'2022-03-03 19:42:09','435ZP',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1178.jpg','https://appdala.net/wp-content/uploads/IMG-1177.jpg;https://appdala.net/wp-content/uploads/la-dinh-lang-kho1.jpg','','Đinh Lăng là một loại cây quen thuộc với nhiều gia đình. Loại cây này không chỉ được sử dụng như rau trong các bữa ăn, mà còn là một loại thuốc quý để bồi bổ sức khỏe. Tất cả các bộ phận của cây Đinh Lăng, từ thân cành lá cho đến rễ vỏ cây đều có thể sử dụng làm thuốc. Được làm từ 100% thân, rễ, lá , củ của cây Đinh Lăng. Trà Đinh Lăng của công ty HANY có tác dụng tăng cường tuần hoàn não, giảm các hội chứng tiền đình như đau đầu, chóng mặt, mất ngủ. Chữa tê thấp, đau lưng, lợi tiểu, chống dị ứng, chữa ho ra máu... Là một sản phẩm có lợi cho sức khỏe đến từ Đặc Sản Đà Lạt- HANY \"Món Quà Xứ Lạnh\".\nThành Phần\n100% thân, rễ, lá, củ cây đinh lăng\nHướng dẫn sử dụng\nNhúng túi trà vào 200-250ml nước sôi từ 3-5 phút là dùng được Theo các tài liệu y dược, cây đinh lăng rất tốt cho sức khỏe, có tác dụng bồi bổ cơ thể, chữa tê thấp, đau lưng, lợi tiểu, chống dị ứng, chữa ho ra máu, kiết lỵ, thông tia sữa,....\nBảo quản\nBảo quản nơi khô ráo, thoáng mát, đảm bảo vệ sinh, tránh ánh nắng trực tiếp.\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm có hiện tượng nấm mốc\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 2 năm kể từ ngày sản xuất..',45000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,40),(436,'draf',0,'2022-03-03 19:49:40','43619',0,36,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(437,'Trà Bồ công anh hộp 20 túi lọc',0,'2022-03-03 20:40:26','437S2',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1058.jpg','https://appdala.net/wp-content/uploads/IMG-1136.jpg','','TRÀ BỒ CÔNG ANH HANY được làm từ 100% cây bồ công anh được tuyển chọn kỹ càng, sản xuất theo quy trình nghiêm ngặt tạo ra sản phẩm trà BỒ CÔNG ANH HANY uy tín chất lượng. Một tách trà bồ công anh HANY mang lại cho bạn một cảm giác mát từ bên trong, hỗ trợ tiêu hóa tốt, lợi tiểu, da đẹp.\nTheo y học cổ truyền Bồ Công Anh có tác dụng:\n\nChống loãng xương\nChữa rối loạn gan mật\nChữa suy nhược cơ thể\nChữa rối loạn hệ bài tiết\nChữa viêm tuyến vú, tắc tia sữa\nChữa viêm loét dạ dày, mụn nhọt...\nThành Phần\n100% cây và hoa bồ công anh\nHướng dẫn sử dụng\nHãm trà bằng nước sôi, một túi trà/150-200ml nước. Mỗi ngày dùng từ 3-5 túi trà. Sản phẩm giúp tiêu độc, trị viêm loét dạ dày, viêm phổi, tắc tia sữa, trị mụn nhọt, viêm họng, người bị thoái hóa cột sống, người bị gai cột sống\nBảo quản\nĐể nơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm có hiện tượng nấm mốc, có mùi lạ.\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 2 năm kể từ ngày sản xuất..',45000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,40),(438,'Trà Khổ qua rừng hộp 20 túi lọc',0,'2022-03-03 20:47:02','438P',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1128.jpg','https://appdala.net/wp-content/uploads/IMG-1180.jpg','','Sản phẩm trà khổ qua rừng HANY được sản xuất quy trình khép kín, kiểm soát từ khâu nguyên liệu đến thành phẩm.Trà khổ qua rừng HANY được làm từ 100% khổ qua rừng được tuyển chọn, làm sạch cắt lát, sấy khô, xay nhuyễn, rang cho vào túi lọc tạo ra trà khổ qua rừng HANY thơm ngon, tinh khiết, tốt cho sức khỏe.\nTheo y học cổ truyền, khổ qua rừng có vị đắng, tính hàn, không độc có tác dụng:\nTác dụng hỗ trợ điều trị tiểu đường hiệu quả\nỔn định và giảm đường huyết\nHỗ trợ phòng chống ung thư\nGiảm cân\nĐẹp da\nĐiều trị bệnh gout.\nThành Phần\n100% khổ qua rừng nguyên chất.\nHướng dẫn sử dụng\nHãm trà bằng nước sôi, một túi trà/150-200ml nước. Mỗi ngày dùng từ 3-5 túi trà. Giải nhiệt, tiêu đờm, ổn định đường huyết, trị mụn nhọt, nám da, làm đẹp da, chữa ho, thấp khớp tiểu đường, gout, ngừa ung thư\nBảo quản\nĐể nơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm có hiện tượng nấm mốc, có mùi lạ\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 2 năm kể từ ngày sản xuất..',45000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,40),(439,'Cao mềm Atiso 500g',0,'2022-03-03 20:57:42','439EA',0,36,0,'https://appdala.net/wp-content