g công nghệ hiện đại.\nDứa là một trong những loại trái cây được rất nhiều người ưa thích, ngoài tác dụng giúp giải nhiệt, trái dứa còn có những công dụng rất tốt trong việc hỗ trợ điều trị bệnh cho con người như:\nKiểm soát bệnh viêm khớp\nTăng cường hệ miễn dịch\nTrái dứa tốt cho tế bào và mô\nDứa giúp tăng sức khỏe cho hệ xương khớp\nDứa rất tốt cho sức khỏe của mắt\nTác dụng với các bệnh liên quan tới huyết áp\nĂn dứa tốt cho hệ tuần hoàn máu.\nThành Phần\n100% quả dứa Cayenne\nHướng dẫn sử dụng\nDùng ăn ngay sau khi mở hộp, đậy kín sau mỗi lần sử dụng\nBảo quản\nĐể nơi khô ráo, thoáng mát. Tránh ánh nắng trực tiếp.\nChỉ tiêu chất lượng\nĐộ chua >< 3%\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm có hiện tượng nấm mốc\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 1 năm kể từ ngày sản xuất..',90000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,180),(455,'Hoa Atiso đỏ sấy dẻo 200g',0,'2022-03-04 09:09:10','455XP',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1161.jpg','https://appdala.net/wp-content/uploads/IMG-1139.jpg','','Hoa atiso đỏ sấy dẻo (mứt hoa hồng) được chế biến từ hoa atiso đỏ tươi, chọn lọc kỹ càng. \nHoa atiso đỏ sấy dẻo có vị chua nhẹ, mùi thơm đặc trưng, có thể dùng ngay hoặc chế biến thành 1 số món ăn khác',100000,NULL,NULL,NULL,0,1,14,1,1,0,1,'','','',NULL,NULL,NULL,200),(456,'Chuối Laba sấy dẻo 300g',0,'2022-03-04 09:18:06','456A',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1126.jpg','https://appdala.net/wp-content/uploads/fg.jpg;https://appdala.net/wp-content/uploads/IMG-1125.jpg','','Chuối Laba là loại chuối đặc sản nổi tiếng của vùng đất Lâm Đồng với ưu điểm là rất dẻo, ngọt ngon. Chuối Laba sấy Hany được tuyển lựa từng những trái chuối Laba ngon nhất, được sấy bằng điện, hợp vệ sinh\nQuả chuối Laba cung cấp nhiều kali, phốt pho, magiê, sắt, canxi, tinh bột và đường, vitamin A, C, B… nên rất bổ dưỡng, giúp phát triển cơ thể, tăng trưởng hệ xương và sức đề kháng, làm đẹp da và giúp tóc mọc nhan