/wp-content/uploads/5d768a9b3fb91155794899.jpg','','Để làm CÀ CHUA SẤY HANY thơm ngon, hấp dẫn cần tuyển chọn những quả cà chua tốt nhất, tươi ngon, và chín mọng. CÀ CHUA SẤY HANY có vị chua, ngọt thanh đặc trưng của cà chua, sản phẩm giúp thanh nhiệt, giải độc và tiêu hóa tốt, phù hợp cho mọi đối tượng.\nTác dụng tuyệt vời của cà chua\nCải thiện thị lực\nPhòng chống ung thư\nLàm sáng da\nGiảm lượng đường trong máu\nThúc đẩy giấc ngủ ngon\nGiữ xương chắc khỏe.\nChữa các bệnh mãn tính\nTốt cho mái tóc của bạn\nThành Phần\nQuả cà chua\nHướng dẫn sử dụng\nDùng ăn ngay sau khi mở nắp, đậy kín sau mỗi lần sử dụng\nBảo quản\nĐể nơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm có hiện tượng bị mốc\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 1 năm kể từ ngày sản xuất..',60000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,200),(459,'Hồng sấy dẻo 250g',0,'2022-03-04 09:42:02','459E',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1095.jpg','https://appdala.net/wp-content/uploads/6C7FEFCB-5FB3-425A-AEF1-AF2D66CF7FB3.jpeg','','Hồng là loại trái cây thơm ngon, bổ dưỡng, được bình chọn trong top 4 loại quả ngon và độc đáo nhất của vùng đất Đà Lạt. Quả hồng mang trong mình vị ngọt tự nhiên cùng màu sắc đỏ cam đặc trưng, chính vì điều này, hồng rất thích hợp để chế biến thành các sản phẩm khô, dẻo mang hương vị mới lạ, đặc sắc. HỒNG SẤY DẺO HANY tuyển chọn từ những quả hồng to tròn, căng mọng, được lấy sạch hạt và tim màu trắng bên trong, đảm bảo chất lượng của hồng khi sấy, vẫn giữ nguyên vị và mùi thơm đặc biệt. HỒNG SẤY DẺO HANY không chỉ thu hút Du khách bởi chất lượng, mẫu mã mà còn vì dinh dưỡng của quả hồng được giữ lại trọn vẹn.\n Một điều không thể không nhắc đến chính là công ty dụng tuyệt vời mà quả hồng mang lại: chữa nấc, tốt cho người bị huyết áp cao và bệnh tiêu hóa, hỗ trợ bệnh nhân tiểu đường, chống viêm, nhiễm trùng,...\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất in trê