tti có thể ăn cùng với sữa tươi, sữa chua không đường, smoothie, cafe không đường, trái cây...\nBánh Biscotti phù hợp với mọi đối tượng, đặc biệt là:\n- Người có nhu cầu giữ dáng\n-  Mẹ bầu và bé\n- Người tập gym, lối sống healthy\n- Người có tiền sử bệnh tim, tiểu đường\nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nKhối lượng tịnh: 100 gram\nQuy cách đóng gói: hộp nhựa\nHDBQ: Nơi khô ráo, thoáng mát, tránh ánh nắng.\nHDSD: Mở bao bì và dùng trực tiếp, làm kín miệng sau khi sử dụng.\nHotline: 0931 78 4477\nWebsite: https://berryland.vn/ \nXưởng sản xuất: 58 Lý Nam Đế, P.8, TP.Đà Lạt  (Hiện tại chỉ hoạt động vào giờ hành chính)\nCửa hàng Đặc sản TIỆM DÂU NHỎ: 40B Trương Công Định, P.1, TP.Đà Lạt (Hoạt động từ 8h - 21h tất cả các ngày)',60000,55000,NULL,NULL,0,1,2,1,1,0,1,'','','',NULL,NULL,NULL,100),(469,'Khoai lang vàng sấy giòn',0,'2022-03-04 10:43:12','4697R',0,36,0,'https://appdala.net/wp-content/uploads/IMG-1076.jpg','https://appdala.net/wp-content/uploads/5d79186dc46dc793484312.jpg;https://appdala.net/wp-content/uploads/5d79186d98362449687184.jpg;https://appdala.net/wp-content/uploads/5d79186d2d7b1412434668.jpg','','Thành Phần\nKhoai lang, đường, dầu olein, muối\nHướng dẫn sử dụng\nMở bao ăn ngay, đóng kín miệng túi khi chưa sử dụng hết\nBảo quản\nNơi khô ráo và thoáng mát\nThông tin cảnh báo\nKhông sử dụng khi sản phẩm nấm mốc, có mùi vị lạ\nXuất xứ: Lâm Đồng Việt Nam\nNgày sản xuất: in trên bao bì\nHạn sử dụng: 1 năm kể từ ngày sản xuất..\n\n',55000,NULL,NULL,NULL,0,0,14,1,1,0,1,'','','',NULL,NULL,NULL,300),(470,'Mứt dâu tây dẻo 400g',0,'2022-03-04 10:49:05','470HX',0,36,0,'https://appdala.net/wp-content/uploads/mut-dau-tay-deo-moi.png','https://appdala.net/wp-content/uploads/IMG-1060.jpg','','Từ những trái dâu tây tươi ngon, Công ty TNHH HANY Đà Lạt còn làm ra sản phẩm mứt dâu tây khô HANY thơm ngon, dễ sử dụng, món mứt dâu tây HANY có thể dùng để phết bánh mì sandwich, làm sirô mứt dâu đá bào, sữa chua…\nThành Phần\nQuả dâu tây, đường cát, ac