a chua, pha nước,...',45000,NULL,NULL,NULL,0,1,14,1,1,0,1,'','','',NULL,NULL,NULL,200),(481,'draf',0,'2022-03-04 17:20:54','481KI',0,36,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(482,'Nước cốt dâu tây Berryland',0,'2022-03-10 09:18:03','482YN',0,35,0,'https://appdala.net/wp-content/uploads/dddd.jpg','https://appdala.net/wp-content/uploads/D2.jpg;https://appdala.net/wp-content/uploads/d3.jpg','','NƯỚC CỐT DÂU TÂY BERRYLAND\nHương vị nước cốt dâu ngọt nhẹ, hòa quyện với vị chua thanh của dâu tây, đây là món nước ép tuyệt vời dành riêng cho bạn và gia đình. \nTrong trái dâu tây có chứa rất nhiều vitamin C,A chất xơ, protein và nhiều hợp chất khác rất tốt cho sức khỏe\nVitamin A có nhiều trong trái dâu tây sẽ giúp bạn làm đẹp da và làm sáng mắt\n Dâu tây còn chứa nhiều vitamin C giúp bạn tăng cường sức đề kháng \n Giảm nguy cơ gây ung thư \n Ngăn ngừa đột quỵ và các vấn đề về tim mạch\nCách pha nước cốt dâu tây\nBạn dùng 1 phần nước cốt pha với 3-5 phần nước lọc tùy theo sở thích của bạn sau đó cho thêm đá và 1 lát chanh tươi để sử dụng giúp ly nước cốt dâu tây thơm ngon và có vị tươi mát hơn\n\n\nHotline: 0931 78 4477\nWebsite: https://berryland.vn/ \nXưởng sản xuất: 58 Lý Nam Đế, P.8, TP.Đà Lạt  (Hiện tại chỉ hoạt động vào giờ hành chính)\nCửa hàng Đặc sản TIỆM DÂU NHỎ: 40B Trương Công Định, P.1, TP.Đà Lạt (Hoạt động từ 8h - 21h tất cả các ngày)\n',37000,NULL,NULL,NULL,10,1,2,1,1,0,1,'','','',NULL,NULL,NULL,500),(483,'Nước cốt dâu tây',0,'2022-03-12 14:24:48','483QH',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-200135.jpg','https://appdala.net/wp-content/uploads/f5ba6489af090f2e98f796a1f67020fd_tn.jpg','','Nước cốt trái cây tươi Đà Lạt là một loại thức uống rất đặc trưng và phổ biến của người Đà Lạt. Ngoài ra nó cũng là món quà không thể thiếu của du khách dành để biếu tặng người thân, bạn bè sau chuyến thăm thú ở xứ sở sương mù.\n\nCó thể nói nước giải khát thông thường mang đến hương và vị trái cây thoang thoảng, nhè nhẹ thì nước cốt lại mang tất cả những tinh tuý, kết tinh đậm đặc, vẹn nguyên từ trái cây tươi đặc sản Đà Lạt. Vì vậy nước cốt trái cây đặc biệt tốt cho sức khoẻ vì lưu giữ trọn vẹn các loại vitamin, dưỡng chất có trong thành phần trái cây tươi tự nhiên. \n\nNhắc đến trái cây đặc sản Đà Lạt, ta nghĩ ngay đến những trái dâu tây đỏ mọng và rất thơm mang hương vị chua thanh tự nhiên. Cũng là \"dâu\" xứ người nhưng dâu tằm lại mang vị ngọt ngào và màu sắc đậm đà hơn. \nNguyên chất 100%\n\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc\n\n',49000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,500),(484,'Nước cốt chanh dây',0,'2022-03-12 14:32:50','484CN',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-200508.jpg','https://appdala.net/wp-content/uploads/efc4f843e787a156767e53dee53aeade_tn.jpg','','Nước cốt trái cây tươi Đà Lạt là một loại thức uống rất đặc trưng và phổ biến của người Đà Lạt. Ngoài ra nó cũng là món quà không thể thiếu của du khách dành để biếu tặng người thân, bạn bè sau chuyến thăm thú ở xứ sở sương mù.\n\nCó thể nói nước giải khát thông thường mang đến hương và vị trái cây thoang thoảng, nhè nhẹ thì nước cốt lại mang tất cả những tinh tuý, kết tinh đậm đặc, vẹn nguyên từ trái cây tươi đặc sản Đà Lạt. Vì vậy nước cốt trái cây đặc biệt tốt cho sức khoẻ vì lưu giữ trọn vẹn các loại vitamin, dưỡng chất có trong thành phần trái cây tươi tự nhiên. \n\nKhông thể không kể đến một loại trái cây có cái tên ngồ ngộ rất Đà Lạt...trái mác mác hay còn gọi là chanh dây, chanh leo đã được rất nhiều chị em phụ nữ yêu thích vì sự hữu ích của nó trong việc giúp chị em giữ được cơ thể khoẻ mạnh và vóc dáng thon gọn.\n\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc\n',55000,NULL,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,500),(485,'Nước cốt dâu tằm',0,'2022-03-12 14:35:36','485OK',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-200312.jpg','https://appdala.net/wp-content/uploads/c77f48ac85e01adfbae3bd7d97ac6bd4_tn.jpg','','Nước cốt trái cây tươi Đà Lạt là một loại thức uống rất đặc trưng và phổ biến của người Đà Lạt. Ngoài ra nó cũng là món quà không thể thiếu của du khách dành để biếu tặng người thân, bạn bè sau chuyến thăm thú ở xứ sở sương mù.\nCó thể nói nước giải khát thông thường mang đến hương và vị trái cây thoang thoảng, nhè nhẹ thì nước cốt lại mang tất cả những tinh tuý, kết tinh đậm đặc, vẹn nguyên từ trái cây tươi đặc sản Đà Lạt. Vì vậy nước cốt trái cây đặc biệt tốt cho sức khoẻ vì lưu giữ trọn vẹn các loại vitamin, dưỡng chất có trong thành phần trái cây tươi tự nhiên. \nNước dâu tằm có tác dụng thanh nhiệt, giải độc khá hiệu quả. Đặc biệt nếu ai bị mụn nhọt, nóng trong người thì có thể sử dụng loại nước này hằng ngày để cải thiện. Bên cạnh đó, nước dâu tằm còn chứa khá nhiều vitamin C nên sẽ có tác dụng hỗ trợ điều trị táo bón hiệu quả.\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc\n\n\n\n',59000,49000,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,500),(486,'Hạt điều vỏ lụa',0,'2022-03-12 14:38:50','486HR',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-203234.jpg','https://appdala.net/wp-content/uploads/31.jpg','','Hạt điều lụa chính là tên gọi phổ biến của loại hạt điều đã qua chế biến, đã xử lý bỏ đi phần lớp vỏ cứng bên ngoài chỉ còn lại phần vỏ mỏng màu đâu sẫm. Hạt điều lụa có thể sử dụng trực tiếp, chỉ cần bóc đi phần vỏ lụa ngoài một cách đơn giản.\nHạt sạch, thuần chủng, được thu hoạch từ những cây điều lâu năm trên đất Bình Phước\nHạt  được sàng lọc kỹ lưỡng, hạt mập mạp, giòn, chất lượng tốt nhất thị trường.\nHạt điều đã rang muối, vị ngọt đậm đà, ít bị cháy và sâu mọt như những nơi khác, rất dễ bóc vỏ.\n   Tác dụng chính của hạt điều: \nRất tốt cho mẹ bầu - phát triển trí não thai nhi\nCải thiện trí nhớ, cải thiện giấc ngủ ngon hơn\nTốt cho bệnh nhân bị tiểu đường, cao huyết áp, người bệnh ăn kiêng\nPhòng chống bệnh ung thư hiệu quả\nNgăn ngừa bệnh tim mạch, củng cố động mạch. Hạn chế Cholesterol xấu.\nBổ sung chất xơ Giúp nhuận tràng\nCung cấp canxi, khoáng chất, Vitamin, Omega3 giúp Bảo vệ xương, chống lão hóa...\nGiảm cân, làm đẹp da , tóc , giữ dáng cho người tập gym\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc\n\n',179000,169000,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,500),(487,'Trà nụ hồng cam quế',0,'2022-03-12 15:50:35','487LK',0,34,0,'https://appdala.net/wp-content/uploads/PhotoRoom-20220301-205812.jpg','https://appdala.net/wp-content/uploads/4b08de146d5025aaa3fce39bbead748b.jpg','','Thành phần trà Nụ hồng cam quế:\n- Cam sấy,nụ hoa hồng, quế thanh cạo vỏ\nCông dụng trà cam quế hoa hồng:\n- Giữ ấm cơ thể, giảm triệu chứng khó chịu do đau họng, cảm lạnh\n- Hỗ trợ cực tốt cho việc thải độc cơ thể, giảm giữ dáng, đẹp da\n- Tăng sức đề kháng cho cơ thể\n- Cải thiện chức năng của hệ tiêu hoá, giảm đầy bụng\nCách sử dụng: Cho 5-10 bông kèm cam và quế, Dùng nước ấm đổ vào tráng qua nhanh bỏ 1 lượt nước đầu sau đó đổ thêm vào khoảng 200-300ml nước nóng 100 độ đợi khoảng 10ph đợi trà nguội bớt dùng lúc trà còn ấm nha. Có thể uống kèm mật ong hoặc đường phèn\n*LƯU Ý: nên uống trà luc sáng sớm, sau bữa ăn 30ph, trước khi ngủ 30 phút\nKhông dùng cho phụ nữ đang mang thai\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 12 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',55000,NULL,NULL,NULL,0,0,13,1,1,1,1,'','','',NULL,NULL,NULL,50),(488,'draf',0,'2022-03-18 17:11:01','488WL',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(489,'draf',0,'2022-03-18 17:15:35','489Q3',0,17,0,'','','','',0,NULL,NULL,NULL,0,1,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(490,'draf',0,'2022-03-18 17:17:02','490HL',0,17,0,'','','','',0,NULL,NULL,NULL,0,1,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(491,'Nếp quýt Đạ Tẻh - Túi 5kg',0,'2022-03-18 17:36:34','491N',0,17,0,'https://appdala.net/wp-content/uploads/z3936062181517_888f3c37a8b8c1e9ea5eeaac6684ffb3-1.jpg','https://appdala.net/wp-content/uploads/nep.jpg;https://appdala.net/wp-content/uploads/nep-2.jpg;https://appdala.net/wp-content/uploads/z3936073144594_e3c8a8fa909d85deca27a15e55c72e91.jpg;https://appdala.net/wp-content/uploads/z3936062192310_6f92867c674ab0525ed0ab3cfee067cc.jpg;https://appdala.net/wp-content/uploads/z3936062186763_b1234fceb71b0657963068e8b1b1c77b.jpg','','Nếp quýt Đạ Tẻh - quà tặng đặc sản có nguồn gốc từ người dân tộc Tày, Nùng ở Tây Bắc đưa về trồng tại Đạ Tẻh.\nGạo nếp Quýt Đạ Tẻh – đại sứ của cao nguyên có ưu điểm nổi trội so với nhiều loại nếp khác như: Vỏ mỏng, hạt bầu tròn, nẩy mập, trắng đục, hạt gạo không chỉ dẻo, sở hữu hương thơm mạnh mà nó còn mang trong mình vị ngọt đặc trưng nữa.\nBạn có thể dùng nếp Quýt Đạ Tẻh để đổ xôi mà cả ngày vẫn dẻo thơm đúng vị. Rượu gạo nếp Quýt cũng mang hương vị không lẫn vào đâu được. Đó cũng chính là lý do tại sao đặc sản này đã có mặt trong bao bữa cơm trên mọi miền quê cùng các phương trời.\nTrong những năm gần đây, thương hiệu nếp Quýt đã phủ sóng ra cả bên ngoài lãnh thổ Việt Nam và nhận được sự ưa chuộng của thị trường. Chỉ cần một lần sử dụng những sản phẩm được làm từ nếp Quýt thì chắc hẳn bạn sẽ không thể quên được hương vị đặc biệt này.\n',190000,NULL,NULL,NULL,0,0,16,1,1,0,1,'','','',NULL,NULL,NULL,5000),(492,'draf',0,'2022-03-20 11:30:00','492HD',0,39,0,'','','','',0,NULL,NULL,NULL,0,1,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(493,'Cao Nước Atiso Ngọc Duy Có Đường',0,'2022-03-20 11:33:04','4933',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-CO-DUONG_.jpg','','','Là “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời.\n\nNằm trong dòng atiso nhưng khác với trà túi lọc (dạng atiso sấy khô), cao mềm atiso (atiso nấu đặc), cao nước được ra mắt dưới dạng lỏng, dễ sử dụng và hợp với nhiều đối tượng hơn. Với 90% cao lỏng, 10% đường, cao nước atiso có vị ngọt nhẹ, mùi thơm atiso đậm đặc trưng. Cao nước cũng được nấu từ atiso nhưng không đậm đặc bằng cao mềm nên mùi thuốc bắc có phần nhẹ bớt, chỉ còn thoáng qua, ngửi kỹ mới nhận ra.',44000,NULL,NULL,NULL,100,0,17,1,1,0,1,'','','',NULL,NULL,NULL,30),(494,'Cao Nước Atiso Ngọc Duy Không Đường',0,'2022-03-20 12:15:37','494RO',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-KHONG-DUONG.jpg','','','Là “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời.\nCao nước atiso không đường được ra đời với hi vọng mang đến một sản phẩm phù hợp hơn cho những đối tượng khách hàng không muốn sử dụng đường (người tiểu đường hoặc ăn kiêng) với thành phần là 100% cao lỏng atiso. Tuy nhiên, chính vì vị đắng đặc trưng của atiso còn nguyên nên sẽ gây cảm giác hơi khó chịu cho những người không thích đắng nhưng xét về sự nguyên chất và hương vị thật nhất của atiso thì cao nước atiso không đường chính là một sản phẩm điển hình nhất.',50000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,30),(495,'Cao Nước Atiso Cỏ Ngọt',0,'2022-03-20 12:20:00','495BM',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-ATISO-CO-NGOT_.jpg','','','Là “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời.\nBản chất cây cỏ ngọt cũng một loại thảo dược có tác dụng ổn định huyết áp, tốt cho răng và nướu, thích hợp cho người bị tiểu đường vì trong cây cỏ ngọt có chất steviol có độ ngọt gấp 300 lần so với đường mía.\nTrên thị trường hiện nay có rất nhiều cách sử dụng cây cỏ ngọt như phơi sấy dùng trực tiếp, tán nhuyễn thành bột, thay thế đường mía trong kĩ nghệ thực phẩm, tạo thành đường riêng cho người bị tiểu đường... Và đương nhiên, với kinh nghiệm dày dạn trong ngành thảo dược của Ngọc Duy, việc kết hợp cao lỏng atiso và cỏ ngọt đã tạo ra một sản phẩm cao nước đặc biệt hơn và thông dụng hơn.',70000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,30),(496,'Cao Nước Atiso Có Đường Cao Cấp',0,'2022-03-20 13:06:55','496RO',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-CO-DUONG-CAO-CAP.jpg','','','1/ Nguồn Gốc\nLà “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời.\nNằm trong dòng atiso nhưng khác với trà túi lọc (dạng atiso sấy khô), cao mềm atiso (atiso nấu đặc), cao nước được ra mắt dưới dạng lỏng, dễ sử dụng và hợp với nhiều đối tượng hơn. Với 70% cao lỏng bông atiso, 30% cao lỏng lá atiso, cao nước atiso có vị ngọt nhẹ, mùi thơm atiso đậm đặc trưng. Cao nước cũng được nấu từ atiso nhưng không đậm đặc bằng cao mềm nên mùi thuốc bắc có phần nhẹ bớt, chỉ còn thoáng qua, ngửi kỹ mới nhận ra.\n2/ Hướng dẫn sử dụng:\nTùy vào từng trường hợp mà có những cách sử dụng khác nhau:\n• Uống trực tiếp nếu xung quanh không có nước để pha. Vị sẽ ngọt nhưng không phải cái ngọt của nước đường mà còn có vị đắng đắng đi theo.\n• Pha với nước (1 ống cho 500ml nước): uống hằng ngày để giải nhiệt, mát gan, có thể dùng làm nước giải rượu, giảm đau đầu, giảm say.\n• Pha với rượu (1 ống cho 300ml rượu): rượu vẫn giữ đúng nguyên vị nhưng lại có thêm mùi thơm của atiso, rượu bình thường sẽ trở thành rượu thuốc, giúp giải độc cho gan trong quá trình uống rượu, chống say.\n• Pha với bia (1 ống cho 250ml): nghe có vẻ lạ nhưng mùi vị lại khá hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm của atiso.\nXen kẽ hình cao nước và các cách sử dụng\nNếu sử dụng thường xuyên (từ 1-2 tuýp/ ngày), cao nước atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',160000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,80),(497,'Cao Nước Atiso Không Đường Cao Cấp',0,'2022-03-20 13:13:41','4973',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-KHONG-DUONG-CAO-CAP.jpg','','','1/ Nguồn Gốc\n\nLà “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời.\nCao nước atiso không đường được ra đời với hi vọng mang đến một sản phẩm phù hợp hơn cho những đối tượng khách hàng không muốn sử dụng đường (người tiểu đường hoặc ăn kiêng) với thành phần là 100% cao lỏng atiso. Tuy nhiên, chính vì vị đắng đặc trưng của atiso còn nguyên nên sẽ gây cảm giác hơi khó chịu cho những người không thích đắng nhưng xét về sự nguyên chất và hương vị thật nhất của atiso thì cao nước atiso không đường chính là một sản phẩm điển hình nhất.\n\n2/ Hướng dẫn sử dụng:\n\nTùy vào từng trường hợp mà có những cách sử dụng khác nhau:\n• Uống trực tiếp nếu xung quanh không có nước để pha, cảm nhận đươc vị đắng nhẫn đặc trưng của atiso.\n• Pha với nước (1 ống cho 500ml nước): uống hằng ngày để giải nhiệt, mát gan, có thể dùng làm nước giải rượu, giảm đau đầu, giảm say.\n• Pha với rượu (1 ống cho 300ml rượu): rượu vẫn giữ đúng nguyên vị nhưng lại có thêm mùi thơm của atiso, rượu bình thường sẽ trở thành rượu thuốc, giúp giải độc cho gan trong quá trình uống rượu, chống say.\n• Pha với bia (1 ống cho 250ml): nghe có vẻ lạ nhưng mùi vị lại khá hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm của atiso.\nXen kẽ hình cao nước và các cách sử dụng\nNếu sử dụng thường xuyên (từ 1-2 tuýp/ ngày), cao nước atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',180000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,80),(498,'Cao Nước Atiso Cỏ Ngọt Cao Cấp',0,'2022-03-20 13:16:09','4981U',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-ATISO-CO-NGOT-CAO-CAP.jpg','','','1/ Nguồn Gốc\n\nLà “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời.\nBản chất cây cỏ ngọt cũng một loại thảo dược có tác dụng ổn định huyết áp, tốt cho răng và nướu, thích hợp cho người bị tiểu đường vì trong cây cỏ ngọt có chất steviol có độ ngọt gấp 300 lần so với đường mía.\nTrên thị trường hiện nay có rất nhiều cách sử dụng cây cỏ ngọt như phơi sấy dùng trực tiếp, tán nhuyễn thành bột, thay thế đường mía trong kĩ nghệ thực phẩm, tạo thành đường riêng cho người bị tiểu đường... Và đương nhiên, với kinh nghiệm dày dặn trong ngành thảo dược của Ngọc Duy, việc kết hợp cao lỏng atiso và cỏ ngọt đã tạo ra một sản phẩm cao nước đặc biệt hơn và thông dụng hơn.\n\n2/ Hướng dẫn sử dụng:\n\nTùy vào từng trường hợp mà có những cách sử dụng khác nhau:\n• Uống trực tiếp nếu xung quanh không có nước để pha. Vị sẽ ngọt nhưng không phải cái ngọt của nước đường mà còn có vị đắng đắng đi theo.\n• Pha với nước (1 ống cho 500ml nước): uống hằng ngày để giải nhiệt, mát gan, có thể dùng làm nước giải rượu, giảm đau đầu, giảm say.\n• Pha với rượu (1 ống cho 300ml rượu): rượu vẫn giữ đúng nguyên vị nhưng lại có thêm mùi thơm của atiso, rượu bình thường sẽ trở thành rượu thuốc, giúp giải độc cho gan trong quá trình uống rượu, chống say.\n• Pha với bia (1 ống cho 250ml): nghe có vẻ lạ nhưng mùi vị lại khá hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm của atiso.\nXen kẽ hình cao nước và các cách sử dụng\nNếu sử dụng thường xuyên (từ 1-2 tuýp/ ngày), cao nước atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',230000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,80),(499,'Cao Nước Atiso Sâm Cao Cấp',0,'2022-03-20 13:18:40','499AD',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-ATISO-SAM.jpg','','','1/ Nguồn Gốc\n\nLà “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời.\n\nCao nước atiso Sâm là dòng sản phẩm cao nước được chiết xuất từ 35% cao lỏng atiso, 30% cao lỏng sâm đỏ, 30% cao sâm đương quy, 5% cao lỏng cỏ ngọt. Atiso kết hợp với sâm đương quy giúp bộ đôi khi kết hợp tạo ra dòng sản phẩm có chức năng gải độc mát gan tốt nâng cao sức khỏe, bồi bổ cơ thể. Vị cao nước atiso sâm có vị ngọt từ cây cỏ ngọt, vẫn giữ được vị đắng nhẫn đặc trưng của atiso trong quá trình cô đặc khép kín.\n\n2/ Hướng dẫn sử dụng:\n\nTùy vào từng trường hợp mà có những cách sử dụng khác nhau:\n• Uống trực tiếp nếu xung quanh không có nước để pha. Vị ngọt kết hợp với vị đắng đặc trưng của atiso.\n• Pha với nước (1 ống cho 500ml nước): uống hằng ngày để giải nhiệt, mát gan, có thể dùng làm nước giải rượu, giảm đau đầu, giảm say.\n• Pha với rượu (1 ống cho 300ml rượu): rượu vẫn giữ đúng nguyên vị nhưng lại có thêm mùi thơm của atiso, rượu bình thường sẽ trở thành rượu thuốc, giúp giải độc cho gan trong quá trình uống rượu, chống say.\n• Pha với bia (1 ống cho 250ml): nghe có vẻ lạ nhưng mùi vị lại khá hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm của atiso.\nXen kẽ hình cao nước và các cách sử dụng\nNếu sử dụng thường xuyên (từ 1-2 tuýp/ ngày), cao nước atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',300000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,80),(500,'Cao Nước Gừng Sả',0,'2022-03-20 13:22:00','5005J',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-ATISO-SAM_.jpg','','','1/ Nguồn Gốc\n\nLà “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời\n\nCao nước gừng sả kết hợp vị ấm nóng của hai loại cây thuốc cùng dược tính sát khuẩn từ cây thảo dược tự nhiên, giữ nguyên hương vị tiện sử dụng trong hình dạng tuýp nước 10 ml. Tất cả công dụng tuyệt vời của 2 loại dược liệu này đều có trong 1 tuýp cao nước nhỏ nhắn mang tên Ngọc Duy. Chỉ cần vặn mở tuýp là có thể dùng ngay. Sản phẩm cao nước gừng sả với chút ngọt, chút cay, chút thơm nồng quyến rũ, vẫn giữ nguyên dược tính và hương vị của hai vị thuốc phổ biến nhờ quy trình sản xuất khép kín.\n\n2/ Hướng dẫn sử dụng:\n\nTùy vào từng trường hợp mà có những cách sử dụng khác nhau:\n• Uống trực tiếp nếu xung quanh không có nước để pha.\n• Pha với nước (1 ống cho 500ml nước): uống hằng ngày để giải nhiệt, mát gan, có thể dùng làm nước giải rượu, giảm đau đầu, giảm say.\n• Pha với rượu (1 ống cho 300ml rượu): rượu vẫn giữ đúng nguyên vị nhưng lại có thêm mùi thơm, rượu bình thường sẽ trở thành rượu thuốc, giúp giải độc cho gan trong quá trình uống rượu, chống say.\n• Pha với bia (1 ống cho 250ml): nghe có vẻ lạ nhưng mùi vị lại khá hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm.\nXen kẽ hình cao nước và các cách sử dụng\nNếu sử dụng thường xuyên (từ 1-2 tuýp/ ngày), cao nước gừng sả sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',50000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,30),(501,'Cao Nước Slim',0,'2022-03-20 13:23:23','501FE',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-ATISO-SLIM_.jpg','','','1/ Nguồn Gốc\n\nLà “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời. \n\nCao nước Slim không đường với sự thay đổi trong hàm lượng cynarin và thay đổi về quy cách hộp 20 tuýp, hỗ trợ người tiểu đường hoặc ăn kiêng với thành phần là 100% cao lỏng atiso. Tuy nhiên, chính vì không sử dụng đường hay cỏ ngọt nên vị đắng đặc trưng của atiso sẽ còn nguyên gây cảm giác hơi khó chịu cho những người không thích đắng ở lần đầu tiên sử dụng, nhưng về lâu dài, cao nước Slim có tác dụng kiểm soát lượng mỡ thừa, thải độc tố cho gan, thanh lọc cơ thể.\n\n2/ Hướng dẫn sử dụng:\n\nTùy vào từng trường hợp mà có những cách sử dụng khác nhau:\n• Uống trực tiếp nếu xung quanh không có nước để pha.\n• Pha với nước (1 ống cho 500ml nước): uống hằng ngày để giải nhiệt, mát gan, có thể dùng làm nước giải rượu, giảm đau đầu, giảm say.\n• Pha với rượu (1 ống cho 300ml rượu): rượu vẫn giữ đúng nguyên vị nhưng lại có thêm mùi thơm của atiso, rượu bình thường sẽ trở thành rượu thuốc, giúp giải độc cho gan trong quá trình uống rượu, chống say.\n• Pha với bia (1 ống cho 250ml): nghe có vẻ lạ nhưng mùi vị lại khá hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm của atiso.\nXen kẽ hình cao nước và các cách sử dụng\nNếu sử dụng thường xuyên (từ 1-2 tuýp/ ngày), cao nước atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',125000,NULL,NULL,NULL,0,0,NULL,1,1,0,1,'','','',NULL,NULL,NULL,60),(502,'Cao Nước Atiso Vitamin C',0,'2022-03-20 13:24:40','502K',0,39,0,'https://appdala.net/wp-content/uploads/CAO-NUOC-ATISO-VITAMINC_.jpg','','','Là “đứa con” sinh sau đẻ muộn của dòng atiso, thừa hưởng những tinh hoa mà trà túi lọc và cao atiso mang lại, dưới sự đón nhận nồng nhiệt của mọi người, ngày 01/06/2018, trong đêm hội Atiso Đà Lạt, cao nước atiso Ngọc Duy chính thức ra đời\n\nVitamin C là một loại vitamin chống oxy hóa mạnh, rất quan trọng đối với hệ thống miễn dịch, tăng cường các chức năng hoạt động của rất nhiều bộ phận trong cơ thể, tái tạo tế bào, chữa lành vết thương, giúp xương chắc khỏe... Chính vì vậy, việc cung cấp đầy đủ Vitamin C cho cơ thể mỗi ngày là cực kì cần thiết.Vitamin C rất quen thuộc với mọi người vì nó có nhiều trong các loại trái cây như: ổi, dâu, cam,... ngoài ra Vitamin C còn có trong phần cùi trắng của cam, quýt, chanh,... đặc biệt có nhiều trong rau xanh như bông cải xanh, rau má, khoai tây, cà chua,...\n\nMột cách đơn giản hơn và nhanh chóng hơn để cung cấp Vitamin C cho cơ thể chính là sử dụng Cao nước Vitamin C Ngọc Duy. Với thành phần là sự kết hợp của atiso và các loại trái cây, rau xanh giàu Vitamin C như: ổi, dâu tây, cam, rau má,... bên cạnh đó Vitamin C được đưa trực tiếp vào sản phẩm trong quá trình sản xuất, từ đó làm cho giá trị mà Vitamin C mang lại phát huy tác dụng tối ưu nhất! Hơn thế nữa, thành phần quan trọng là atiso trong Cao nước atiso Vitamin C giúp tăng cường chức năng gan, giải độc gan, thanh nhiệt,...\n\nCao nước Vitamin C được ra đời trong giai đoạn đại dịch COVID đang ở thời kì cao điểm nhất. Virus COVID sẽ không thể xâm nhập vào cơ thể bạn nếu bạn có một sức đề kháng cao, một cơ thể khỏe mạnh và các biện pháp hỗ trợ sức khỏe kịp thời. Sản phẩm này dùng được cho cả người lớn và trẻ em, và an toàn nếu sử dụng thường xuyên. Chỉ cần 1 - 2 tuýp mỗi ngày bạn đã cung cấp được lượng vitamin C cần thiết cho cơ thể.',75000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,30),(504,'Cao Ngọt Atiso 200gr',0,'2022-03-20 14:31:28','504AP',0,39,0,'https://appdala.net/wp-content/uploads/LA-KHO-CO-DUONG-200GR_DO.jpg','','','Atiso Ngọc Duy là đơn vị đầu tiên sản xuất ra trà atiso túi lọc. Với sự đón nhận của đông đảo người dùng thì Ngọc Duy đã cho ra đời các dòng sản phẩm từ atiso như Cao đặc atiso và cao nước atiso.\n\n  Nằm trong dòng atiso nhưng khác với trà túi lọc (dạng atiso sấy khô), cao nước atiso (atiso dạng lỏng), cao đặc được ra mắt dưới dạng cô đặc từ atiso có màu đen bóng, dạng đặc sánh, vị đắng . Cao ngọt atiso 200gr với 65% lá cao atiso, 30% bông atiso, 5% đường, cao ngọt atiso có vị ngọt nhẹ, mùi thơm atiso đặc trưng rất dễ uống. Cao đặc atiso có mùi hơi giống thuốc bắc.\nTùy vào từng trường hợp mà có những cách sử dụng khác nhau:\n\n• Pha với nước: 1/2 muỗng cao với 250ml nước là đủ dùng cho 1 lần uống, 3 muỗng cao đặc pha với 1,5-2 lít nước ấm khoảng 60-70 độ C khuấy đều dùng cả nhà và bảo quản trong ngăn mát tủ lạnh: uống hằng ngày để giải nhiệt, mát gan, có thể dùng làm nước giải rượu, giảm đau đầu, giảm say.\n• Pha với rượu: (80-100gr cao atiso cho 1lít rượu) rượu vẫn giữ đúng nguyên vị nhưng lại có thêm mùi thơm của atiso, rượu bình thường sẽ trở thành rượu thuốc, phòng các bệnh về xương khớp, cung cấp chất điện giải tốt cho tiêu hóa, ngủ ngon...\n• Pha với bia: nghe có vẻ lạ nhưng mùi vị lại khá hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm của atiso.\n\nNếu sử dụng thường xuyên cao đặc atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',150000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,200),(505,'Cao Atiso Lá Tươi loại 200gr',0,'2022-03-20 14:34:03','505GE',0,39,0,'https://appdala.net/wp-content/uploads/LA-TUOI-200GR.jpg','','',' Atiso Ngọc Duy là đơn vị đầu tiên sản xuất ra trà atiso túi lọc. Với sự đón nhận của đông đảo người dùng thì Ngọc Duy đã cho ra đời các dòng sản phẩm từ atiso như Cao đặc atiso và cao nước atiso.\nNằm trong dòng atiso nhưng khác với trà túi lọc (dạng atiso sấy khô), cao nước atiso (atiso dạng lỏng), cao đặc được ra mắt dưới dạng cô đặc từ atiso có màu đen bóng, dạng đặc sánh, vị đắng . Để giữ nguyên chất dinh dưỡng và thành phần dược tính có trong atiso, với công nghệ tiên tiến nhất Ngọc Duy đã cô đặc lá tươi và cho ra dòng sản phẩm cao lá tươi atiso 200gr được chiết xuất từ 100% lá tươi, cao lá tưoi atiso có vị đắng nhẫn, hơi mặn tạo cảm giác hơi khó uống, có mùi hơi giống thuốc bắc.\nTùy vào từng trường hợp mà có những cách sử dụng khác nhau:\n• Pha với nước : 1/2 muỗng cao với 250ml nước là đủ dùng cho 1 lần uống, 3 muỗng cao đặc pha với 1,5-2 lít nước ấm khoảng 60-70 độ C khuấy đều dùng cả nhà và bảo quản trong ngăn mát tủ lạnh: uống hằng ngày để giải nhiệt, mát gan, có thể dùng làm nước giải rượu, giảm đau đầu, giảm say.\n• Pha với rượu (80-100gr cao atiso cho 1lít rượu): rượu vẫn giữ đúng nguyên vị nhưng lại có thêm mùi thơm của atiso, rượu bình thường sẽ trở thành rượu thuốc, phòng các bệnh về xương khớp, cung cấp chất điện giải tốt cho tiêu hóa, ngủ ngon...\n• Pha với bia: nghe có vẻ lạ nhưng mùi vị lại khá hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm của atiso.\nNếu sử dụng thường xuyên cao đặc atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',255000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,200),(506,'Cao Ngọt Hũ Nhựa loại 500gr',0,'2022-03-20 14:35:46','506F8',0,39,0,'https://appdala.net/wp-content/uploads/CAO-DAC-CO-DUONG-HU.jpg','','','Atiso Ngọc Duy là đơn vị đầu tiên sản xuất ra trà atiso túi lọc. Với sự đón nhận của đông đảo người dùng thì Ngọc Duy đã cho ra đời các dòng sản phẩm từ atiso như Cao đặc atiso và cao nước atiso.\nNằm trong dòng atiso nhưng khác với trà túi lọc (dạng atiso sấy khô), cao nước atiso (atiso dạng lỏng), cao đặc được ra mắt dưới dạng cô đặc từ atiso có màu đen bóng, dạng đặc sánh, vị đắng . Cao ngọt hũ nhựa 500gr với 65% lá cao atiso, 30% bông atiso, 5% đường, cao ngọt atiso có vị ngọt nhẹ, mùi thơm atiso đặc trưng rất dễ uống. Cao đặc atiso có mùi hơi giống thuốc bắc.\nTùy vào từng trường hợp mà có những cách sử dụng khác nhau:\n• Pha với nước : 1/2 muỗng cao với 250ml nước là đủ dùng cho 1 lần uống, 3 muỗng cao đặc pha với 1,5-2 lít nước ấm khoảng 60-70 độ C khuấy đều dùng cả nhà và bảo quản trong ngăn mát tủ lạnh: uống hằng ngày để giải nhiệt, mát gan, có thể dùng làm nước giải rượu, giảm đau đầu, giảm say.\n• Pha với rượu (80-100gr cao atiso cho 1lít rượu): rượu vẫn giữ đúng nguyên vị nhưng lại có thêm mùi thơm của atiso, rượu bình thường sẽ trở thành rượu thuốc, phòng các bệnh về xương khớp, cung cấp chất điện giải tốt cho tiêu hóa, ngủ ngon...\n• Pha với bia: nghe có vẻ lạ nhưng mùi vị lại khá hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm của atiso.\nNếu sử dụng thường xuyên cao đặc atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',240000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,500),(507,'Cao Atiso Ngọt Hũ Nhựa-1Kg',0,'2022-03-20 14:37:56','507VH',0,39,0,'https://appdala.net/wp-content/uploads/CAO-DAC-CO-DUONG-HU-1.jpg','','','1/ Nguồn Gốc\nAtiso Ngọc Duy là đơn vị đầu tiên sản xuất ra trà atiso túi lọc. Với sự đón nhận của đông đảo người dùng thì Ngọc Duy đã cho ra đời các dòng sản phẩm từ atiso như Cao đặc atiso và cao nước atiso.\nNằm trong dòng atiso nhưng khác với trà túi lọc (dạng atiso