á hợp khi pha chung với nhau. Bia sau khi pha sẽ có vị đắng thường thấy của bia nhưng lại có mùi thơm của atiso.\nNếu sử dụng thường xuyên cao đặc atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',562000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,500),(512,'Bông Atiso Sấy Khô Nguyên Chất 200gr',0,'2022-03-20 14:44:16','512I',0,39,0,'https://appdala.net/wp-content/uploads/BONG-ATISO-200GR.jpg','','','1/ Nguồn Gốc\n\n- Atiso là loài cây trồng hiếm có khó tìm, vì công dụng của nó cũng như tất cả các bộ phận của cây đều được sử dụng để chế biến món ăn cũng như các sản phẩm cao cấp cải thiện sức khỏe con người.\n\n-Bông atiso thu hoạch ở dạng búp, nhưng bông tươi để chế biến món ăn sẽ khác với bông tươi mang đi sấy khô.\n\n-Đối với bông atiso sấy khô, bông được rửa tại bồn rửa bằng hệ thống sục khí tự động, sau đó cắt lát, sấy tại lò của nhà máy ở nhiệt độ phù hợp, bông đạt chuẩn phải đạt độ giòn và dai trong từng sớ bông.\n\n- Bông atiso sấy khô 200gr được đóng gói rất đẹp mắt với 100% bông atiso nguyên chất không pha lẫn tạp chất tạo ra dòng sản phẩm với đầy đủ chất dinh dưỡng.\n\n2/ Hướng dẫn sử dụng:\n\n-Nấu nước: Lấy 15-20 gr cho vào 1,5-2lit nước, nấu khoảng 15-20 phút là được.\n\n-Nấu canh: Lấy khoảng 10gr-15gr rửa thật sạch cho vào hầm với xương, chân giò. Nếu bạn ăn chay có thể hầm chung với rau củ quả. Ăn rất thơm ngon và bổ dưỡng.\n\n-Nếu muốn uống ngọt thì có thể cho đường phèn vào. Nếu uống mát có thể thêm đá hoặc để trong ngăn mát tủ lạnh.\n\n-Nếu sử dụng thường xuyên trà atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',170000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,200),(513,'Bông Atiso loại 400gr',0,'2022-03-20 14:47:36','513C',0,39,0,'https://appdala.net/wp-content/uploads/BONG-ATISO-400GR.jpg','','','1/ Nguồn Gốc\n\n- Atiso là loài cây trồng hiếm có khó tìm, vì công dụng của nó cũng như tất cả các bộ phận của cây đều được sử dụng để chế biến món ăn cũng như các sản phẩm cao cấp cải thiện sức khỏe con người.\n\n-Bông atiso thu hoạch ở dạng búp, nhưng bông tươi để chế biến món ăn sẽ khác với bông tươi mang đi sấy khô.\n\n-Đối với bông atiso sấy khô, bông được rửa tại bồn rửa bằng hệ thống sục khí tự động, sau đó cắt lát, sấy tại lò của nhà máy ở nhiệt độ phù hợp, bông đạt chuẩn phải đạt độ giòn và dai trong từng sớ bông.\n\n- Bông atiso sấy khô 400gr được đóng gói rất đẹp mắt với 100% bông atiso nguyên chất không pha lẫn tạp chất tạo ra dòng sản phẩm với đầy đủ chất dinh dưỡng.\n\n2/ Hướng dẫn sử dụng:\n\n-Nấu nước: Lấy 15-20 gr cho vào 1,5-2lit nước, nấu khoảng 15-20 phút là được.\n\n-Nấu canh: Lấy khoảng 10gr-15gr rửa thật sạch cho vào hầm với xương, chân giò. Nếu bạn ăn chay có thể hầm chung với rau củ quả. Ăn rất thơm ngon và bổ dưỡng.\n\n-Nếu muốn uống ngọt thì có thể cho đường phèn vào. Nếu uống mát có thể thêm đá hoặc để trong ngăn mát tủ lạnh.\n\n-Nếu sử dụng thường xuyên trà atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',320000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,400),(514,'Trà Atiso Không Tem Bông',0,'2022-03-20 14:48:44','514A',0,39,0,'https://appdala.net/wp-content/uploads/TRA-ATISO-GOI-CAM-KHONG-TEM.jpg','','','1/ Nguồn Gốc\nAtiso là loại thực vật chứa rất nhiều hàm lượng chất cynarin giải độc gan mát gan, tất cả các bộ phận của atiso đều được tận dụng để chế biến các sản phẩm như trà túi lọc atiso, cao mềm atiso và cao nước atiso.\nTrà túi lọc atiso với các nguồn nguyên liệu chính từ bông, thân và rễ atiso, nguyên liệu sau khi được thu hoạch tại vùng nguyên liệu của công ty TNHH Trà Ngọc Duy sẽ được đưa về nhà máy sản xuất chế biến, theo tiêu chuẩn GMP trà atiso không tem bông với 60% , 20% thân, 20% rễ atiso. Trà atiso không tem bông với hương thơm đậm đà từ atiso, vị thanh từ bông atiso, vị ngọt từ thân và rễ atiso tạo nên dòng sản phẩm hài hòa cả về màu sắc lẫn hương vị.\n2/ Hướng dẫn sử dụng:\n- Mỗi ngày bạn nên sử dụng 1 đến 2 lần.\n- Mỗi lần dùng 1 đến 2 túi lọc nhúng vào ly nước nóng 200-300ml, chờ 5 phút rồi uống, cho thêm đường & đá tùy ý (nếu thêm đá thì bạn nên dùng 2 đến 3 túi lọc/lần)\n- Bạn có thể dùng 5-7 túi lọc pha trong ca lớn cho cả gia đình cùng sử dụng.\nNếu chưa dùng hết trong ngày bạn có thể rót vào chai để vào tủ lạnh dùng ngày hôm sau.\n- Không nên dùng quá nhiều( nhiều hơn 6 túi lọc/ngày).\n- Không nên uống trước khi ngủ.\n-Không nên uống khi đói\nNếu sử dụng thường xuyên trà atiso sẽ làm cho da mịn màng và trở nên tươi sáng hơn do nó có tác dụng làm mát gan, giải nhiệt, thải độc tố, giúp da ít bị mụn và khô ráp.',310000,NULL,NULL,NULL,0,0,17,1,1,0,1,'','','',NULL,NULL,NULL,500),(515,'Trà Atiso Đóng Thô Loại 3',0,'2022-03-20 14:49:57','515MM',0,39,0,'https://appdala.net/wp-content/uploads/TRA-ATISO-GOI-DO-KHONG-TEM.jpg','','','1/ Nguồn Gốc\nAtiso là loại thực vật chứa rất nhiều hàm lượng chất cynarin giải độc gan mát gan, tất cả các bộ phận của atiso đều được tận dụng để chế biến các sản phẩm như trà túi lọc atiso, cao mềm atiso và cao nước atiso.\nTrà túi lọc atiso với các nguồn nguyên liệu chính từ bông atiso, thân atiso và rễ atiso, nguyên liệu sau khi được thu hoạch tại vùng nguyên liệu của công ty TNHH Trà Ngọc Duy sẽ được đưa về nhà máy sản xuất chế biến, theo tiêu chuẩn GMP trà atiso không tem loại 3 với 50% thân atiso, 50% rễ atiso. Trà atiso không tem loại 3 với hương thơm đậm đà từ atiso, vị ngọt từ thân và rễ atiso tạo nên dòng sản phẩm hài hòa cả về màu sắc lẫn hương vị.\n2/ Hướng dẫn sử dụng:\n- Mỗi ngày bạn nên sử dụng 1 đến 2 lần.\n- Mỗi lần dùng 1 đến 2 túi lọc nhúng vào ly nước nóng 200-300ml, chờ 5 phút rồi uống, cho thêm đường & đá tùy ý (nếu thêm đá thì bạn nên dùng 2 đến 3 túi lọc/lần)\n- Bạn có thể dùng 5-7 túi lọc pha trong ca lớn cho cả gia đình cùng sử dụng.\nNếu chưa dùng hết trong ngày bạn có thể