://appdala.net/wp-content/uploads/10G-A-2.jpeg','','CHĂM SÓC SỨC KHỎE TOÀN DIỆN: SỨC KHỎE – SẮC ĐẸP – SINH LÝ\n————\nĐÔNG TRÙNG HẠ THẢO SẤY THĂNG HOA\n\nChọn Đan Ngọc – Trọn sức khỏe\n\nĐan Ngọc là Công ty sản xuất Đông trùng hạ thảo trên giá thể nhộng tằm hàng đầu tại Việt Nam. Chúng tôi sở hữu vườn trồng dâu tằm Organic theo tiêu chuẩn JAS với diện tích hơn 50,000 m2, để từ đó cho ra những lá dâu sạch làm thức ăn nuôi dưỡng nhộng tằm. \n\nVới nguồn nguyên liệu thượng hạng, kết hợp cùng quy trình sản xuất khép kín theo công nghệ Nhật Bản, Đan Ngọc tự hào đạt tiêu chuẩn quốc tế ISO 22000: 2018. \n\nĐông trùng hạ thảo Đan Ngọc có hàm lượng dược chất quý giá tương đương Đông trùng hạ thảo trong tự nhiên. Đây là món quà sức khỏe ý nghĩa cho bạn và những người thân yêu. \n\nĐông trùng hạ thảo sấy thăng hoa là sản phẩm chứa hàm lượng dược chất nhiều nhất trong tất cả các dòng sản phẩm của Đan Ngọc, đặc biệt thích hợp với người suy nhược cơ thể, có nhu cầu sử dụng ĐTHT để hỗ trợ điều trị ung thư, các loại bệnh và tăng cường sức khỏe. \n\nSản phẩm dùng công nghệ sấy thăng hoa -70 độ để giữ nguyên hương vị, hàm lượng dược chất, cấu trúc & hình dạng của ĐTHT tươi.\n\nCông dụng và lợi ích: \n\nĐông trùng hạ thảo được mệnh danh là kim dược trong y học cổ với:\n  \n  Cordycepin: Dược chất chỉ tìm thấy trong ĐTHT có tác dụng ức chế sự kết dính và phát triển của tế bào lỗi, nhờ đó ngăn ngừa ung thư.\n\n  Adenosine: Cùng với Cordycepin, là loại dược chất thứ 2 chỉ có trong ĐTHT, có tác dụng cung cấp năng lượng cho từng tế bào, nhờ đó làm trẻ hóa tế bào, chăm sóc sức khỏe toàn diện: Sức khỏe – Sắc đẹp – Sinh lý.\n\n  17 loại Axit amin khác nhau, D – mannitol, lipit, nhiều nguyên tố vi lượng (AI, Si, K, Na,..v.vv.)\n\n  Hoạt chất HEAA (Hydroxy – Etyl – Adenosin – Analogs) có tác dụng kháng khuẩn và kháng Virus cực mạnh.\n\n  Ngoài ra đông trùng hạ thảo còn chứa nhiều loại vitamin (B12, A, C, B2, E, K,…)\n\nHướng dẫn sử dụng ĐTHT sấy thăng hoa: \n  Lấy 1g ĐTHT sấy – tương đương với 3 – 4 con ĐTHT pha với 500ml nước sôi\n\n  Ngâm khoảng 5 – 7p cho đến khi nước chuyển sang màu vàng cam, đây là màu tự nhiên và đặc trưng của ĐTHT\n\n  ĐTHT uống tốt nhất vào buổi sáng và trước khi ăn, cơ thể sẽ hấp thu dược chất tốt nhất, lưu ý khi uống, bạn uống nước và ăn luôn cả con ĐTHT.\n\n  Uống liên tục ít nhất 10 ngày liên tiếp. Lưu ý đặc biệt chúng ta phải uống đủ ít nhất 10 ngày, mỗi ngày 1g để dược chất trong ĐTHT phát huy tác dụng đối với cơ thể. \n\nSau 10 ngày, bạn có thể tiếp tục duy trì uống ĐTHT hằng ngày để cải thiện sức khỏe và nuôi dưỡng cơ thể.Lưu ý khi sử dụng ĐTHT sấy thăng hoa: \n\n  Không sử dụng ĐTHT cùng với thuốc tây, uống cách thuốc tây ít nhất 1 tiếng\n\n  Đối với phụ nữ mang thai, không sử dụng ĐTHT vào 3 tháng đầu thai kỳ, từ tháng thứ 4 có thể sử dụng tốt cho cả mẹ và bé.\n\nĐTHT tốt cho cả nam và nữ, phù hợp với mọi độ tuổi sử dụng.\n\nĐan Ngọc cam kết: \n\nMỗi người 1 gam/ ngày, hiệu quả chỉ  sau 10 ngày sử dụng liên tục\nCam kết sau 3 tháng sử dụng liên tục đúng  theo hướng dẫn (1g/người/ngày), khách hàng sẽ giảm tiểu  đường và mỡ trong máu.\nSản phẩm khác của Đan Ngọc:\n\nĐAN NGỌC TRAO TAY – SỨC KHỎE TRÀN ĐẦY\n—————\n\nCông ty TNHH Đan Ngọc\n\nĐịa chỉ: 55 Lê Đại Hành, P. Lộc Phát, Bảo Lộc, Lâm Đồng.\n\nHotline: 1800585814\n\nWebsite: https://dongtrunghathaodanngoc.vn',1500000,NULL,NULL,NULL,0,0,18,1,1,0,1,'','','',NULL,NULL,NULL,10),(542,'Đông trùng hạ thảo sấy thăng hoa loại B – 10G',0,'2022-03-21 16:02:41','54286',0,38,0,'https://appdala.net/wp-content/uploads/B-10g.jpg','https://appdala.net/wp-content/uploads/10G-B.jpeg','','CHĂM SÓC SỨC KHỎE TOÀN DIỆN: SỨC KHỎE – SẮC ĐẸP – SINH LÝ\n————\nĐÔNG TRÙNG HẠ THẢO SẤY THĂNG HOA\nĐan Ngọc\nChọn Đan Ngọc – Trọn sức khỏe\nĐan Ngọc là Công ty sản xuất Đông trùng hạ thảo trên giá thể nhộng tằm hàng đầu tại Việt Nam. Chúng tôi sở hữu vườn trồng dâu tằm Organic theo tiêu chuẩn JAS với diện tích hơn 50,000 m2, để từ đó cho ra những lá dâu sạch làm thức ăn nuôi dưỡng nhộng tằm. \nVới nguồn ng