r\nHướng dẫn sử dụng: Dùng ăn ngay không qua chế biến. Đậy kín nắp sau mỗi lần sử dụng, nên bảo quản trong tủ mát.\nBảo quản: nơi khô ráo, thoáng mát, đảm bảo vệ sinh. Tránh ánh nắng trực tiếp\nSố XNCB: 14/DaLaVi/2021\nSố chứng nhận VSATTP: ĐGR86/2021/NNPTNT-LĐ',60000,NULL,NULL,NULL,0,0,21,1,1,0,1,'','','',NULL,NULL,NULL,500),(558,'Mứt dâu tằm loại 400gr',0,'2022-03-21 21:57:05','558OP',0,40,0,'https://appdala.net/wp-content/uploads/Mut-dau-tay.jpg','','','Mứt dâu tằm là sản phẩm chất lượng nữa mà DaLaVi muốn mang đến cho mọi người. Sản phẩm được chế biến tự nhiên từ những trái dâu tằm tươi ngon, không dùng chất bảo quản, phẩm màu, an toàn khi sử dụng.\n\nThành phần: dâu tằm tươi, đường cát. Mứt dâu tằm dạng sệt, rất dễ ăn!\nTrọng lượng thực: 400gr, được đóng hũ cao cấp\nGiá bán lẻ: 60.000đ/hũ. Mua số lượng lớn, vui lòng liên hệ trực tiếp\nSản phẩm sau khi mở nắp nên bảo quản lạnh để sử dụng được lâu hơn. Không NÊN để quá 30 ngày sau khi đã mở nắp\nLiên hệ: 0914.107.107 để được hỗ trợ thêm!',60000,NULL,NULL,NULL,0,0,21,1,1,0,1,'','','',NULL,NULL,NULL,400),(559,'Mứt Atiso đỏ (hibiscus)',0,'2022-03-21 21:58:09','559IH',0,40,0,'https://appdala.net/wp-content/uploads/mut-atiso-do-da-lat-4.jpg','','','Mứt Hibiscus hay còn gọi là mứt Hoa hồng, mứt Atiso đỏ được chế biến từ những đài quả tươi nên giữ được sự tươi ngon, thuần khiết cũng như các chất dinh dưỡng.\n\nQuy cách: 150gr, 500gr (hũ PET)\nThành phần: Atiso đỏ, đường\nHương vị: Vị chua thanh nhẹ tự nhiên của đài quả, vị giòn và vị ngọt dịu của đường\nHạn sử dụng: 12 tháng kể từ ngày sản xuất',55000,NULL,NULL,NULL,127,1,21,1,1,0,1,'','','',NULL,NULL,NULL,100),(560,'Dâu tây sấy dẻo loại 100gr',0,'2022-03-21 21:59:23','560R5',0,40,0,'https://appdala.net/wp-content/uploads/Dau-tay-say-1.jpg','','','Sản phẩm dâu tây sấy đà lạt rất phù hợp cho những vị khách ở xa đã trót “nghiền” món ăn ngon này, làm quà biếu mang đến sự khác lạ, hay mang hương vị quê hương đến với những người con và du khách nước ngoài.\n\nQuy cách: 100gr/hộp\nGiá bán lẻ: 50.000đ/\nSố công bố: 05/DaLaVi/2021\nSố GCN CSĐĐKATTP: ĐGR86/2021/NNPTNT-LĐ',50000,NULL,NULL,NULL,0,0,NULL,1,1,0,1,'','','',NULL,NULL,NULL,100),(561,'Dâu tằm sấy dẻo loại 100gr',0,'2022-03-21 22:00:24','5611N',0,40,0,'https://appdala.net/wp-content/uploads/dau-tam-say-deo.jpg','','','Ngoài việc là một thứ quả dân dã, ngon miệng thì quả dâu tằm có nhiều tác dụng đối với sức khỏe vì có chứa nhiều caroten, lượng vitamin C khá cao và axit hữu cơ… giúp tăng sức đề kháng cho cơ thể. Quả dâu tằm cũng chữa được bệnh táo bón và là thức uống giải nhiệt mùa hè rất tốt. Vị chua chua, ngọt ngọt của nước chế từ quả dâu xua tan bao nóng bức những trưa hè oi ả.\n\nQuy cách: 100gr/hộp\nGiá bán lẻ: 50.000đ\nSố GCN CSĐĐKATTP: ĐGR86/2021/NNPTNT-LĐ\nSố công bố: 06/DaLaVi/2021',50000,NULL,NULL,NULL,0,0,21,1,1,0,1,'','','',NULL,NULL,NULL,100),(562,'Chanh dây sấy dẻo loại 100gr',0,'2022-03-21 22:01:09','562OI',0,40,0,'https://appdala.net/wp-content/uploads/chanh-day-say.jpg','','','Chanh dây sấy có vị chua tự nhiên, độ ngọt vừa phải của đường được thêm vào tạo cảm giác dễ chịu, kích thích vị giác, từng chinh phục những vị khách khó tính nhất. Những ngày se lạnh, nhâm nhi miếng chanh dây sấy dẻo bên cạnh tách trà ấm đã trở thành thói quen của nhiều người. Đây cũng là món quà biếu được nhiều du khách lựa chọn, nhất là những ngày lễ-tết.\n\nQuy cách: 100gr/hộp\nGiá bán lẻ: 50.000đ',50000,NULL,NULL,NULL,0,0,21,1,1,0,1,'','','',NULL,NULL,NULL,100),(563,'Mãng cầu sấy dẻo loại 100gr',0,'2022-03-21 22:02:17','563IMD',0,40,0,'https://appdala.net/wp-content/uploads/mang-cau-say-deo.jpg','','','Để cho ra lò những miếng mãng cầu sấy dẻo thơm ngon cần chọn loại mãng cầu chua và có gai nở rộng, da căng bóng láng, cuống tươi và không quá chín, để tránh mãng cầu bị nát khi tiến hành sấy dẻo.\n\nĐóng hộp: trọng lượng thực 100 gr\nHạn sử dụng: 06 tháng\nThành phần: 100% quả mãng cầu xiêm tươi\nChỉ tiêu chất lượng chính: độ ẩm <20%\nSố GCN CSĐĐKATTP: ĐGR86/2021/NNPTNT-LĐ\nSử dụng: dùng ngay không qua chế biến\nBảo quản: để nơi khô ráo, thoáng mát tránh ánh nắng trực tiếp\nThông tin cảnh báo an toàn vệ sinh: không sử dụng khi sản phẩm đã hết hạn sử dụng, có mùi vị lạ.\n\nMãng cầu sấy dẻo được làm từ 100% mãng cầu xiêm tươi nguyên trái, sản phẩm được tách hạt, cô đặc thành miếng, không sử dụng hóa chất và phụ gia thực phẩm, an toàn cho sức khỏe người sử dụng.\n\n',50000,NULL,NULL,NULL,0,0,21,1,1,0,1,'','','',NULL,NULL,NULL,100),(564,'Sữa ong chúa tươi loại 30ml',0,'2022-03-21 22:03:22','5640A',0,40,0,'https://appdala.net/wp-content/uploads/Sua-Ong-Chua.jpg','','','Sữa ong chúa tươi nguyên chất DaLaVi là sản phẩm hoàn hảo dành cho sức khoẻ, sắc đẹp và hạnh phúc.\n\nThành phần: 100% sữa ong chúa nguyên chất, không phụ gia, không chất bảo quản\nBảo quản: nhiệt độ < 0 độ C\nHạn sử dụng: 18 tháng\nSố chứng nhận VSATTP: ĐGR86/2021/NNPTNT-LĐ\nSố CBCL: 19/DaLaVi/2021\nMời  quý vị xem đầy đủ sản phẩm Sữa Ong Chúa tại: https://suaongchua.com.vn',135000,NULL,NULL,NULL,0,0,21,1,1,0,1,'','','',NULL,NULL,NULL,30),(565,'Trà Bồ công anh loại 100 túi lọc',0,'2022-03-21 22:05:09','5652F',0,40,0,'https://appdala.net/wp-content/uploads/tra-bo-cong-anh-dalavi-2.jpg','','','Bồ công anh là một trong số ít loại cây thuộc hàng dược liệu quý hiếm bởi có rất nhiều tác dụng đối với sức khỏe con người. DaLaVi trân trọng mang đến các lựa chọn từ  cây Bồ công anh được trồng tại Đà Lạt, Lâm Đồng:\n\nTrà Bồ công anh túi lọc (100 túi lọc/hộp)\nRễ bồ công anh khô (100% từ Rễ tươi, sấy khô)\nCây bồ công anh khô (từ lá, thân, rễ)\nCây tươi Bồ công anh, trồng theo hướng hữu cơ\n\nThành phần: 100% từ cây Bồ Công Anh thấp và được trồng trên nền đất với phân hữu cơ ủ mục không sử dụng bất cứ loại chất bảo vệ thực vật nào\n\nSố GCN CSĐĐKATTP: ĐGR86/2021/NNPTNT-LĐ\n\nSố công bố: 17/DaLaVi/2021',280000,NULL,NULL,NULL,0,0,21,1,1,0,1,'','','',NULL,NULL,NULL,200),(566,'Cà phê nguyên chất loại 250gr',0,'2022-03-21 22:06:36','5669U',0,40,0,'https://appdala.net/wp-content/uploads/cafe-dalavi.jpg','','','Cà phê nguyên chất DaLaVi là kết tinh từ những hạt cà phê chất lượng cao, được hái chín 95-100% và theo quy trình chế biến ướt, sạch, mùi thơm quyến rũ cùng hương vị mạnh mẽ.\n\nThành phần: Robusta, Arabica\nTúi giấy 250gr có đóng van 1 chiều\nCà phê rang xay nguyên chất Đà Lạt, Lâm Đồng\nSản phẩm được chế biến từ những hạt cà phê thu hái và chọn lọc từ cao nguyên Đà Lạt, Lâm Đồng. Sự pha trộn giữa Robusta và Arabica mang đến Hương vị mạnh mẽ, ít chua và hương thơm quyến rũ.\nGiá 1kg cà phê bột bao nhiêu tiền?\n\nHiện nay, DaLaVi đang đóng gói 250g dành cho quý khách thưởng thức hàng ngày, quy cách đóng gói vừa phải giúp sản phẩm luôn được hương vị thơm ngon và tiện lợi trong sử dụng.\n\nĐối với hệ thống quán cafe, DaLaVi cung cấp theo đơn vị tính là KG để giảm thiểu chi phí đóng gói và vận chuyển. Chất lượng cà phê nguyên chất luôn được đảm bảo để phục vụ gu thưởng thức cà phê của quý vị trên mọi miền tổ quốc. Hãy liên hệ với số hotline: 02633.57.57.57 để biết giá 1kg cà phê nguyên chất hôm nay!',95000,NULL,NULL,NULL,0,0,21,1,1,0,1,'','','',NULL,NULL,NULL,250),(567,'Nước cốt dâu tây loại 350ml',0,'2022-03-21 22:08:49','56766',0,40,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-dau-tay-350ml.jpg','','','Hay còn gọi là “Nước ép dâu tây”, là sản phẩm mà chị em rất thích mỗi lần nhắc đến. Nước cốt dâu tây có rất nhiều tác dụng đối với sức khỏe con người.\n\nChai 350ml, giá bán lẻ: 40.000đ\nHướng dẫn sử dụng: pha một thể tích nước cốt với 3 đến 4 thể tích nước, tùy sở thích, ngon hơn khi dùng lạnh. Nên bảo quản lạnh và sử dụng trong vòng 10 ngày sau khi mở nắp!\nHạn sử dụng: 12 tháng kể từ ngày sản xuất\nSố GCN CSĐĐKATTP: ĐGR86/2021/NNPTNT-LĐ\nSố công bố: 12DaLaVi/2021',40000,NULL,NULL,NULL,0,0,21,1,1,0,1,'','','',NULL,NULL,NULL,350),(568,'Nước cốt dâu tằm loại 350ml',0,'2022-03-21 22:09:53','568ST',0,40,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-dau-tam-350ml.jpg','','','Hay còn gọi là “Nước ép dâu tằm”, là sản phẩm mà chị em rất thích mỗi lần nhắc đến