yên dùng Mật ong Đông Trùng Hạ Thảo Đan Ngọc với:\nNgười lớn tuổi hoặc trẻ mới mắc bệnh ( mắc bệnh về phổi, đường hô hấp, tiêu hóa, ăn không ngon).\nNgười có sức khỏe bình thường nên dùng mật ông Đông Trung Hạ Thảo để tăng cường sức khỏe.\nLiều lượng nên dùng:\n   1 muỗng cơm mật ong và 1 cọng Đông Trùng Hạ Thảo pha với 100ml nước ấm (<50 độ C)\n   Dùng đều mỗi buổi sáng, trước khi ăn sáng, tốt nhất ngay khi thức dậy\nCông Dụng:\n   Giúp bảo vệ chức năng tim và phổi\n   Tăng cường sức đề kháng tốt\n   Kích thích hệ tiêu hóa\n   Giúp ăn ngon miệng\nLưu ý:\n   Trẻ em dưới 12 tuổi chỉ sử dụng 01 lần/ tuần để tăng sức đề kháng hoặc khi đau ốm.\n   Phụ nữ mang thai dưới 3 tháng KHÔNG sử dụng Đông Trùng Hạ Thảo dù là mật ong Đông Trùng, không tốt cho thai nhi\n   Phụ nữ mang thai từ 4 tháng trở lên, có thể sử dụng mật ong Đông Trùng Hạ Thảo liệu lượng thấp 1 lần/ tuần.\n——————\nCông ty TNHH Đan Ngọc\nĐịa chỉ: 55 Lê Đại Hành, P. Lộc Phát, Bảo Lộc, Lâm Đồng.\nHotline: 1800585814\nWebsite: https://dongtrunghathaodanngoc.vn',750000,NULL,NULL,NULL,0,0,18,1,1,0,1,'','','',NULL,NULL,NULL,1000),(574,'Mật ong đông trùng hạ thảo - 200ml',0,'2022-03-22 10:25:12','574QZI',0,38,0,'https://appdala.net/wp-content/uploads/Hũ-mật-ong-200ml.jpg','','','Mật ong Đông Trùng Hạ Thảo là chế phẩm kết hợp giữa mật ong tự nhiên & Đông Trùng Hạ Thảo nguyên chất. \nSản phẩm được ngâm liên tục trong vòng 6 tháng trước khi đến tay người tiêu dùng để đảm bảo dược chất thấm đều mật ong. \nMật ong Đông Trùng Hạ Thảo là một sản phẩm phái đẹp ưa chuộng vừa chống lão hóa da vừa tốt cho hệ tiêu hóa. Khuyên dùng cho bé nhỏ để tăng sức đề kháng & khả năng hấp thụ dinh dưỡng.\nCách sử dụng:\nKhuyên dùng Mật ong Đông Trùng Hạ Thảo Đan Ngọc với:\n   Người lớn tuổi hoặc trẻ mới mắc bệnh ( mắc bệnh về phổi, đường hô hấp, tiêu hóa, ăn không ngon).\n   Người có sức khỏe bình thường nên dùng mật ông Đông Trung Hạ Thảo để tăng cường sức khỏe.\nLiều lượng nên dùng:\n   1 muỗng cơm mật ong và 1 cọng Đông Trùng Hạ Thảo