ite: https://berryland.vn/ \nXưởng sản xuất: 58 Lý Nam Đế, P.8, TP.Đà Lạt  (Hiện tại chỉ hoạt động vào giờ hành chính)\nCửa hàng Đặc sản TIỆM DÂU NHỎ: 40B Trương Công Định, P.1, TP.Đà Lạt (Hoạt động từ 8h - 21h tất cả các ngày)',55000,50000,NULL,NULL,0,1,2,1,1,0,1,'','','',NULL,NULL,NULL,100),(583,'draf',0,'2022-04-08 09:35:54','583H',0,34,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(584,'Xoài Sấy Ớt',0,'2022-04-08 13:51:20','5849',0,34,0,'https://appdala.net/wp-content/uploads/277253683_2567631553372642_6170263528197712914_n-1.jpg','https://appdala.net/wp-content/uploads/277854048_3101998890088102_8332986716346839796_n-1.jpg;https://appdala.net/wp-content/uploads/277849872_306891098217562_2005428455392513990_n.jpg;https://appdala.net/wp-content/uploads/277898692_1806522619738891_4447402706872607845_n.jpg','','Xoài cát sấy lạnh muối ớt không đường\nCông nghệ sấy lạnh giữ được hương vị,\nmàu sắc và vitamin có trong xoài \nXoài Cát sấy lạnh muối ớt\nHầu như ko có đường \nLạ miệng với XOÀI SẤY LẠNH\nXoài sấy dẻo ngọt thanh, chua nhẹ từ trong ra ngoài lại còn dẻo dẻo dai dai, ăn ngon hơn cả xoài chín.\nThêm chút muối và rắc thêm ít bột ớt nữa sẽ làm cho thêm phầm hấp dẫn.\nHương vị chua ngọt tự nhiên cũng như mùi thơm tự nhiên đặc trưng của trái xoài chín làm người ăn phải ghiền. Xoài sấy ko đường ! Sấy lạnh là cách sấy giữ nguyên dưỡng chất trong xoài!\nVà trên hết xoài là một thực phẩm rất tốt cho cơ thể khách nhen. Dù là trái cây sấy nhưng vẫn giữ được toàn bộ vitamin từ quả xoài chín nên rất tiện cho khách mua để dùng ăn dần nhé.\n Xoài sấy dẻo tự nhiên không quá khô, không thêm đường. Màu vàng tự nhiên và không có bất kỳ phẩm màu hoá chất bảo quản nào.\nXuất xứ: Lâm đồng, Việt Nam\nTrọng lượng: 300gr/ hộp \nNgày sản xuất: in trên bao bì sản phẩm\nHạn sử dụng: 6 tháng kể từ ngày sản xuất\n',100000,89000,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,300),(585,'Muối Ô Mai Đà Lạt',0,'2022-04-08 13:54:38','5859I',0,34,0,'https://appdala.net/wp-content/uploads/277902274_3195283697395323_2212740563084481615_n.jpg','https://appdala.net/wp-content/uploads/277850710_496763965253167_7188894272937621287_n.jpg;https://appdala.net/wp-content/uploads/277888685_1360632287786959_5963937945308704137_n.jpg;https://appdala.net/wp-content/uploads/277906542_923237375039528_3782629135020901780_n.jpg','','Muối Ô Mai Đà Lạt \nLà một loại muối chấm nổi tiếng, muối ô mai luôn khiến chị em phải tứa nước bọt mỗi khi nghĩ tới. Được làm từ muối, đường, ớt sấy, cốt ô mai, loại muối này có vị đặc trưng chua - cay - mặn - ngọt cùng hương vị của ô mai hấp dẫn đến khó cưỡng. \nMuối ô mai giòn, ngọt, thơm, hạt lại có kích thước lớn đem lại tiếng sột soạt mỗi lần thưởng thức tạo cảm giác kích thích khá thú vị. Mua muối ô mai chấm hoa quả đã trở thành sở thích của rất nhiều chị em. \nXuất xứ: Việt Nam\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',69000,49000,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,300),(586,'Khoai Tây Lắc Phô Mai',0,'2022-04-08 14:26:30','586DF',0,34,0,'https://appdala.net/wp-content/uploads/277826057_491249719150167_7686729909405331636_n.jpg','https://appdala.net/wp-content/uploads/277826762_997748987540169_1171692820424095244_n.jpg','','KHOAI TÂY LẮC BỘT PHÔ MAI - \nThơm lừng, giòn tan, vị phô mai cao cấp mặn mặn, béo béo, kết hợp với vị ngọt nhẹ của khoai tây, ngon ơi là ngon ạ.\nKhoai tây được ép dạng ống rồi sấy giòn rụm. Cuối cùng lắc với cực nhiều bột phô mai loại ngon. Mùi thơm của phô mai hòa quyện với vị ngọt, giòn tan của khoai tây chiên mang đến cảm giác lạ miệng hơn so với việc thưởng thức. \nXuất xứ : Lâm Đồng\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc 