ads/277884720_524004455960287_5447070829755858006_n.jpg','','Me Xí Muội Chua Cay\nKhối lượng :200gr \nHạn sử dụng: 6 tháng\nThành phần: Trái Me , Bột Ớt, Bột Nếp, Muối\nHướng dẫn bảo quản: Để nơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp, đảm bảo vệ sinh\nHướng dẫn sử dụng: Dùng ngay sau khi mở bao bì, đậy kín sau mỗi lần sử dụng\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi có hiện tượng mốc, mùi vị lạ\nXuất xứ : Lâm Đồng',65000,55000,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,200),(593,'Tinh Bột Nghệ Đỏ',0,'2022-04-08 14:54:03','593S9',0,34,0,'https://appdala.net/wp-content/uploads/277829200_869913094409147_378796571964216757_n-1.jpg','','','Tinh bột nghệ đỏ là thành phẩm từ củ nghệ tươi, sau khi trải qua quá trình tách lọc, loại bỏ tạp chất, thì đem xay nhuyễn thành bột. Sau đó nghệ được lắng đọng, chưng cất và tách tinh dầu nhiều lần thì sẽ thu được tinh bột nghệ nguyên chất, đảm bảo có chứa hàm lượng curcumin cao. Sau khi đem sấy khô, tinh bột nghệ đỏ sẽ có dạng cục, tiếp đến là nghiền mịn chúng nhiều lần để thu được tinh bột nghệ thật mịn và nhuyễn.\nNghệ đỏ là loại củ có màu vàng cam, tuy nhiên, khi tinh chế thành tinh bột nghệ nó sẽ có màu vàng đậm, bột cưc mịn không vón cục. mùi thơm của nghệ không nồng như nghệ tươi, có vị nghệ nhẹ.\n So với tinh bột nghệ vàng thì tinh bột nghệ đỏ có hàm lượng curcumin cao hơn gấp 4 lần. Cứ 1kg tinh bột nghệ đỏ phải cần đến 23-25kg nghệ đỏ tươi, trong khi đó 1kg tinh bột nghệ vàng chỉ cần 10-20kg nghệ vàng tươi. Chính vì thế, giá thành tinh bột nghệ đỏ thường cao hơn tinh bột nghệ vàng.\nxuất xứ : Lâm Đồng\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 6 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',100000,89000,NULL,NULL,0,0,13,1,1,1,1,'','','',NULL,NULL,NULL,200),(594,'Mật Ong Chanh Gừng',0,'2022-04-08 14:55:10','594H',0,34,0,'https://appdala.net/wp-content/uploads/277702517_316310297266403_2505016313654823515_n-1.jpg','','','Chanh, gừng và mật ong khi kết hợp lại với nhau sẽ tạo ra món uống thơm ngon và rất tốt cho sức khỏe.\nChanh, gừng, mật ong giúp tăng cường hệ miễn dịch cho cơ thể, đặc biệt là trong mùa dịch này.\nXuất xứ: Lâm Đồng\nNgày sản xuất: in trên bao bì \nHạn sử dụng: 24 tháng kể từ ngày sản xuất\nHướng dẫn bảo quản : để nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp.\nThông tin cảnh báo: không sử dụng sản phẩm khi có mùi lạ hoặc ẩm mốc',189000,169000,NULL,NULL,0,0,13,1,1,0,1,'','','',NULL,NULL,NULL,500),(596,'Xoài sấy dẻo nhúng socola',0,'2022-04-11 13:30:42','596A',0,35,0,'https://appdala.net/wp-content/uploads/x.jpeg','https://appdala.net/wp-content/uploads/x-1.jpeg;https://appdala.net/wp-content/uploads/x1.jpeg;https://appdala.net/wp-content/uploads/x3.jpeg','','Xoài sấy dẻo nhúng socola\nXoài sấy dẻo là một lựa chọn thay thế cho xoài tươi vô cùng tiện lợi, là món ăn vặt được các tín đồ ưa thích và phù hợp với đại đa số mọi lứa tuổi. \nXoài sấy dẻo chứa nhiều chất beta carotene (vitamin A), vốn là chất chống oxy hóa mạnh.  \nĂn xoài thường xuyên sẽ giúp da mềm mại và tươi sáng. \nXoài sấy dẻo cung cấp 24% lượng vitamin A cần thiết cho cơ thể mỗi ngày. Loại vitamin này giúp thúc đẩy thị lực, ngăn ngừa khô mắt và quáng gà.\nXoài là nguồn nguyên liệu giàu vitamin B1 loại vitamin có tác dụng tăng cường hệ miễn dịch cũng như giúp kiểm soát được chứng trầm cảm,\nĐường tự nhiên trong trái cây sấy giúp dễ tiêu hóa và hấp thụ dễ dàng vào cơ thể, giúp giảm đói nhanh chóng, tràn trề năng lượng phục vụ các hoạt động trong những lúc chán ăn.\n- Thành phần: Xoài sấy dẻo, Bột Cacao, đường, Hạt Điều, Dầu Hướng Dương, Bơ cacao, bột béo, bột sữa\n- Hướng dẫn sử dụng: Sản phẩm sử dụng ăn trực tiếp , dùng ngày sau khi mở bao bì\n- Quy cách đóng gói: Hộp gồm 2 ngăn\n- Xoài, Dâu, Chuối : 50gr\n- Mứt socola tự nhiên: 25gr\n- Hạn sử dụng: 1 năm\nHotline: 0931 78 4477\nWebsite: https://berryland.vn/ \nXưởng sản xuất: 58 Lý Nam Đ