: 100g/ hộp.\n    Trà oolong Hà Linh được trồng tại Cầu Đất ở độ cao 1.650 m so với mực nước biển, sương mù bao phủ, khí hậu quanh năm mát mẻ. Áp dụng quy trình công nghệ sạch từ khâu trồng, chăm sóc, thu hái, được chế biến bằng công nghệ và thiết bị hiện đại của Đài Loan.',170000,160000,NULL,NULL,0,0,22,1,1,0,1,'','','',NULL,NULL,NULL,100),(616,'Trà Oolong Hà Linh - Bát giác 5 sao, Hộp trọng lượng 250gr',0,'2022-11-28 10:12:13','616YR',0,43,0,'https://appdala.net/wp-content/uploads/bat-giac-5-sao-250g.jpg','https://appdala.net/wp-content/uploads/doitrahalinh-5.jpg','','     Trà Olong Hà Linh cao cấp 5* có hương vị tự nhiên, mùi thơm tinh khiết và vị ngọt hậu đặc sắc rất tốt cho sức khỏe.\n     Trà đựng trong túi chân không, hộp bát giác thích hợp làm quà tặng cho người thân, bạn bè, đồng nghiệp.\n     Cách dùng: \n     1. Tráng rửa dụng cụ pha trà bằng nước sôi.\n     2. Cho 10-15g trà vào bình dung tích khoảng 200ml rồi đổ nước sôi xâm xấp tráng trà và đổ hết nước ra.\n     3. Chế nước sôi vào bình đậy nắp hãm trà khoảng 1 phút thì rót trà ra tách thưởng thức. Hãm trà tuần tự  cho đến hương vị cuối cùng.\n     Lưu ý: Nước sạch đun sôi rồi giữ ở nhiệt độ 92oC – 96oC, dùng đồ gốm,đồ sành sứ để pha trà là thích hợp nhất. Không hãm trà lâu làm ảnh hưởng hưởng đến chất lượng trà. \n     Bảo quản: nơi khô ráo, thoáng mát.\n     Trọng lượng: 250g/ hộp\n     Trà oolong Hà Linh được trồng tại Cầu Đất ở độ cao 1.650 m so với mực nước biển, sương mù bao phủ, khí hậu quanh năm mát mẻ. Áp dụng quy trình công nghệ sạch từ khâu trồng, chăm sóc, thu hái, được chế biến bằng công nghệ và thiết bị hiện đại của Đài Loan.',370000,350000,NULL,NULL,0,0,22,1,1,0,1,'','','',NULL,NULL,NULL,250),(617,'Trà ô long thượng hạng bộ hộp lễ 3 sao trọng lượng 500gr',0,'2022-11-28 10:22:27','617TF',0,43,0,'https://appdala.net/wp-content/uploads/bo-hop-le-3-sao-500g.jpg','https://appdala.net/wp-content/uploads/doitrahalinh-6.jpg','','     Trà oolong hộp lễ 3 sao được đựng trong túi chân không.\n     