0 năm và sẽ tiếp bước duy trì hương vị đặc trưng của Actisô.\n\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',35000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,40),(652,'Trà Actiso túi lọc - Hộp 20 túi',0,'2022-11-29 14:43:52','652YK',0,42,0,'https://appdala.net/wp-content/uploads/tra-atiso-hop-20-tui-loc-4.jpg','','','Thành phần:\nTrong 01 túi lọc 2g có chứa:\n     Bột Actisô: 1,65g\n     Bột Cỏ ngọt: 0,31g\n     Cao đặc Actisô (tương đương 1,4g lá tươi Actisô) (tỷ lệ 1:35): 0,04g\nCông dụng:\n     Bảo vệ tế bào gan, tăng cường đào thải độc tố qua gan và kích thích tái tạo tế bào gan.\n     Hạ cholesterol máu, chống xơ vữa động mạch.\n     Giảm urê máu, Thông mật và lợi tiểu.\n     Cỏ ngọt khả năng làm giảm nhu cầu chất đường của cơ thể.\n     Hỗ trợ bảo vệ, tăng cường chức năng gan, giúp lợi mật, lợi tiểu, hạ cholesterol trong máu.\n     Sản phẩm gìn giữ vẹn nguyên hương vị truyền thống trong 40 năm và sẽ tiếp bước duy trì hương vị đặc trưng của Actisô.\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',35000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,40),(653,'Trà túi lọc Nhất Diệp Nguyên Hương - Hộp 20 túi lọc',0,'2022-11-29 16:09:16','653P',0,42,0,'https://appdala.net/wp-content/uploads/LADO-TEA-TRA-TUI-LOC-NHAT-DIEP-NGUYEN-HUONG-Hop-20-tui-loc-123-3.jpg','','','•Thành phần:\n     Trong 01 túi lọc 2g có chứa thảo mộc thô: 100% lá Actisô.\n•Cách Dùng:\n     Nhúng túi lọc vào 150 -200 ml nước sôi trong vòng 3 - 5 phút.\n     Trẻ em trên 6 tuổi và người lớn: Ngày uống 2 -3 lần, mỗi lần 1 túi lọc.\n     Dùng hàng ngày, ngon hơn khi dùng nóng.\n•Công dụng:\n     Bảo vệ tế bào gan, tăng cường đào thải độc tố qua gan và kích thích tái tạo tế bào gan\n     Hạ cholesterol máu, chống xơ vữa động mạch\n     Giảm urê máu, Thông mật và lợi tiểu:\n     Cỏ ngọt khả năng làm giảm nhu cầu chất đường của cơ thể.\n     Nhằm mục đích tăng tính tiện lợi như dòng trà Actisô truyền thống, vừa giữ được nét đặc trưng trong hương vị từ dòng trà Nhất Diệp Nguyên Hương, phù hợp với đối tượng khách hàng cao cấp nhưng bận rộn.\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',95000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,40),(654,'Trà Linh Chi+ - Hộp 20 túi lọc',0,'2022-11-29 16:11:37','6541',0,42,0,'https://appdala.net/wp-content/uploads/tra-linh-chi-hop-20-tui-loc-1.jpg','','','•Thành phần:\nTrong 01 túi lọc 1,7g có chứa:\n     Nấm Linh chi: 600mg\n     Đảng sâm: 150mg\n     Xuyên khung: 80mg\n     Cao đặc Actisô: 140mg\n     Cao Nấm linh chi: 60mg\n     Phụ liệu: Cỏ ngọt\n•Công dụng:\n     Nấm linh chi tác dụng tư bổ và làm mạnh sức, tăng cường hệ miễn dịch, được dùng trong điều trị suy nhược thấn kinh, chống mặt, mất ngủ, tăng huyết áp, tăng cholesterol trong máu, viêm dan, đau dạ dày, chán ăn.\n     Đảng sâm có tác dụng bồi bổ cơ thể, phục hồi sức khỏe, được dùng trong điều trị kém ăn, mệt mỏi, ốm lâu cơ thể suy nhược, thiếu máu vàng da.\n     Xuyên khung có tác dụng hoạt huyết, điều kinh, giảm đau, dùng trong điều trị nhức đầu, hoa mắt, cảm mạo, nhức mỏi.\n     Actisô có tác dụng bảo vệ tế bào gan, tăng cường đào thải độc tố qua gan và kích thích tái tạo tế bào gan\n     Với sự kết hợp của các thành phần giúp tăng cường hệ miễn dịch, tăng cường sức khỏe, sản phẩm phù hợp với đối tượng có sức đề kháng, sức khỏe kém, ngoài ra, actisô dùng chung với nấm linh chi cho tác dụng hiệu quả trên gan.\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar).',36000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,34),(655,'Trà Diệp Hạ Châu - Hộp 20 túi lọc',0,'2022-11-29 16:23:17','6553D',0,42,0,'https://appdala.net/wp-content/uploads/tRA-DIEP-HA-CHAU-Hop-20-tui-loc-1.jpg','','','•Thành phần:\nTrong 01 túi lọc 1,7g có chứa:\n     Bột thảo mộc Diệp hạ châu đắng: 1,1g\n     Bột thảo mộc Actisô: 0,45g\n     Bột Cỏ ngọt: 0,13g\n      Cao Diệp hạ châu đắng (tỷ lệ 1:10): 0,02g\n•Công dụng:\n     Actisô có tác dụng bảo vệ tế bào gan, tăng cường đào thải độc tố qua gan và kích thích tái tạo tế bào gan.\n     Diệp hạ châu có tác dụng điều trị viêm gan, vàng da, khó tiêu, tác dụng hạ men gan, bảo vệ gan.\n     Sự kết hợp giữa Actisô và Diệp hạ châu đắng đêm lại hiệu quả tác dụng trên các vấn đề về gan một cách tối ưu, hỗ trợ tăng cường chức năng gan mật, thanh lọc cơ thể và lợi tiểu.  \n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar).\n',35000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,34),(656,'Lado Boost Actiso (Lon)',0,'2022-11-29 16:26:28','6565',0,42,0,'https://appdala.net/wp-content/uploads/LADO-BOOST-ACTISO-LON-240ml-1.jpg','','','•Thành phần:\nTrong 240ml có chứa:\n     Cao đặc Actisô: 0,4g (tương đương 14g lá tươi Actisô) (tỷ lệ 1:35)\n     Phụ liệu: Cỏ ngọt, nước tinh khiết.\n•Công dụng:\n     Không như các dòng trà, cao truyền thống phải trải qua quá trình pha mới sử dụng được, đặc trưng của dòng sản phẩm đóng lon là tính tiện lợi, có thể sử dụng được ngay, vừa giúp giải khát vừa hỗ trợ tăng cường, bảo vệ sức khỏe.\n     Bảo vệ tế bào gan, tăng cường đào thải độc tố qua gan và kích thích tái tạo tế bào gan.\n     Hạ cholesterol máu, chống xơ vữa động mạch.\n     Giảm urê máu, Thông mật và lợi tiểu.\n     Dạng lon sang trọng, tiện dụng, đánh dấu hướng đi mới trong các sản phẩm từ Actiso. \n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',16000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,240),(657,'Lado Boost Up (Lon)',0,'2022-11-29 16:29:27','6579J',0,42,0,'https://appdala.net/wp-content/uploads/LADO-BOOST-UP-LON-1.jpg','','','•Thành phần:\nTrong 240ml có chứa:\n     Taurine: 1g\n     Cao đặc Actisô: 0,3g (tương đương 10,5g lá tươi Actisô)\n     Cao Hồng sâm (tỷ lệ 1:10): 0,16g\n     L- Theanin: 0,1g\n     Cafein: 0,05g\n     Phụ liệu: Cỏ ngọt, hương thực phẩm tổng hợp (Energy), nước tinh khiết.\n•Công dụng:\n     Taurine  giúp hỗ trợ giảm mệt mỏi, tăng hiệu suất tập thể dục. Cải thiện sức khỏe tim mạch nhờ khả năng giảm hình thành cholesterol trong máu.\n      Caffeine giúp giảm cảm giác mệt mỏi, buồn ngủ.\n     L-theanine là một loại axit amin giúp hạn chế tình trạng căng thẳng, lo lắng, mất ngủ.\n     Việc sử dụng Caffeine kết hợp với L-thenine  giúp phát huy tác dụng về tăng cường tập trung; đồng thời giảm nguy cơ của những triệu chứng phụ từ caffeine như tăng huyết áp hoặc cảm giác bồn chồn, lo âu.\n     Từ việc kết hợp các nguyên liệu trên, Dòng sản phẩm LADO BOOST UP hướng tới công dụng chính là hỗ trợ tăng cường sức khỏe, giảm mệt mỏi, kích thích khả năng vận động, tăng sự tập trung, tỉnh táo, ngoài ra còn giúp hỗ trợ cải thiện chức năng các cơ quan trong cơ thể.\n     Nước tăng lực có thành phần từ thiên nhiên, phối hợp với Actisô giúp thanh lọc cơ thể và tăng cường sức khỏe hiệu quả.\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar).',20000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,240),(658,'draf',0,'2022-11-29 16:33:28','658OL',0,42,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(659,'Lado Actiso Cao ống Actiso',0,'2022-11-29 16:33:40','659ZK',0,42,0,'https://appdala.net/wp-content/uploads/LADO-ACTISO-CAO-ONG-ACTISO-10ML-1.jpg','','','•Thành phần:\nTrong 01 ống 10ml có chứa:\n     Cao đặc Actisô (tỷ lệ 1:35): 0,2g (tương đương 7g lá tươi Actisô)\n     Phụ liệu: Cỏ ngọt, nước RO.\n•Công dụng:\n     Bảo vệ tế bào gan, tăng cường đào thải độc tố qua gan và kích thích tái tạo tế bào gan.\n     Hạ cholesterol máu, chống xơ vữa động mạch.\n     Giảm urê máu, Thông mật và lợi tiểu.\n     Cỏ ngọt khả năng làm giảm nhu cầu chất đường của cơ thể.\n     Hỗ trợ bảo vệ, tăng cường chức năng gan, giúp lợi mật, lợi tiểu, hạ cholesterol trong máu.\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar).',42000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,100),(660,'Lado care Kẹo COX - Túi zip 20 viên)',0,'2022-11-29 16:36:37','660B',0,42,0,'https://appdala.net/wp-content/uploads/LADO-CARE-KEO-COX-Tui-zip-20-vien-1.jpg','','','•Thành phần:\n     Menthol, Tinh dầu tần, Tinh dầu khuynh diệp, Tinh dầu gừng, Tinh dầu quế và phụ liệu.\n•Công dụ