chống oxy hóa\nThành phần:\nTrong 01 lọ 100g có chứa:\n     Cao đặc Actisô 100%\n(100g cao đặc Actisô tương đương 3500g lá tươi Actisô)\nCông dụng:\n     Giúp tăng cường sức khỏe, hỗ trợ bảo vệ gan.\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar).',195000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,100),(671,'Lado Tea Trà Thảo Mộc - Hộp 20 túi lọc',0,'2022-11-30 09:36:20','671P5',0,42,0,'https://appdala.net/wp-content/uploads/LADO-TEA-TRA-THAO-MOC-Hop-20-tui-loc.jpg','','','Đảng sâm hay còn gọi là Đẳng sâm, là một loại thảo dược được mệnh danh là “nhân sâm” có giá thành bình dân”. Theo các nghiên cứu khoa học,đảng sâm có chứa nhiều khoáng chất, vitamin tốt cho cơ thể con người và giúp điều trị nhiều bệnh lý. Đặc biệt là chất Saponin có lợi với hàm lượng cao không thua kém nhân sâm hay hồng sâm. Một số tác dụng của Đảng sâm: bồi bổ sức khỏe, tăng sức đề kháng, bảo vệ hệ tuần hoàn, hỗ trợ chức năng tiêu hóa, tốt cho hệ tim mạch, kháng viêm,..\nCây atiso có thể ngăn ngừa các bệnh tim mạch cũng như cung cấp vitamin cho cơ thể, tác dụng của atiso còn có thể kể đến như làm thuốc thông tiểu, thông mật, chữa các bệnh yếu gan, thận, viêm thận cấp tính và kinh niên, sưng khớp xương…, kích thích sự tiết dịch của gan và giúp giảm các triệu chứng sau khi say xỉn như ợ nóng, xây xẩm…, chống xơ vữa động mạch và chống tăng mỡ trong máu hoặc trị chứng khó tiêu.\nLá atiso vị đắng, có tác dụng lợi tiểu và được dùng trong điều trị bệnh phù và thấp khớp. \nHoa hay bông atiso có khả năng giảm lượng cholesterol trong máu, giúp tăng sự thèm ăn, hỗ trợ tiêu hóa và trị chứng khó tiêu ở dạ dày. Cụm hoa được dùng trong chế độ ăn kiêng của bệnh nhân đái tháo đường vì nó chỉ chứa lượng nhỏ tinh bột, còn phần lớn carbonhydate là inulin.\n\nTrong 01 túi lọc 2g có chứa:\n     - Đảng sâm: 450mg\n     - Actisô: 400mg\n     - Thảo Quyết minh: 250mg\n     - Cao đặc Actisô (tương đương 4,9g lá tươi Actisô) (tỷ lệ 1:35): 140mg\n     Phụ liệu: Cỏ ngọt\nCông dụng:\n     Giúp tăng cường sức khỏe, hỗ trợ tăng cường chức năng gan.\n     Hỗ trợ an thần, giúp ăn ngon miệng.\nNhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',49000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,40),(672,'Lado Actiso Premium Actiso',0,'2022-11-30 09:40:22','672J',0,42,0,'https://appdala.net/wp-content/uploads/LADO-ACTISO-PREMIUM-ACTISO.jpg','','','Thành phần:\nTrong 01 gói 15 ml có chứa:\n     - Đảng sâm: 2,2g\n     - Cao đặc Actisô (tỷ lệ 1:35): 0,2g (tương đương 7g lá tươi Actisô).\n     Phụ liệu: Cỏ ngọt, nước RO.\n\nCông dụng:\n     Hỗ trợ tăng cường sức khỏe, giúp bảo vệ gan.\n\nNhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',120000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,150),(673,'Lado Tea Trà Thảo Mộc - Túi 100 túi lọc',0,'2022-11-30 09:44:24','6739N',0,42,0,'https://appdala.net/wp-content/uploads/LADO-TEA-TRA-THAO-MOC-Tui-100-tui-loc.jpg','','','Trong 01 túi lọc 2g có chứa:\n     - Đảng sâm: 450mg\n     - Actisô: 400mg\n     - Thảo Quyết minh: 250mg\n     - Cao đặc Actisô (tương đương 4,9g lá tươi Actisô) (tỷ lệ 1:35): 140mg\n     Phụ liệu: Cỏ ngọt\n\nCông dụng:\n     Giúp tăng cường sức khỏe, hỗ trợ tăng cường chức năng gan.\n     Hỗ trợ an thần, giúp ăn ngon miệng.\n\nNhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',195000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,200),(674,'Lado Tea Trà Actiso - Túi 100 túi lọc',0,'2022-11-30 13:05:33','674B4',0,42,0,'https://appdala.net/wp-content/uploads/LADO-TEA-TRA-ACTISO-Tui-100-tui-loc.jpg','','','Atiso được biết đến là loại cao chứa nhiều thành phần dưỡng chất có tác dụng hỗ trợ và điều trị một số chứng bệnh ở người. Một số tác dụng của  Atiso như:\n- Điều trị mụn\n- Giải độc gan, chống say rượu\n- Thanh nhiệt cơ thể, không bị nóng trong người\n- Giấc ngủ ngon và sâu hơn\n- Giảm cholesterol trong máu cho những người béo phì\n- Giảm lượng đường máu\n- Hỗ trợ điều trị cao huyết áp\n- Tốt cho hệ tiêu hóa\n- Chứa nhiều chất chống oxy hóa\nThành phần:\nTrong 01 túi lọc 2g có chứa:\n     - Bột Actisô: 1,65g\n     - Bột Cỏ ngọt: 0,31g\n     - Cao đặc Actisô (tương đương 1,4g lá tươi Actisô) (tỷ lệ 1:35): 0,04g\nNhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',85000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,200),(675,'draf',0,'2022-11-30 13:16:32','6755D',0,42,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(676,'draf',0,'2022-12-01 10:51:12','676X5',0,42,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(677,'Lado Tea Trà Túi lọc Nhất Diệp Nguyên Hương - Túi 100 túi lọc',0,'2022-12-01 10:57:52','6778J',0,42,0,'https://appdala.net/wp-content/uploads/LADO-TEA-TRA-TUI-LOC-NHAT-DIEP-NGUYEN-HUONG-Tui-100-tui-loc-1.jpg','','','•Thành phần:\n     Trong 01 túi lọc 2g có chứa thảo mộc thô: 100% lá Actisô.\n•Tác dụng:\n     Bảo vệ tế bào gan, tăng cường đào thải độc tố qua gan và kích thích tái tạo tế bào gan.\n     Hạ cholesterol máu, chống xơ vữa động mạch.\n     Giảm urê máu, thông mật và lợi tiểu.\n     Nhằm mục đích tăng tính tiện lợi như dòng trà Actisô truyền thống, vừa giữ được nét đặc trưng trong hương vị từ dòng trà Nhất Diệp Nguyên Hương, phù hợp với đối tượng khách hàng cao cấp nhưng bận rộn.\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',295000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,200),(678,'Lado Tea Trà Diệp Hạ Châu - Túi 100 túi lọc',0,'2022-12-01 11:00:55','6783G',0,42,0,'https://appdala.net/wp-content/uploads/LADO-TEA-TRA-DIEP-HA-CHAU-Tui-100-tui-loc.jpg','','','•Thành phần:\nTrong 01 túi lọc 1,7g có chứa:\n     Bột thảo mộc Diệp hạ châu đắng: 1,1g\n     Bột thảo mộc Actisô: 0,45g\n     Bột Cỏ ngọt: 0,13g\n     Cao Diệp hạ châu đắng (tỷ lệ 1:10): 0,02g\n•Tác dụng:\n     - Actisô có tác dụng bảo vệ tế bào gan, tăng cường đào thải độc tố qua gan và kích thích tái tạo tế bào gan.\n     - Diệp hạ châu có tác dụng điều trị viêm gan, vàng da, khó tiêu, tác dụng hạ men gan, bảo vệ gan.\n     Sự kết hợp giữa Actisô và Diệp hạ châu đắng đêm lại hiệu quả tác dụng trên các vấn đề về gan một cách tối ưu, hỗ trợ tăng cường chức năng gan mật, thanh lọc cơ thể và lợi tiểu.  \n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar).',85000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,170),(679,'Lado Actiso Đảng sâm',0,'2022-12-01 11:11:35','679BK',0,42,0,'https://appdala.net/wp-content/uploads/LADO-ACTISO-DANG-SAM.jpg','','','Đảng sâm hay còn gọi là Đẳng sâm, là một loại thảo dược được mệnh danh là “nhân sâm” có giá thành bình dân”. Theo các nghiên cứu khoa học,đảng sâm có chứa nhiều khoáng chất, vitamin tốt cho cơ thể con người và giúp điều trị nhiều bệnh lý. Đặc biệt là chất Saponin có lợi với hàm lượng cao không thua kém nhân sâm hay hồng sâm. Một số tác dụng của Đảng sâm: bồi bổ sức khỏe, tăng sức đề kháng, bảo vệ hệ tuần hoàn, hỗ trợ chức năng tiêu hóa, tốt cho hệ tim mạch, kháng viêm,..\nHoàng kỳ là loài cây có nhiều tác dụng hay như chữa bệnh đau nhức xương khớp, viêm thận, viêm phế quản, ho, sa trực tràng, sa dạ dày, kém ăn, suy nhược cơ thể,… Đặc biệt khi kết hợp với các thảo dược khác sẽ trở thành các bài thuốc thần kỳ.\nCao Atiso được biết đến là loại cao chứa nhiều thành phần dưỡng chất có tác dụng hỗ trợ và điều trị một số chứng bệnh ở người. Một số tác dụng của Cao Atiso như:\n- Điều trị mụn\n- Giải độc gan, chống say rượu\n- Thanh nhiệt cơ thể, không bị nóng trong người\n- Giấc ngủ ngon và sâu hơn\n- Giảm cholesterol trong máu cho những người béo phì\n- Giảm lượng đường máu\n- Hỗ trợ điều trị cao huyết áp\n- Tốt cho hệ tiêu hóa\n- Chứa nhiều chất chống oxy hóa\n\nThành phần:\nTrong 01 gói 15ml có chứa:\n     - Đảng sâm: 2,2g\n     - Hoàng kỳ: 2g\n     - Cao đặc Actisô (tỷ lệ 1:35): 0,04g (tương đương 1,4g lá tươi Actisô)\n     Phụ liệu: Cao Long nhãn, nước RO.\n\nCông dụng:\n     Giúp bồi bổ cơ thể, tăng cường sức khỏe.\n\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar).',155000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,150),(680,'Lado Boost Up - Thùng 24 lon',0,'2022-12-01 11:15:18','680N5',0,42,0,'https://appdala.net/wp-content/uploads/LADO-BOOST-UP-Thung-24-lon.jpg','','','Một số tác dụng của Cao Atiso như:\n- Điều trị mụn.\n- Giải độc gan, chống say rượu.\n- Thanh nhiệt cơ thể, không bị nóng trong người.\n- Giấc ngủ ngon và sâu hơn.\n- Giảm cholesterol trong máu cho những người béo phì.\n- Giảm lượng đường máu.\n- Hỗ trợ điều trị cao huyết áp.\n- Tốt cho hệ tiêu hóa.\n- Chứa nhiều chất chống oxy hóa.\n\nMột số lợi ích của Taurine:\n- Có nhiều chức năng trong cơ thể;\n- Giúp chống lại bệnh tiểu đường.\n- Cải thiện sức khỏe tim mạch.\n- Tăng hiệu suất tập thể dục.\n- Lợi ích sức khỏe khác: có thể cải thiện nhiều chức năng khác nhau trong cơ thể của bạn, chẳng hạn như thị lực và thính giác, giúp điều chỉnh các cơn co thắt của cơ nên taurine có thể làm giảm các cơn co giật và giúp điều trị các tình trạng như có thể bảo vệ các tế bào gan chống lại các tổn thương gốc tự do và độc tố. \n\nMột số lợi ích của Cao hồng sâm:\n- Tăng cường sức khỏe, làm tăng hiệu suất lao động tư duy và thể lực, tăng khả năng miễn dịch, chống lại các bệnh truyền nhiễm như cảm ,ho,..\n- Chống lão hóa, cải thiện chức năng của não ở người lớn tuổi, tăng khả năng tập trung trí tuệ, tăng trí nhớ.\n- Giúp tăng cường hệ miễn dịch cho cơ thể để phòng chống được nhiều căn bệnh nguy hiểm như: ung thư, tim mạch, tiểu đường, huyết áp…\n- Chống lão hóa, cải thiện chức năng của não ở người lớn tuổi, tăng khả năng tập trung trí tuệ, tăng trí nhớ.\n- Kích thích hormon sinh dục nam cũng như nữ. Tăng cường và cải thiện yếu sinh lý ở nam giới.\n- Loại bỏ cholesterol xấu, ngăn ngừa sự hình thành xơ vữa động mạch.\n- Cao hồng sâm giúp ngăn ngừa sự phát triển của tế bào ung thư, có thể biến các tế bào ung thư thành các tế bào bình thương và làm chậm quá trình di căn của khối u. Hỗ trợ bệnh nhân ung thư trong quá trình hóa trị, xạ trị.\n\nThành phần:\nTrong 240ml có chứa:\n     - Taurine: 1g\n     - Cao đặc Actisô: 0,3g\n(tương đương 10,5g lá tươi Actisô)\n     - Cao Hồng sâm (tỷ lệ 1:10): 0,16g\n     - L- Theanin: 0,1g\n     - Cafein: 0,05g\n     Phụ liệu: Cỏ ngọt, hương thực phẩm tổng hợp (Energy), nước tinh khiết\nCông dụng:\n     Hỗ trợ tăng cường sức khỏe, giảm mệt mỏi.\nNhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar).',480000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,5760),(681,'Lado Boost Actiso - Thùng 24 lon',0,'2022-12-01 14:39:01','681O',0,42,0,'https://appdala.net/wp-content/uploads/LADO-BOOST-ACTISO-Thung-24-lon.jpg','','','Cao Atiso có màu đen tuyền bóng, dẻo như nhựa đường do quá trình chưng cất trong thời gian dài với nhiệt độ cao để giải phóng các chất dinh dưỡng. Phần nước lỏng sẽ được cô đặc theo phương pháp cô chân không tạo nên một chất lỏng dẻo, đặc, sếch màu đen.\nCao Atiso có vị đắng, giải nhiệt tốt bởi hàm lượng khoáng chất và vi lượng của nó. Cao Atiso được biết đến là loại cao chứa nhiều thành phần dưỡng chất có tác dụng hỗ trợ và điều trị một số chứng bệnh ở người. Một số tác dụng của Cao Atiso như:\n- Điều trị mụn.\n- Giải độc gan, chống say rượu.\n- Thanh nhiệt cơ thể, không bị nóng trong người.\n- Giấc ngủ ngon và sâu hơn.\n- Giảm cholesterol trong máu cho những người béo phì.\n- Giảm lượng đường máu.\n- Hỗ trợ điều trị cao huyết áp.\n- Tốt cho hệ tiêu hóa.\n- Chứa nhiều chất chống oxy hóa.\n\nThành phần:\nTrong 240ml có chứa:\n     - Cao đặc Actisô: 0,4g (tương đương 14g lá tươi Actisô) (tỷ lệ 1:35)\n     Phụ liệu: Cỏ ngọt, nước tinh khiết.\nCông dụng:\n     Hỗ trợ bảo vệ gan, lợi mật, lợi tiểu, hỗ trợ tăng cường chức năng gan.\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',384000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,240),(682,'Lado Tea Trà Nhất Diệp Nguyên Hương',0,'2022-12-01 14:43:37','682A',0,42,0,'https://appdala.net/wp-content/uploads/LADO-TEA-TRA-NHAT-DIEP-NGUYEN-HUONG.jpg','','','    Atiso từ xưa đã được nhiều người tin dùng vì không những thơm ngon mà còn rất tốt cho sức khỏe. Hoa atiso dễ tìm mua ở Việt Nam, được trồng chủ yếu ở các tỉnh thành như Đà Lạt, Sapa, Hà Giang, Sơn La, Tam Đảo. \nNhiều bộ phận của cây atiso có thể được sử dụng để làm thuốc hoặc để ăn như: Lá cây sau khi thu được phơi hoặc sấy khô; Rễ và thân cũng được dùng làm thuốc; Đế hoa và lá bắc dùng làm thức ăn.\nNgoài việc dùng đế hoa và lá bắc để ăn, loại hoa này có thể ngăn ngừa các bệnh tim mạch cũng như cung cấp vitamin cho cơ thể, tác dụng của atiso còn có thể kể đến như làm thuốc thông tiểu, thông mật, chữa các bệnh yếu gan, thận, viêm thận cấp tính và kinh niên, sưng khớp xương…, kích thích sự tiết dịch của gan và giúp giảm các triệu chứng sau khi say xỉn như ợ nóng, xây xẩm…, chống xơ vữa động mạch và chống tăng mỡ trong máu hoặc trị chứng khó tiêu.\nLá atiso vị đắng, có tác dụng lợi tiểu và được dùng trong điều trị bệnh phù và thấp khớp. \nHoa hay bông atiso có khả năng giảm lượng cholesterol trong máu, giúp tăng sự thèm ăn, hỗ trợ tiêu hóa và trị chứng khó tiêu ở dạ dày. Cụm hoa được dùng trong chế độ ăn kiêng của bệnh nhân đái tháo đường vì nó chỉ chứa lượng nhỏ tinh bột, còn phần lớn carbonhydate là inulin.\nCây atiso có thể được chế biến và dùng dưới nhiều dạng khác nhau như: Nước sắc; Cao mềm, cao lỏng hoặc cao khô; Viên bao; Trà atiso.\nNgày nay, atiso thường được sử dụng để chế biến thành các loại trà dạng túi lọc tiện lợi. Bạn chỉ cần ngâm túi trà trong nước nóng là có thể uống được ngay.\nNhiều người tự hỏi tác dụng của trà atiso là gì? Uống một ly trà atiso có thể giúp bạn thư giãn tinh thần và giải tỏa căng thẳng hiệu quả. Không những vậy, một số công dụng khác của trà atiso có thể kể đến như giảm cân, giảm lượng cholesterol và chất béo trung tính trong máu.\n\nThành phần:\n Trong 01 gói 5g có chứa thảo mộc thô:\n100% lá Actisô\n\nCÔNG DỤNG:\n     Hỗ trợ bảo vệ gan, giúp lợi mật, lợi tiểu, tăng cường chức năng gan.\n     Nhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',185000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,50),(683,'Kẹo dẻo Actiso Lado Kid ',0,'2022-12-01 14:49:26','683PE',0,42,0,'https://appdala.net/wp-content/uploads/LADO-KID-KEO-DEO-ACTISO.jpg','','','1-THÔNG TIN SẢN PHẨM KẸO DẺO ATISO-LADOPHAR \nTên sản phẩm: kẹo dẻo Atiso\nThương hiệu: Dược phẩm Lâm Đồng- Ladophar\nQuy cách: túi zip chứa 40g kẹo chia viên.\nHạn sử dụng: 12 tháng\n2-CÔNG DỤNG KẸO DẺO ATISO\nĐược sản xuất từ chiết xuất mật hoa Atiso giúp cơ thể bổ xung vitamin cần thiét.\nGiúp bé ăn ngon miệng, Ngủ ngon giấc, Ngoài ra Vitamin trong cao hoa Atiso giúp tăng cường sức đề kháng.\n3- CÁCH SỬ DỤNG KẸO DẺO ATISO\nKẹo mềm sử dụng trực tiếp.\nKẹo có vị chua nhẹ kích thích vị giác.\nKẹo làm không quá ngọt đảm bảo không bị ngán khi ăn.\n4-HƯỚNG DẪN BẢO QUẢN KẸO DẺO ATISO-LADOPHAR\nBảo quản nơi khô ráo thoáng mát tránh tiếp xúc trực tiếp với ánh nắng mặt trời vì sẽ dễ làm khô cứng hoặc chảy nhão kẹo.',14000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,20),(684,'Lado Actiso Cao Hồng Sâm H/100g',0,'2022-12-01 14:53:33','684RV',0,42,0,'https://appdala.net/wp-content/uploads/LADO-ACTISO-CAO-HONG-SAM-H-100G.jpg','','','Cao hồng sâm giúp tăng cường sức khỏe, làm tăng hiệu suất lao động tư duy và thể lực, tăng khả năng miễn dịch, chống lại các bệnh truyền nhiễm như cảm, ho,..\nChống lão hóa, cải thiện chức năng của não ở người lớn tuổi, tăng khả năng tập trung trí tuệ, tăng trí nhớ.\nGiúp tăng cường hệ miễn dịch cho cơ thể để phòng chống được nhiều căn bệnh nguy hiểm như: ung thư, tim mạch, tiểu đường, huyết áp…\n Kích thích hormon sinh dục nam cũng như nữ. Tăng cường và cải thiện yếu sinh lý ở nam giới.\nLoại bỏ cholesterol xấu, ngăn ngừa sự hình thành xơ vữa động mạch.\nCao hồng sâm giúp ngăn ngừa sự phát triển của tế bào ung thư, có thể biến các tế bào ung thư thành các tế bào bình thương và làm chậm quá trình di căn của khối u. Hỗ trợ bệnh nhân ung thư trong quá trình hóa trị, xạ trị.\nCao Atiso được biết đến là loại cao chứa nhiều thành phần dưỡng chất có tác dụng hỗ trợ và điều trị một số chứng bệnh ở người. Một số tác dụng của Cao Atiso như:\n- Điều trị mụn\n- Giải độc gan, chống say rượu\n- Thanh nhiệt cơ thể, không bị nóng trong người\n- Giấc ngủ ngon và sâu hơn\n- Giảm cholesterol trong máu cho những người béo phì\n- Giảm lượng đường máu\n- Hỗ trợ điều trị cao huyết áp\n- Tốt cho hệ tiêu hóa\n- Chứa nhiều chất chống oxy hóa\n\nThành phần:\nTrong 100g cao đặc có chứa:\n     - Cao đặc Actisô (tỷ lệ 1:35): 90%\n(tương đương 3150g lá tươi Actisô)\n     - Cao Hồng sâm (tỷ lệ 1:10): 10%\n(tương đương 100g Hồng sâm)\nCông dụng:\n     Giúp tăng cường sức khỏe, hỗ trợ bảo vệ gan.\nNhà sản xuất: Công ty CP Dược Lâm Đồng (Ladophar)',390000,NULL,NULL,NULL,0,0,3,1,1,0,1,'','','',NULL,NULL,NULL,100),(685,'draf',0,'2022-12-01 17:34:50','685EE',0,42,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(686,'draf',0,'2022-12-02 09:42:15','686EH',0,32,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(687,'draf',0,'2022-12-02 10:24:16','6874Y',0,32,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(688,'draf',0,'2022-12-02 10:26:09','688MQ',0,32,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(689,'Hạt Macca sấy lạnh - Hộp 250g',0,'2022-12-02 10:27:45','689SK',0,32,0,'https://appdala.net/wp-content/uploads/z3912201812727_da8cda88a6c014f803745fdbd758e207-1.jpg','https://appdala.net/wp-content/uploads/z3912205059425_e478e34145ac5deea737b6452976e5b7-1.jpg;https://appdala.net/wp-content/uploads/z3912208631418_674f9ded8146fe85f2dcb88131e52223-1.jpg;https://appdala.net/wp-content/uploads/z3912208738225_cb73ec243d0d788ed0bbc3566c284264-1.jpg;https://appdala.net/wp-content/uploads/z3912209037058_138747f98c9b70c278404bfcc166d838-1.jpg;https://appdala.net/wp-content/uploads/z3912208581174_4e800b1ff01fb1715fc22038d0d6cd89.jpg;https://appdala.net/wp-content/uploads/z3912205254163_98438d1c9b86fd2a660c7cf2c753c5a5-1.jpg','','     Hạt Macca được biết đến là một trong những loại hạt có nguồn dinh dưỡng cao nhất và có giá thành cao. Loại hạt này được người ta cho là Hoàng hậu của các loại hạt bởi giá trị mang lại của loại hạt này\n     Tác dụng của hạt macca có thể khiến ta bất ngờ vì đây là loại hạt có hàm lượng chất dinh dưỡng rất cao. Nó cung cấp một lượng lớn chất béo, vitamin, khoáng chất và các yếu tố vi lượng có lợi cho cơ thể, Cụ thể là các loại vitamin A, vitamin B, magie, photpho, sắt, protein, các axit béo không bão hòa, axit oleic, omega 3, omega 6, omega 9 và các chất chống oxy hóa. Bên cạnh đó, một vài chất khoáng quan trọng và cần thiết phải kể đến như 1mg sắt, 2mg đồng, 2g protein, 4g chất xơ, 53mg photpho, 37mg magie, 3mg vitamin B1, 1mg vitamin B6.\n     Các tác dụng của hạt macca: chống ung thư,giúp giảm cân, hỗ trợ chống oxy hóa, giúp tăng cường sức khỏe tim mạch, tốt cho não bộ, hỗ trợ cải thiện sức khỏe đường ruột,giúp tăng tuổi thọ.\n     Đối với mẹ bầu, nên thường xuyên sử dụng hạt macca vì nó mang lại rất nhiều tác dụng tốt như: Tăng cường lượng dưỡng chất cho mẹ và bé; Giúp làn da mẹ bầu trở nên sáng khỏe hơn; Cung cấp lượng Canxi trong suốt quá trình thai kỳ giúp xương mẹ và bé đều chắc khỏe, Hỗ trợ giảm cân sau khi sinh cho mẹ bầu, cải thiện hệ miễn dịch,..\n     Đối với trẻ em, hạt macca hỗ trợ rất tốt đến sự phát triển nhờ chứa nhiều thành phần dinh dưỡng, Giúp phát triển trí não cho bé; phát triển cấu trúc xương ở trẻ nhỏ; Xây dựng hệ miễn dịch vững chắc cho bé; Hỗ trợ và hoàn thiện hệ tiêu hóa cho trẻ nhỏ. Đồng thời, nó cũng có thể chế biến thành nhiều món ăn khác nhau rất phù hợp với khẩu vị của bé\n- Sản phẩm mở bằng tay.\n- Cam kết 100% chất lượng sản phẩm.\n- Mùi vị: Thơm, giòn, béo, hậu vị ngọt.\n- Size hạt từ 22 trở lên, tỉ lệ hạt chủ yếu là size 23-\n27.\n- Độ ẩm thành phẩm 0.6%. Tạo được độ giòn, kéo \ndài thời gian bảo quản.\n- Tỉ lệ nhân loại 1( hàm lượng chất béo cao) chiếm 99%.\n- Tỉ lệ hoàn nhân( tỉ lệ nhân trong hạt) cam kết 35- 42% trong khi tỉ lệ hoàn nhân thông thường của thị trường tầm 33%.\n- HSD: 01 năm',100000,NULL,NULL,NULL,0,0,23,1,1,0,1,'','','',NULL,NULL,NULL,250),(690,'Hạt macca rang hồng 