o - Hộp 91g',0,'2022-12-05 15:46:04','700JL',0,32,0,'https://appdala.net/wp-content/uploads/z3912209486881_30507f9f7200e402d8b21ca19f8ee0d3.jpg','https://appdala.net/wp-content/uploads/z3912199181992_928100f941ade149b48fdb7998f04d54-2.jpg;https://appdala.net/wp-content/uploads/z3912199119198_a94e49211bdec24ad4e61a97e9b19c57-5.jpg;https://appdala.net/wp-content/uploads/z3912201812727_da8cda88a6c014f803745fdbd758e207-2.jpg','','Trong những năm gần đây, các chị em hết sức ưa chuộng kẹo Nougout - hay còn được đặt cho những tên gọi rất dễ thương là kẹo tình yêu, kẹo hạnh phúc. Đây là món kẹo thường được làm từ sữa, lòng trắng trứng, kết hợp với các loại hạt và trái cây, có vị ngọt dịu bùi béo rất dễ ăn. Đặc biệt khi kết hợp với hạt macca - được mệnh danh hoàng hậu của các loại hạt, bạn vừa được thưởng thức kẹo ngon, lại vừa bổ sung rất nhiều chất tốt cho sức khỏe nhờ các tác dụng tuyệt vời của hạt macca.\nKẹo thơm ngon, giòn dẻo, ăn hoài không chán.',68000,55000,NULL,NULL,0,0,23,1,1,0,1,'','','',NULL,NULL,NULL,91),(701,'draf',0,'2022-12-05 18:05:14','7010H',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(702,'Nếp quýt Đạ Tẻh - Thơm ngon, dẻo mềm - Túi 3kg',0,'2022-12-07 15:10:52','702I3',0,17,0,'https://appdala.net/wp-content/uploads/z3936062181517_888f3c37a8b8c1e9ea5eeaac6684ffb3.jpg','https://appdala.net/wp-content/uploads/z3936062171328_b0ff826d5f85a73f481d8576019245da.jpg;https://appdala.net/wp-content/uploads/z3936062186763_b1234fceb71b0657963068e8b1b1c77b-1.jpg;https://appdala.net/wp-content/uploads/z3936062371328_d15eb86fe6e09ad928e835ee3d63bd79.jpg;https://appdala.net/wp-content/uploads/z3936062178992_529173229ece9becf714979b752e2150-1.jpg','','Nếp quýt Đạ Tẻh là quà tặng đặc sản có nguồn gốc từ người dân tộc Tày, Nùng ở Tây Bắc đưa về trồng tại Đạ Tẻh.\nGạo nếp Quýt Đạ Tẻh – đại sứ của cao nguyên có ưu điểm nổi trội so với nhiều loại nếp khác như: Vỏ mỏng, hạt bầu tròn, nẩy mập, trắng đục, hạt gạo không chỉ dẻo, sở hữu hương thơm mạnh mà nó còn mang trong mình vị ngọt đặc trưng nữa.\nBạn có thể dùng nếp Quýt Đạ Tẻh để đổ xôi mà cả ngày vẫn dẻo thơm đúng vị. Rượu gạo nếp Quýt cũng mang hương vị không lẫn vào đâu được. Đó cũng chính là lý do tại sao đặc sản này đã có mặt trong bao bữa cơm trên mọi miền quê cùng các phương trời.\nTrong những năm gần đây, thương hiệu nếp Quýt đã phủ sóng ra cả bên ngoài lãnh thổ Việt Nam và nhận được sự ưa chuộng của thị trường. Chỉ cần một lần sử dụng những sản phẩm được làm từ nếp Quýt thì chắc hẳn bạn sẽ không thể quên được hương vị đặc biệt này.\n',120000,NULL,NULL,NULL,0,0,16,1,1,0,1,'','','',NULL,NULL,NULL,3000),(703,'draf',0,'2022-12-07 15:20:02','703CZ',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(704,'Trà gừng hòa tan - Thơm ngon, vị gừng tự nhiên - Hũ 500g',0,'2022-12-07 15:26:53','7048',0,17,0,'https://appdala.net/wp-content/uploads/z3941047393969_7a32ab32bd5c38ce8bda0ec10ed08ac0.jpg','https://appdala.net/wp-content/uploads/z3935965026122_eff055e8bbbf0a8aa5d5dc86abf27ea7.jpg;https://appdala.net/wp-content/uploads/z3935965019047_d58a089b4679ad06ff4021a0980b33f4.jpg;https://appdala.net/wp-content/uploads/z3935965191551_ce5ff05f1f6e0df04f92828dc95ebc63-1.jpg;https://appdala.net/wp-content/uploads/z3941047371010_66003d75e1e3e73e896e79a0fb80a026.jpg;https://appdala.net/wp-content/uploads/z3941047469710_b9369087b4173eb2a3312b67012d065b.jpg;https://appdala.net/wp-content/uploads/z3941047518919_dec30cb809063b37bb8565b86d1c5456.jpg','','Tác dụng của gừng tươi đối với cuộc sống con người là điều mà ai cũng biết, gừng là gia vị không thể thiếu trong những bữa ăn của gia đình Việt, không chỉ vậy gừng còn mang lại nhiều công dụng hữu ích cho sức khỏe con người. \nTrong Đông Y Gừng có tính cay nóng, có tác dụng chống viêm hiệu quả, do đó gừng thường được dùng để chữa những chứng bệnh như là:\n- Chữa cảm lạnh;\n- Điều trị một số bệnh đường tiêu hóa;\n- Chống viêm;\n- Chống ung thư;\n- Chống say tàu xe, ốm nghén;\n- Giảm stress, đau đầu;\n- Hỗ trợ giảm đau lưng, đau vai;\n- Giảm cholesterol, phòng ngừa tiểu đường;\n- Hỗ trợ giảm cân,…\nMột số cách dùng gừng phổ biến: Trà gừng, Nước gừng mật ong, Kẹo gừng,… \nHiều được sự bận rộn và nhu cầu tiện lợi của khách hàng, trà gừng hòa tan ra đời nhằm thỏa mãn sự nhanh chóng, tiện ích nhưng vẫn đảm bảo hương vị thật của gừng, giúp khách hàng thưởng thức trọn vị ly trà gừng ấm nồng.\nCách dùng: \nPha 02 muỗng cà phê trà gừng hòa tan với 100ml nước sôi, có thể thêm chanh, mật ong theo ý thích.\nHạn sử dụng: 02 năm kể từ ngày sản xuất\nKhông sử dụng sản phẩm nếu thấy có biểu hiện lạ.\nBảo quản nơi khô ráo, thoáng mát.\nĐóng chặt nắp sau khi sử dụng.\n',170000,150000,NULL,NULL,0,1,15,1,1,0,1,'','','',NULL,NULL,NULL,500),(706,'draf',0,'2022-12-14 11:36:28','706JS',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(707,'draf',0,'2022-12-14 13:07:57','707PI',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(708,'draf',0,'2022-12-14 13:09:57','708G',0,31,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(712,'Set quà tết Berryland -  Bộ An',0,'2022-12-14 18:23:31','7129',0,35,0,'https://appdala.net/wp-content/uploads/BO-AN-370.jpg','https://appdala.net/wp-content/uploads/316945171_553844550085732_1907477655197744631_n.jpeg;https://appdala.net/wp-content/uploads/316671900_553844496752404_2981995804400637362_n.jpeg;https://appdala.net/wp-content/uploads/bbcfee1e6cfab5a4eceb.jpg','','COMBO 1: BỘ AN 370K\nBộ gồm 6 hũ trái cây sấy size nhỏ và 2 túi trà nhỏ\n- Trà hoa cúc 7g\n- Trà nụ hồng 7g\n- Xoài sấy muối ớt 90g\n- Khô heo cháy tỏi 65g\n- Mứt atiso đỏ 120g\n- Thơm sấy muối ớt 100g\n- Cam sấy dẻo 75g\n- Mãng cầu sấy muối ớt 100g\nVỊ \"CUNG ĐÌNH\" – TẾT VUI BÊN GIA ĐÌNH \nNhững gia đình truyền thống Đà Lạt đa phần đều có nguồn gốc ở Huế, di dân từ những năm 1930. Người Thừa Thiên Huế vào Đà Lạt mang theo cả phong tục và tập quán triều Nguyễn lúc bấy giờ. Bởi vậy, cái nét cung đình luôn phảng phất trong đời sống của họ. Đi nhẹ, nói khẽ, cười duyên, làm gì cũng phải ngó trước nhìn sau, miếng nhỏ miếng to đều nên bày ra đĩa … Đặc biệt, các chị, các mẹ, những người phụ nữ trong mỗi gia đình ấy ai ai cũng biết làm mứt. Có lẽ vì vậy mà trong căn Gác – Măng – Giê của mỗi gia đình lúc nào cũng có dăm ba hũ mứt nhỏ xinh. \nNếu ở miền Bắc, “Miếng trầu là đầu câu chuyện”, thì tại Đà Lạt, chúng tôi thường chào đón vị khách bằng một khay trà mứt nho nhỏ. \nVị ấm nồng của trà hòa quyện cùng sự ngọt thanh, chua chua của mứt mang đến cảm giác thoải mái, nhẹ nhàng khiến người với người cởi mở, gần gũi nhau hơn.\nXuất phát từ nét văn hóa đó, Berryland cho ra đời Bộ Quà tết 2023 mang tên “VỊ CUNG ĐÌNH”\nNhấm nháp một ngụm trà, nhâm nhi một miếng mứt để cảm nhận sự thanh lịch và lối sống thanh nhàn tồn tại qua hàng thế kỷ của xứ sở sương mù mang tên Đà Lạt. \nTết này, Quý khách hàng hãy cùng BerryLand trải nghiệm một nét Xuân đậm chất CUNG ĐÌNH nhé!\n--------------------------------------\nHotline: 0931 78 4477\nWebsite: https://berryland.vn/ \nXưởng sản xuất: 58 Lý Nam Đế, P.8, TP.Đà Lạt  (Hiện tại chỉ hoạt động vào giờ hành chính)\nCửa hàng Đặc sản TIỆM DÂU NHỎ: 40B Trương Công Định, P.1, TP.Đà Lạt (Hoạt động từ 8h - 21h tất cả các ngày)',450000,370000,NULL,NULL,43,1,2,1,1,0,1,'','','',NULL,NULL,NULL,2000),(714,'Set quà tết Berryland- Bộ Hỷ',0,'2022-12-14 19:08:04','714X9',0,35,0,'https://appdala.net/wp-content/uploads/BO-HY-450.jpg','https://appdala.net/wp-content/uploads/abd54585ec0a35546c1b9.jpg;https://appdala.net/wp-content/uploads/8eefddbe7431ad6ff42012.jpg','','BỘ HỶ 450K\nBộ gồm: 4 hũ trái cây sấy size lớn, 2 hũ trái cây sấy size nhỏ, 2 túi trà \n- Trà hoa cúc 7g\n- Trà nụ hồng 7g\n- Xoài sấy muối ớt 90g\n- Kẹo dẻo phủ chocolate 150g\n- Mứt atiso đỏ 150g\n- Vỏ bưởi sấy dẻo 90g\n- Cam sấy dẻo 100g\n- Dâu tây sấy dẻo 155g\n\nVỊ \"CUNG ĐÌNH\" – TẾT VUI BÊN GIA ĐÌNH \nNhững gia đình truyền thống Đà Lạt đa phần đều có nguồn gốc ở Huế, di dân t