ày. Uống một ly chanh dây mỗi ngày kết hợp với chế độ luyện tập hợp lý sẽ khiến bạn nhanh chóng lấy lại vóc dáng.\nXuất xứ: Đà Lạt\nHạn sử dụng: 24 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Dùng trực tiếp hoặc dùng trong làm bánh , pha chế nước uống , .... \n',59000,50000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,310),(723,'Mứt Dâu Tằm Lafresh Đà Lạt - Hủ Thủy Tinh 210gr',0,'2022-12-28 15:22:00','723W',0,44,0,'https://appdala.net/wp-content/uploads/Mut-210gr-6.jpg','','','MỨT DÂU TẮM LAFRESH ĐÀ LẠT 210Gr \nDâu tằm được biết đến là một loại trái cây thơm ngon và mang đến cho con người nhiều công dụng tuyệt vời như: bổ sung chất xơ, tốt cho hệ tiêu hoá, tăng cường sức khoẻ tim mạch, tăng sức đề kháng, hỗ trợ đường huyết,...\nXuất xứ: Đà Lạt\nHạn sử dụng: 24 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Dùng trực tiếp hoặc dùng trong làm bánh , pha chế nước uống , .... \n\n',59000,50000,NULL,NULL,127,1,24,1,1,0,1,'','','MỨT DÂU TẮM LAFRESH ĐÀ LẠT 210Gr \nDâu tằm được biết đến là một loại trái cây thơm ngon và mang đến cho con người nhiều công dụng tuyệt vời như: bổ sung chất xơ, tốt cho hệ tiêu hoá, tăng cường sức khoẻ tim mạch, tăng sức đề kháng, hỗ trợ đường huyết,...\nXuất xứ: Đà Lạt\n\nHạn sử dụng: 24 tháng\n\n*** BẢO QUẢN ***\n\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n\n*** CÁCH SỬ DỤNG***\n- Dùng trực tiếp hoặc dùng trong làm bánh , pha chế nước uống , .... \n* Cần mua sỉ vui lòng liên hệ 0931.045.821 (Hotline/SMS/Zalo)\n',NULL,NULL,NULL,350),(724,'Mứt Phúc Bồn Tử Lafresh Đà Lạt - Hủ Thủy Tinh 210gr',0,'2022-12-28 15:26:59','724Y',0,44,0,'https://appdala.net/wp-content/uploads/Mut-210gr-8.jpg','','','MỨT PHÚC BỔN TỬ LAFRESH ĐÀ LẠT 210GR\nPhúc bồn tử được xếp hàng thượng phẩm trong biểu đồ đánh giá thực phẩm. Những hoạt chất quý có trong phúc bồn tử mang lại giá trị vượt trội cho sức khỏe.\nXuất xứ: Đà Lạt\nHạn sử dụng: 24 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Dùng trực tiếp hoặc dùng trong làm bánh , pha chế nước uống , .... \n',79000,71000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,350),(725,'Mứt Thơm Lafresh Đà Lạt - Hủ Thủy Tinh 210gr',0,'2022-12-28 15:29:49','725P',0,44,0,'https://appdala.net/wp-content/uploads/Mut-210gr-9.jpg','','','MỨT THƠM LAFRESH ĐÀ LẠT 210GR\nXuất xứ: Đà Lạt\nHạn sử dụng: 24 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Dùng trực tiếp hoặc dùng trong làm bánh , pha chế nước uống , .... \n',59000,50000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,350),(726,'Bộ Mứt Tứ Quý LAFRESH ĐÀ LẠT Combo 4 hủ mứt 4 hương vị',0,'2022-12-28 15:31:33','7269F',0,44,0,'https://appdala.net/wp-content/uploads/Mut-210gr-10.jpg','','','BỘ MỨT TỨ QUÝ LAFRESH ĐÀ LẠT \nBao Gồm : Mứt dâu tây, Mứt phúc bồn tử, Mứt Chanh dây, Mứt Dâu tằm\nPhù hợp : Dùng cho gia đình, quà tặng, biếu tặng đồng nghiệp....\nTrọng lượng : 120gr ( Mỗi hủ 30gr )\n----------------------------\nXuất xứ: Đà Lạt\nHạn sử dụng: 24 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Dùng trực tiếp hoặc dùng trong làm bánh , pha chế nước uống , .... \n',65000,55000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,350),(727,'Nước Cốt Cam Lafresh Đà Lạt - Chai 650ml',0,'2022-12-28 15:37:04','727DO',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-1.jpg','','','NƯỚC CỐT CAM LAFRESH ĐÀ LẠT 650ML \nCam là loại quả giàu các chất dinh dưỡng như: vitamin C, chất xơ, folate, chất chống oxy hóa nhưng rất ít calo và đường. Những lý do sau đây sẽ khuyến khích bạn nên ăn loại quả kỳ diệu này hàng ngày để bồi bổ cơ thể.\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',99000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(728,'Nước Cốt Thơm Lafresh Đà Lạt - Chai 650ml',0,'2022-12-28 15:48:02','728UC',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-3.jpg','','','NƯỚC CỐT THƠM LAFRESH ĐÀ LẠT 650ML \nNước cốt thơm Lafresh được làm từ những trái thơm (trái dứa) tươi ngon, được chọn lựa kĩ càng. Thơm chứa hàm lượng các loại vitamin, chất xơ và các axit amin cao nên rất tốt cho sức khỏe. Nước cốt thơm có vị hấp dẫn riêng biệt, có thể dùng làm bánh hoặc ăn kèm với bánh mì, kem, pha chế nước uống…\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',99000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(729,'Nước ép Dâu Tây cô đặc LAFRESH - Chai 650ml',0,'2022-12-28 15:51:03','729KF',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-4.jpg','','','NƯỚC ÉP DÂU TÂY CÔ ĐẶC LAFRESH CHAI 650ML\nDâu tây là nguồn cung cấp vitamin C tuyệt vời. Một chén dâu tây chứa 51,5mg vitamin C, khoảng ½ nhu cầu hàng ngày của cơ thể. Như vậy, chỉ với hai chén dâu tây, bạn đã có đủ 100% lượng vitamin C theo yêu cầu. Vitamin C là chất có khả năng tăng cường miễn dịch đồng thời còn là một chất chống oxy hóa mạnh mẽ. Một cuộc nghiên cứu của trường ĐH California, Los Angeles, Mỹ ,vào năm 2010 đã phát hiện ra rằng, khả năng chống oxy hóa trong dâu tây sẽ trở nên khả dụng về mặt sinh học và sẵn sàng hoạt động trong máu sau khi ăn loại trái cây chỉ trong vài tuần lễ.\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n\n',99000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(730,' Nước Cốt Đào Lafresh Đà Lạt -  Chai 650ml',0,'2022-12-28 15:52:08','730CP',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-6.jpg','','','NƯỚC CỐT ĐÀO LAFRESH ĐÀ LẠT 650ML\nĐào là thứ trái cây tuyệt vời thuộc họ quả hạch chứa rất nhiều chất dinh dưỡng. Chúng có thành phần chống lão hóa, tăng khả năng miễn dịch và giúp loại bỏ chất độc ra khỏi cơ thể.\nXuất xứ: Đà Lạt\nHạn sử dụng: 12 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Đá xay : 60ml sinh tố Lafresh + 25ml sữa đặc + 10ml sữa tươi + 5ml cốt chanh tươi + 1 ly đá. Cho tất cả hỗn hợp vào máy xay xay nhuyễn.\n- Trà trái cây : 40ml sinh tố Lafresh + 80ml cốt trà + 10ml mật ong + 1 ly đá. Cho tất cả hỗn hợp lắc đều.\n- Soda trái cây : 30ml sinh tố Lafresh + 1 trái tắc + 3 lá húng lũi + 20ml nước đường + 80ml Soda. Dằm 3 lá húng, tắc và nước đường đều xong cho tất cả nguyên liệu còn lại vào ly.\n- Có thể dùng sinh tố Lafresh kết hợp với các nguyên liệu pha chế để tạo ra thức uống theo khẩu vị riêng của bạn.\n',99000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(731,'Nước cốt dâu tằm Lafresh Đà Lạt 650ml',0,'2022-12-28 15:54:04','731G5',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-7.jpg','','','NƯỚC CỐT DẦU TẰM LAFRESH ĐÀ LẠT 650ML \nQuả dâu tằm là một món quà tốt lành cho dạ dày nhờ vào lượng chất xơ phong phú. Cơ thể cần chất xơ để tạo điều kiện cho quá trình tiêu hóa diễn ra thuận lợi và khuyến khích thức ăn di chuyển qua đường tiêu hóa trơn tru hơn. Từ đó làm giảm táo bón, đầy hơi hoặc đau bụng.\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n\n',99000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(732,'Nước Cốt Mãng Cầu Xiêm Lafresh Đà Lạt chai 650ml',0,'2022-12-28 15:55:22','732HM',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-8.jpg','','','NƯỚC CỐT MÃNG CẦU XIÊM LAFRESH ĐÀ LẠT 650ML \nMãng cầu xiêm rất giàu carbohydrate, đặc biệt là fructose. Nó rất giàu nhiều loại vitamin: C, B1, B6… Lá, hạt và trái của chúng được sử dụng trong y học có tác dụng tích cực tới bệnh tiểu đường, thấp khớp,….. \n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n\n',99000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(733,'Nước Cốt Táo Lafresh Đà Lạt Chai 650ml',0,'2022-12-28 15:56:21','733JE',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-9.jpg','','','NƯỚC CỐT TÁO LAFRESH ĐÀ LẠT 650ML \nTáo là loại trái cây có hương vị rất thơm ngon, được nhiều người yêu thích. Loại trái cây này rất tốt cho người cao tuổi bởi những lợi ích sức khỏe nó mang lại như hỗ trợ phòng chống các bệnh về tim mạch, tăng cường trí nhớ, giảm nguy cơ tiểu đường, phòng chống ung thư….\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',100000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(734,'Nước cốt phúc bồn tử Lafresh Đà Lạt 650ml',0,'2022-12-28 16:00:11','734B',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-10.jpg','','','NƯỚC CỐT PHÚC BỒN TỬ LAFRESH ĐÀ LẠT 650ML \nPHÚC BỒN TỬ( Quả Mâm Xôi) -  Trái Cây Kỳ Diệu\nPhúc bồn tử được xếp hàng thượng phẩm trong biểu đồ đánh giá thực phẩm. Những hoạt chất quý có trong phúc bồn tử mang lại giá trị vượt trội cho sức khỏe \n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',150000,132000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(735,'Nước ép Chanh Dây cô đặc LAFRESH chai 650ml',0,'2022-12-28 16:01:35','735V9',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-11.jpg','','','NƯỚC ÉP CHANH DÂY CÔ ĐẶC LAFRESH CHAI 650ML\nNgười ta đã chứng minh trong chanh dây có đầy đủ nguồn vitamin A và C, sắt, kali và các thành phần dinh dưỡng khác cũng như các hoạt chất sinh học có lợi cho sức khoẻ. Hạt chanh dây là một nguồn chất xơ tuyệt vời, chính chất cơm nhầy bao quanh hạt làm cho chanh dây có mùi thơm đặc biệt.\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',95000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(736,'Nước Cốt Chanh Vắt Không Đường, Nguyên chất 100% LAFRESH, chai 500ml',0,'2022-12-28 16:02:45','736UM',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-12.jpg','','','NƯƠC CỐT CHANH VẮT KHÔNG ĐƯỜNG \nNước cốt chanh LAFRESH được ép từ những quả chanh tươi nguyên chất 100%, Nước Cốt Chanh LAFRESH là sản phẩm tiện lợi để chế biến thức uống và món ăn cho quán cà phê, nhà hàng, quán bar,…\nTrong trái chanh cung cấp rất nhiều vitamin C, chất xơ và các hợp chất thực vật có lợi khác nhau. Những chất dinh dưỡng này đem lại một số lợi ích cho sức khỏe.\n15ml tương đương 1 quả chanh tươi.\nCông thức cho 1 ly đá chanh:  15ml cốt chanh Lafresh + 40ml nước đường (hoặc 6-7 muỗng cà phê đường) + 100ml nước lọc.\nKhuấy đều hỗn hợp rồi bỏ đá đầy ly.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',70000,55000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,700),(737,'Nước cốt chanh vắt không đường, Nguyên chất 100% LAFRESH, chai 650ml',0,'2022-12-28 16:04:32','737QA',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml-13.jpg','','','NƯƠC CỐT CHANH VẮT KHÔNG ĐƯỜNG \nNước cốt chanh LAFRESH được ép từ những quả chanh tươi nguyên chất 100%, Nước Cốt Chanh LAFRESH là sản phẩm tiện lợi để chế biến thức uống và món ăn cho quán cà phê, nhà hàng, quán bar,…\nTrong trái chanh cung cấp rất nhiều vitamin C, chất xơ và các hợp chất thực vật có lợi khác nhau. Những chất dinh dưỡng này đem lại một số lợi ích cho sức khỏe.\n15ml tương đương 1 quả chanh tươi.\nCông thức cho 1 ly đá chanh:  15ml cốt chanh Lafresh + 40ml nước đường (hoặc 6-7 muỗng cà phê đường) + 100ml nước lọc.\nKhuấy đều hỗn hợp rồi bỏ đá đầy ly.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',49000,40000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(738,'Nước Cốt Ổi Lafresh Đà Lạt Chai 650ml - Chuyên dùng pha chế',0,'2022-12-28 16:06:06','738YU',0,44,0,'https://appdala.net/wp-content/uploads/nuoc-cot-oi-chai-650ml-uHc8bO.jpg','','','NƯỚC CỐT ỔI LAFRESH ĐÀ LẠT 650ML\nỔi là một loại trái cây giàu vitamin C (thậm chí còn giàu hơn cả cam), nó có hàm lượng vitamin C cao gấp hai lần so với nhu cầu sinh học. Ăn nhiều ổi có thể cải thiện hệ thống miễn dịch giúp cơ thể tránh xa các mầm bệnh và nhiễm trùng.\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',95000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(739,'NƯỚC CỐT XOÀI LAFRESH ĐÀ LẠT - CHAI 650ML ',0,'2022-12-28 16:13:04','739PM',0,44,0,'https://appdala.net/wp-content/uploads/nuoc-cot-xoai-chai-650ml-HQGgfm.jpg','','','NƯỚC CỐT XOÀI LAFRESH ĐÀ LẠT 650ML \n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',90000,82000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(740,'Nước ép Tầm Bóp cô đặc LAFRESH chai 650ml',0,'2022-12-29 08:24:36','740C9',0,44,0,'https://appdala.net/wp-content/uploads/Nuoc-cot-650ml.jpg','','','NƯỚC ÉP TẦM BÓP CÔ ĐẶC CHAI 650ML \n Tầm bóp để ăn vì quả có vị chua chua thanh mát, quả tầm bóp được biết đến là nhờ tác dụng làm mát gan, giải độc và thanh lọc cơ thể. Không chỉ đơn giản nước uống, sử dụng tầm bóp còn có thể mang lại nhiều lợi ích cho sức khỏe.\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',149000,132000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(741,'Sinh Tố Mãng Cầu Lafresh Đà Lạt - Chai Thủy Tinh 350ml',0,'2022-12-29 08:44:16','7412',0,44,0,'https://appdala.net/wp-content/uploads/sinh-to-350ml.jpg','','','SINH TỐ MÃNG CẦU LAFRESH ĐÀ LẠT 350ML \nMãng cầu xiêm rất giàu carbohydrate, đặc biệt là fructose. Nó rất giàu nhiều loại vitamin: C, B1, B6… Lá, hạt và trái của chúng được sử dụng trong y học có tác dụng tích cực tới bệnh tiểu đường, thấp khớp,…..\nXuất xứ: Đà Lạt\nHạn sử dụng: 12 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Đá xay : 60ml sinh tố Lafresh + 25ml sữa đặc + 10ml sữa tươi + 5ml cốt chanh tươi + 1 ly đá. Cho tất cả hỗn hợp vào máy xay xay nhuyễn.\n- Trà trái cây : 40ml sinh tố Lafresh + 80ml cốt trà + 10ml mật ong + 1 ly đá. Cho tất cả hỗn hợp lắc đều.\n- Soda trái cây : 30ml sinh tố Lafresh + 1 trái tắc + 3 lá húng lũi + 20ml nước đường + 80ml Soda. Dằm 3 lá húng, tắc và nước đường đều xong cho tất cả nguyên liệu còn lại vào ly.\n- Có thể dùng sinh tố Lafresh kết hợp với các nguyên liệu pha chế để tạo ra thức uống theo khẩu vị riêng của bạn.\n',75000,66000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,600),(742,'Sinh Tố Phúc Bồn Tử Lafresh Đà Lạt - Chai Thủy Tinh 350ml',0,'2022-12-29 08:45:45','742GE',0,44,0,'https://appdala.net/wp-content/uploads/sinh-to-350ml-1.jpg','https://appdala.net/wp-content/uploads/COT-650-LF-mall-13.jpg;https://appdala.net/wp-content/uploads/COT-650-LF-mall-14.jpg','','SINH TỐ PHÚC BỒN TỬ LAFRESH ĐÀ LẠT 350ML \nPHÚC BỒN TỬ( Quả Mâm Xôi) -  Trái Cây Kỳ Diệu\nPhúc bồn tử được xếp hàng thượng phẩm trong biểu đồ đánh giá thực phẩm. Những hoạt chất quý có trong phúc bồn tử mang lại giá trị vượt trội cho sức khỏe \nXuất xứ: Đà Lạt\nHạn sử dụng: 12 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Đá xay : 60ml sinh tố Lafresh + 25ml sữa đặc + 10ml sữa tươi + 5ml cốt chanh tươi + 1 ly đá. Cho tất cả hỗn hợp vào máy xay xay nhuyễn.\n- Trà trái cây : 40ml sinh tố Lafresh + 80ml cốt trà + 10ml mật ong + 1 ly đá. Cho tất cả hỗn hợp lắc đều.\n- Soda trái cây : 30ml sinh tố Lafresh + 1 trái tắc + 3 lá húng lũi + 20ml nước đường + 80ml Soda. Dằm 3 lá húng, tắc và nước đường đều xong cho tất cả nguyên liệu còn lại vào ly.\n- Có thể dùng sinh tố Lafresh kết hợp với các nguyên liệu pha chế để tạo ra thức uống theo khẩu vị riêng của bạn.\n',120000,100000,NULL,NULL,100,1,24,1,1,0,1,'','','',NULL,NULL,NULL,600),(743,'Sinh Tố Dâu Tây Lafresh Đà Lạt Chai Thủy Tinh 350ml',0,'2022-12-29 08:47:11','743QK',0,44,0,'https://appdala.net/wp-content/uploads/sinh-to-350ml-2.jpg','','','SINH TỐ DÂU TÂY LAFRESH ĐÀ LẠT 350ML\nDâu tây là nguồn cung cấp vitamin C tuyệt vời. Một chén dâu tây chứa 51,5mg vitamin C, khoảng ½ nhu cầu hàng ngày của cơ thể. Như vậy, chỉ với hai chén dâu tây, bạn đã có đủ 100% lượng vitamin C theo yêu cầu. Vitamin C là chất có khả năng tăng cường miễn dịch đồng thời còn là một chất chống oxy hóa mạnh mẽ. Một cuộc nghiên cứu của trường ĐH California, Los Angeles, Mỹ ,vào năm 2010 đã phát hiện ra rằng, khả năng chống oxy hóa trong dâu tây sẽ trở nên khả dụng về mặt sinh học và sẵn sàng hoạt động trong máu sau khi ăn loại trái cây chỉ trong vài tuần lễ.\nXuất xứ: Đà Lạt\nHạn sử dụng: 12 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n- Đá xay : 60ml sinh tố Lafresh + 25ml sữa đặc + 10ml sữa tươi + 5ml cốt chanh tươi + 1 ly đá. Cho tất cả hỗn hợp vào máy xay xay nhuyễn.\n- Trà trái cây : 40ml sinh tố Lafresh + 80ml cốt trà + 10ml mật ong + 1 ly đá. Cho tất cả hỗn hợp lắc đều.\n- Soda trái cây : 30ml sinh tố Lafresh + 1 trái tắc + 3 lá húng lũi + 20ml nước đường + 80ml Soda. Dằm 3 lá húng, tắc và nước đường đều xong cho tất cả nguyên liệu còn lại vào ly.\n- Có thể dùng sinh tố Lafresh kết hợp với các nguyên liệu pha chế để tạo ra thức uống theo khẩu vị riêng của bạn.\n',76000,66000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,600),(744,'Sinh Tố Dâu Tằm Lafresh Đà Lạt - Chai Thủy Tinh 350ml',0,'2022-12-29 08:48:27','7449Y',0,44,0,'https://appdala.net/wp-content/uploads/sinh-to-350ml-3.jpg','https://appdala.net/wp-content/uploads/COT-650-LF-mall-11.jpg;https://appdala.net/wp-content/uploads/COT-650-LF-mall-12.jpg','','SINH TỐ DÂU TẰM LAFRESH ĐÀ LẠT - CHAI THỦY TINH 350ML\nĐược sản xuất trên dây chuyền hiện đại theo công nghệ chân không của Pháp, nguyên liệu được tuyển lựa khắt khe từ những nông trang sạch tại Đà Lạt. Thế nên Nước cốt trái cây nguyên chất cô đặc Lafresh cho hương vị thơm ngon đậm đà như trái cây tươi. Lưu giử được các giá trị dinh dưỡng quý vốn có của từng loại trái cây.\nXuất xứ: Đà Lạt\nHạn sử dụng: 12 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Đá xay : 60ml sinh tố Lafresh + 25ml sữa đặc + 10ml sữa tươi + 5ml cốt chanh tươi + 1 ly đá. Cho tất cả hỗn hợp vào máy xay xay nhuyễn.\n- Trà trái cây : 40ml sinh tố Lafresh + 80ml cốt trà + 10ml mật ong + 1 ly đá. Cho tất cả hỗn hợp lắc đều.\n- Soda trái cây : 30ml sinh tố Lafresh + 1 trái tắc + 3 lá húng lũi + 20ml nước đường + 80ml Soda. Dằm 3 lá húng, tắc và nước đường đều xong cho tất cả nguyên liệu còn lại vào ly.\n- Có thể dùng sinh tố Lafresh kết hợp với các nguyên liệu pha chế để tạo ra thức uống theo khẩu vị riêng của bạn.\n',76000,66000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,600),(745,'Sinh Tố Chanh Dây Lafresh Đà Lạt - Chai Thủy Tinh 350ml',0,'2022-12-29 09:09:23','74577',0,44,0,'https://appdala.net/wp-content/uploads/sinh-to-350ml-4.jpg','https://appdala.net/wp-content/uploads/COT-650-LF-mall-9.jpg;https://appdala.net/wp-content/uploads/COT-650-LF-mall-10.jpg','','SINH TỐ CHANH DÂY LAFRESH ĐÀ LẠT 350ML \nNgười ta đã chứng minh trong chanh dây có đầy đủ nguồn vitamin A và C, sắt, kali và các thành phần dinh dưỡng khác cũng như các hoạt chất sinh học có lợi cho sức khoẻ. Hạt chanh dây là một nguồn chất xơ tuyệt vời, chính chất cơm nhầy bao quanh hạt làm cho chanh dây có mùi thơm đặc biệt.\nXuất xứ: Đà Lạt\nHạn sử dụng: 12 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Đá xay : 60ml sinh tố Lafresh + 25ml sữa đặc + 10ml sữa tươi + 5ml cốt chanh tươi + 1 ly đá. Cho tất cả hỗn hợp vào máy xay xay nhuyễn.\n- Trà trái cây : 40ml sinh tố Lafresh + 80ml cốt trà + 10ml mật ong + 1 ly đá. Cho tất cả hỗn hợp lắc đều.\n- Soda trái cây : 30ml sinh tố Lafresh + 1 trái tắc + 3 lá húng lũi + 20ml nước đường + 80ml Soda. Dằm 3 lá húng, tắc và nước đường đều xong cho tất cả nguyên liệu còn lại vào ly.\n- Có thể dùng sinh tố Lafresh kết hợp với các nguyên liệu pha chế để tạo ra thức uống theo khẩu vị riêng của bạn.\n',76000,66000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,600),(746,'Gừng Mật Ong Lafresh Đà Lạt - Chai thủy tinh 350ml',0,'2022-12-29 09:32:32','746V',0,44,0,'https://appdala.net/wp-content/uploads/COT-650-LF-mall-8.jpg','https://appdala.net/wp-content/uploads/COT-650-LF-mall-6.jpg;https://appdala.net/wp-content/uploads/COT-650-LF-mall-7.jpg','','NƯỚC CỐT GỪNG MẬT ONG LAFRESH 350ML \nGừng và mật ong là một loại thuốc bổ, giảm mật độ axit của dịch vị, làm axit dạ dày hoạt động bình thường. \"Nó có thể chữa được nhiều bệnh như viêm loét dạ dày, hành tá tràng, viêm gan, viêm túi mật, diệt vi trùng\". \nMật ong có đầy đủ các khoáng chất và vitamin giúp trung hòa hiệu ứng này, từ đó giúp giảm mức cholesterol và hỗ trợ giảm cân. \nGừng tươi có vị cay, tính ấm, thơm, gừng khô có vị cay, tính nóng, thơm hắc. \nGừng tươi có thể chữa cảm mạo, phong hàn, ngạt mũi, nhức đầu, đau đầu, nôn mửa, kích thích tiêu hóa, đầy bụng, trướng bụng, giải độc từ cua cá, chim thú nếu có độc, các loại thịt (trừ thịt lợn vì gừng kỵ thịt lợn) khi ăn vào cơ thể.\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',123000,93000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,600),(747,'Nước Cốt Gừng Sả Mật Ong LaFresh Đà Lạt - Hủ thủy tinh 500ml',0,'2022-12-29 09:35:34','747XK',0,44,0,'https://appdala.net/wp-content/uploads/COT-650-LF-mall-3.jpg','https://appdala.net/wp-content/uploads/COT-650-LF-mall-4.jpg;https://appdala.net/wp-content/uploads/COT-650-LF-mall-5.jpg','','NƯỚC CỐT GỪNG SẢ MẬT ONG LAFRESH ĐÀ LẠT 500ML \nNgoài ra, Gừng, sả và mật ong là một loại nước uống bổ, giảm mật độ axit của dịch vị, làm axit dạ dày hoạt động bình thường. \nMật ong có đầy đủ các khoáng chất và vitamin giúp trung hòa hiệu ứng này, từ đó giúp giảm mức cholesterol và hỗ trợ giảm cân. \nGừng tươi có vị cay, tính ấm, thơm, gừng khô có vị cay, tính nóng, thơm hắc. \nGừng tươi có thể làm giảm cảm mạo, phong hàn, ngạt mũi, nhức đầu, đau đầu, nôn mửa, kích thích tiêu hóa, đầy bụng, trướng bụng, giải độc từ cua cá, chim thú nếu có độc, các loại thịt (trừ thịt lợn vì gừng kỵ thịt lợn) khi ăn vào cơ thể.\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',152000,132000,NULL,NULL,127,1,24,1,1,0,1,'','','',NULL,NULL,NULL,800),(748,'Nước Cốt Gừng Mật Ong LaFresh Đà Lạt - Hủ thủy tinh 1kg',0,'2022-12-29 09:36:38','748BF',0,44,0,'https://appdala.net/wp-content/uploads/COT-650-LF-mall-2-1.jpg','https://appdala.net/wp-content/uploads/COT-650-LF-mall-2.jpg;https://appdala.net/wp-content/uploads/COT-650-LF-mall-1.jpg','','NƯỚC CỐT GỪNG MẬT ONG LAFRESH ĐÀ LẠT 1KG \nGừng và mật ong là một loại thuốc bổ, giảm mật độ axit của dịch vị, làm axit dạ dày hoạt động bình thường. \"Nó có thể chữa được nhiều bệnh như viêm loét dạ dày, hành tá tràng, viêm gan, viêm túi mật, diệt vi trùng\". Mật ong có đầy đủ các khoáng chất và vitamin giúp trung hòa hiệu ứng này, từ đó giúp giảm mức cholesterol và hỗ trợ giảm cân. Gừng tươi có vị cay, tính ấm, thơm, gừng khô có vị cay, tính nóng, thơm hắc. Gừng tươi có thể chữa cảm mạo, phong hàn, ngạt mũi, nhức đầu, đau đầu, nôn mửa, kích thích tiêu hóa, đầy bụng, trướng bụng, giải độc từ cua cá, chim thú nếu có độc, các loại thịt (trừ thịt lợn vì gừng kỵ thịt lợn) khi ăn vào cơ thể.\n- Xuất xứ: Đà Lạt\n- Hạn sử dụng: 1 năm\n\n--- BẢO QUẢN ---\n* Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n* Giữ lạnh khi mở nắp ( 5- 10°C).\n* Không sử dụng khi có mùi lạ, mốc, biến màu.\n\n--- CÁCH SỬ DỤNG ---\n* Lắc đều trước khi sử dụng.\n* Pha nước ép trái cây theo tỉ lệ: 1 phần dịch quả Lafresh và 2 phần nước ( hoặc 4 phần đá viên ) để uống.\n* Có thể pha chế với các nguyên liệu: sữa tươi, sữa chua, kem sữa hoặc pha với rượu thêm đá tùy sở thích.\n* Nên bảo quản lạnh và sử dụng trong vòng bảy ngày sau khi mở nắp. Không sử dụng sản phẩm khi có mùi lạ, mốc, và có hiện tượng lên men.\n',210000,198000,NULL,NULL,0,0,24,1,1,0,1,'','','',NULL,NULL,NULL,1500),(749,'draf',0,'2022-12-31 08:46:48','749WX',0,44,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(750,'draf',0,'2023-01-04 00:16:16','750QL',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(751,'draf',0,'2023-01-04 00:16:20','751TP',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100),(752,'Sinh tố dâu tằm Lafresh Đà Lạt Chai 650ml',0,'2023-01-05 14:01:22','752D',0,44,0,'https://appdala.net/wp-content/uploads/COT-650-LF-mall-18.jpg','https://appdala.net/wp-content/uploads/COT-650-LF-mall-19.jpg;https://appdala.net/wp-content/uploads/COT-650-LF-mall-20.jpg','','SINH TỐ DÂU TẰM LAFRESH ĐÀ LẠT 650ML \nQuả dâu tằm đen hoặc đỏ là loại trái cây thuộc họ quả mọng. Loại quả này được yêu thích bởi vị chua ngọt dễ chịu cũng như giàu các vitamin, khoáng chất tốt cho sức khỏe.\nXuất xứ: Đà Lạt\nHạn sử dụng: 12 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Đá xay : 60ml sinh tố Lafresh + 25ml sữa đặc + 10ml sữa tươi + 5ml cốt chanh tươi + 1 ly đá. Cho tất cả hỗn hợp vào máy xay xay nhuyễn.\n- Trà trái cây : 40ml sinh tố Lafresh + 80ml cốt trà + 10ml mật ong + 1 ly đá. Cho tất cả hỗn hợp lắc đều.\n- Soda trái cây : 30ml sinh tố Lafresh + 1 trái tắc + 3 lá húng lũi + 20ml nước đường + 80ml Soda. Dằm 3 lá húng, tắc và nước đường đều xong cho tất cả nguyên liệu còn lại vào ly.\n- Có thể dùng sinh tố Lafresh kết hợp với các nguyên liệu pha chế để tạo ra thức uống theo khẩu vị riêng của bạn.\n',82000,65000,NULL,NULL,100,1,24,1,1,0,1,'','','',NULL,NULL,NULL,750),(753,'Sinh tố Phúc bồn tử Lafresh Đà Lạt chai 650ml ',0,'2023-01-05 14:13:53','753R8',0,44,0,'https://appdala.net/wp-content/uploads/COT-650-LF-mall-15.jpg','https://appdala.net/wp-content/uploads/COT-650-LF-mall-17.jpg;https://appdala.net/wp-content/uploads/COT-650-LF-mall-16.jpg','','SINH TỐ PHÚC BỒN TỬ 650ML\nPHÚC BỒN TỬ( Quả Mâm Xôi) -  Trái Cây Kỳ Diệu\nPhúc bồn tử được xếp hàng thượng phẩm trong biểu đồ đánh giá thực phẩm. Những hoạt chất quý có trong phúc bồn tử mang lại giá trị vượt trội cho sức khỏe như:\nFlavonoid có trong phúc bồn tử giúp bảo vệ, tái tạo và làm đẹp da, đen tóc.\nAnthocyanin  trong phúc bồn tử là hoạt chất quý giúp phòng ngừa ung thư  hiệu quả\nChất chống ôxy hóa mạnh trong phúc bồn tử giúp tăng khả năng tư duy và sáng tạo\nEllagitannin  giúp chống lão hóa,  gấp ba lần trái kiwi, việt quất, gấp mười lần cà chua.\nCarotenoid,Vitamin A, C, E và các khoáng chất vi lượng như Cu,Zn có nhiều trong Phúc Bồn tử  giúp loại trừ các gốc tự do gây hại cho võng mạc. từ đó giúp bảo vệ mắt và tăng cường thị lực. \nXuất xứ: Đà Lạt\nHạn sử dụng: 12 tháng\n*** BẢO QUẢN ***\n- Bảo quản nơi thoáng mát, tốt nhất: 20°C.\n- Giữ lạnh khi mở nắp ( 5- 10°C).\n- Không sử dụng khi có mùi lạ, mốc, biến màu.\n*** CÁCH SỬ DỤNG***\n- Đá xay : 60ml sinh tố Lafresh + 25ml sữa đặc + 10ml sữa tươi + 5ml cốt chanh tươi + 1 ly đá. Cho tất cả hỗn hợp vào máy xay xay nhuyễn.\n- Trà trái cây : 40ml sinh tố Lafresh + 80ml cốt trà + 10ml mật ong + 1 ly đá. Cho tất cả hỗn hợp lắc đều.\n- Soda trái cây : 30ml sinh tố Lafresh + 1 trái tắc + 3 lá húng lũi + 20ml nước đường + 80ml Soda. Dằm 3 lá húng, tắc và nước đường đều xong cho tất cả nguyên liệu còn lại vào ly.\n- Có thể dùng sinh tố Lafresh kết hợp với các nguyên liệu pha chế để tạo ra thức uống theo khẩu vị riêng của bạn.\n',140000,132000,NULL,NULL,0,0,24,1,1,0,1,'','','',NULL,NULL,NULL,650),(756,'Cà Phê Hạt Rang Mộc, tự nhiên SeedKfe, trọng lượng 500gr',0,'2023-01-11 11:39:08','7562J',0,45,0,'https://appdala.net/wp-content/uploads/ESPRSSO.jpg','','','CÀ PHÊ HẠT RANG EXPRESSO\nVị đắng hoang sơ cùng vị ngọt hậu\nĐược phối trộn 100% hạt cà phê Arabica Cầu Đất Đà Lạt và hạt Robusta trồng tại vùng đất Laba (Phú Sơn - Lâm Hà) với tỷ lệ phối trộn hoàn hảo, giữ lại trọn vẹn hương vị chân thực trong từng hạt cà phê: đắng đậm, ngọt hậu mà sâu lắng. Đó cũng là hương vị mang bản sắc riêng từ nông trại Seed Kfé.\nHương vị cà phê: \nHương vị cân bằng, hương thơm nhẹ nhàng, không quá nồng nhưng lại rất khó quên. Chút đắng, chút ngọt dịu, chút chua hậu. Tất cả được hội tụ đầy đủ trong ly cà phê của bạn. Giúp bạn có những trải nghiệm phong phú hơn trong khi thưởng thức.\nThông tin sản phẩm:\nThành phần: 100% hạt cà phê Arabica và Robusta\nKhối lượng tịnh:500g\nXuất xứ: Đà Lạt - Lâm Đồng - Việt Nam\nCấp độ rang: Rang nâu vừa\n- Hướng dẫn sử dụng: Xay cà phê trước khi pha chế, sản phẩm phù hợp tất cả các kiểu pha\n\n',155000,125000,NULL,NULL,0,0,25,1,1,0,1,'','','1. Tên sản phẩm: Viết bằng chữ in thường, viết hay và thu hút ví dụ như thêm: expresso thơm ngon đậm đà.... trọng lượng bao nhiêu,...\n2. Mô tả sản phẩm: ghi rõ thời hạn sử dụng\nXuất xứ vùng nào....\n3. Up lại hình sản phẩm ah: lưu ý là up hình đại diện và bộ sưu tập đầy đủ, để tăng tính thẩm mỹ cho sản phẩm.',NULL,NULL,NULL,500),(757,'Cà Phê bột Hảo Hạng, Pha Phin, SeedKfe trọng lượng 500gr',0,'2023-01-13 00:47:56','7573N',0,45,0,'https://appdala.net/wp-content/uploads/HH.jpg','','','Cà Phê Bột Hảo Hạng\nHương thơm độc đáo, vị đắng nhẹ,chua thanh\nCà phê Hảo Hạng chế biến theo phương pháp mật ong (Processing Honey) với công thức phối trộn 100% hạt cà phê Arabica và Robusta.\nThông Tin Sản Phẩm:\nThành phần: 100% hạt cà phê Arabica và Robusta\nKhối lượng tịnh: 500g/ 1kg\nXuất xứ: Đà Lạt - Lâm Đồng - Việt Nam\nCấp độ rang: Rang vừa (Medium roast)',155000,125000,'2023-01-13 00:00:00','2023-01-21 23:59:59',0,0,25,1,1,0,1,'','','',NULL,NULL,NULL,500),(758,'Cà Phê Laba Blend, Pha Phin, trọng lượng 500gr',0,'2023-01-13 00:53:07','758T8',0,45,0,'https://appdala.net/wp-content/uploads/SP-LABA-HH.jpg','','','Cà Phê Laba Blend (Pha Phin)\nVị đắng đậm hoang sơ cùng vị ngọt thanh nhẹ\nDòng cà phê Laba Blend được phối trộn 100% hạt cà phê Arabica Cầu Đất Đà Lạt và hạt Robusta trồng tại vùng đất Laba (Phú Sơn - Lâm Hà - Lâm Đồng) với tỷ lệ phối trộn hoàn hảo, giữ lại trọn vẹn hương vị chân thực trong từng hạt cà phê: đắng đậm, ngọt hậu mà sâu lắng. Đó cũng là hương vị mang bản sắc riêng từ nông trại Seed Kfé.\nThông tin sản phẩm:\nThành phần: 100% hạt cà phê Arabica và Robusta\nKhối lượng tịnh: 500g\nXuất xứ: Đà Lạt - Lâm Đồng - Việt Nam\nCấp độ rang: Rang vừa (Medium roast)',125000,105000,NULL,NULL,0,0,25,1,1,0,1,'','','',NULL,NULL,NULL,500),(759,'Cà Phê Phin Túi Lọc SeedKfe, hộp 10 gói',0,'2023-01-13 00:57:31','759M',0,45,0,'https://appdala.net/wp-content/uploads/phin-giay.jpg','','','Cà Phê Phin Túi Lọc_100% cafe nguyên chất - món QUÀ ý nghĩa tặng người thân.\nThành phần: 100% hạt Cà phê Arabica, Robusta\nĐặc tính: Hương thơm mang phong vị truyền thống của cà phê Việt Nam, chua ngọt cân bằng, hậu vị êm dịu.\nMô tả sản phẩm: Tuyệt phẩm Cà Phê Phin giấy Seedkfe Vietnam Blend với hương thơm đặc trưng của cà phê Việt Nam truyền thống sẽ mang đến bạn sự tỉnh thức mạnh mẽ cho những ý tưởng sáng tạo đột phá.\n- Sản phẩm cà phê túi lọc là sự lựa chọn tuyệt vời cho những tín đồ cà phê, phù hợp với những người làm văn phòng, hay đi công tác, du lịch. Chỉ với 1 phút bạn đã có ngay 1 tách cà phê thơm ngon nguyên chất trên bãi biển, trong phòng làm việc hoặc ngay trong phòng khách sạn, không tốn thời gian, không phải rửa phin.\n- Túi lọc nhập khẩu từ Nhật - An toàn, chất lượng.\n- CÀ PHÊ PHIN TÚI LỌC thiết kế có quai móc trên miệng ly giống kiểu vành phin nhôm ở quán cà phê, giống hệt như một quán cà phê tại văn phòng, với những giọt cà phê lách tách nhỏ xuống ly.\n- Hộp 10 gói x 17g (kèm 10 tép đường)\n* HDSD:\n- Xé ngang theo đường chỉ dẫn\n- Kéo phần móc treo và gài vào miệng ly\n- Cho khoảng 30ml nước 92-96C vào phin giấy, chờ 20 giây cho cà phê ngấm.\n- Sau đó từ từ thêm nước nóng vào 2-3 lần tùy khẩu vị đậm nhạt\n- Nếu bạn muốn ủ lâu, bạn có thể để phin ngập trong ly thấp để có cảm giác đậm, đắng hơn\n\n\n',149000,125000,NULL,NULL,0,0,25,1,1,0,1,'','','',NULL,NULL,NULL,170),(760,'draf',0,'2023-01-15 20:23:31','7604F',0,17,0,'','','','',0,NULL,NULL,NULL,0,0,NULL,0,1,0,0,'','','',NULL,NULL,NULL,100);
